INSERT INTO `berita` VALUES (164, 1, 'admin', 'Hak Perempuan', 'hak-perempuan', '<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\">Perempuan sering kali termarjinalkan oleh konsepsi sosial budaya di masyarakat yang cenderung patriarkis tanpa melihat hak. Perlakuan diskriminatif kerap kali diterima perempuan Indonesia, baik dalam &nbsp;kehidupan sosial maupun dunia profesional.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\">Hak apa saja? Berikut lima di antaranya yang kami rangkum dari Konvensi mengenai Penghapusan Segala Bentuk Diskriminasi terhadap Perempuan (CEDAW), yang ditandatangani pada 1979 dalam konferensi yang &nbsp;diadakan Komisi Kedudukan Perempuan PBB.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\"><span style=\"box-sizing: border-box; font-weight: bolder;\">1. Hak dalam ketenagakerjaan</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\">Setiap perempuan berhak untuk memiliki kesempatan kerja yang sama dengan laki-laki.Hak ini meliputi kesempatan yang sama dari proses seleksi, fasilitas kerja, tunjangan, dan hingga hak untuk menerima upah yang setara. Selain itu, perempuan berhak untuk mendapatkan masa cuti yang dibayar, termasuk saat cuti melahirkan. Perempuan tidak bisa diberhentikan oleh pihak pemberi tenaga kerja dengan alasan kehamilan &nbsp;maupun status pernikahan.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\"><span style=\"box-sizing: border-box; font-weight: bolder;\">2. Hak dalam bidang kesehatan</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\">Perempuan berhak untuk mendapatkan kesempatan bebas dari kematian pada saat melahirkan, dan hak tersebut harus diupayakan oleh negara. Negara juga berkewajiban menjamin diperolehnya pelayanan kesehatan, khususnya pelayanan KB, kehamilan, persalinan, dan pasca-persalinan.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\"><span style=\"box-sizing: border-box; font-weight: bolder;\">3. Hak yang sama dalam pendidikan</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\">Seperti salah satu poin perjuangan RA Kartini, setiap perempuan berhak untuk mendapatkan kesempatan mengikuti pendidikan, dari tingkat dasar hingga universitas. Harus ada penghapusan pemikiran stereotip &nbsp;mengenai peranan laki-laki dan perempuan dalam segala tingkatan dan &nbsp;bentuk pendidikan, termasuk kesempatan yang sama untuk mendapatkan beasiswa.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\"><span style=\"box-sizing: border-box; font-weight: bolder;\">4. Hak dalam perkawinan dan keluarga</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\">Perempuan harus ingat bahwa ia punya hak yang sama dengan laki-laki dalam perkawinan. Perempuan punya hak untuk memilih suaminya secara bebas, dan tidak boleh ada perkawinan paksa. Perkawinan yang dilakukan &nbsp;haruslah berdasarkan persetujuan dari kedua belah pihak dalam keluarga, perempuan juga memiliki hak dan tanggung jawab yang sama, baik sebagai orang tua terhadap anaknya, maupun pasangan suami-istri.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\"><span style=\"box-sizing: border-box; font-weight: bolder;\">5. Hak dalam kehidupan publik dan politik</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\">Dalam kehidupan publik dan politik, setiap perempuan berhak untuk memilih dan dipilih. Setelah berhasil terpilih lewat proses yang demokratis, perempuan juga harus mendapatkan kesempatan yang sama untuk berpartisipasi dalam perumusan kebijakan pemerintah hingga implementasinya</p>\r\n', 'Rabu', '2020-04-29', '00:16:37', '79thumb_69_1200_564_0_0_exact.jpg', 1, '');
INSERT INTO `berita` VALUES (161, 1, 'admin', 'Hari Penghapusan Diskriminasi Rasial Sedunia', 'hari-penghapusan-diskriminasi-rasial-sedunia', '<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\"><span style=\"box-sizing: border-box; font-weight: bolder;\">Sejarah Peringatan</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\">Peringatan khusus ini di latar belakangi oleh peristiwa Sharpeville di Afrika Selatan. Pada tanggal 21 Maret 1960, sebuah tragedi terjadi di Sharpeville dimana polisi Afrika Selatan menembak peserta aksi demonstrasi damai yang menentang hukum apartheid. Pengertian apartheid adalah salah satu jenis politik yang menggunakan sistem pemisahan dan pembedaan ras, agama, kepercayaan, dan pemisahan kelas sosial dimana kelompok mayoritas akan mendominasi kelompok minoritas. Politik ini menganggap kulit hitam itu orang hina dan perlu diasingkan. Politik ini termasuk pelanggaran HAM dan merupakan diskriminasi rasial yang dilakukan oleh bangsa barat.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\">Dalam peristiwa itu sebanyak 69 orang mati ditembak, termasuk delapan perempuan dan 10 anak-anak, sementara 180 orang lainnya luka-luka. Tahun 1966, Majelis Umum (MU) Perserikatan Bangsa-Bangsa (PBB) kemudian berhasil mengesahkan resolusi yang memproklamirkan tanggal 21 Maret sebagai Hari Internasional Penghapusan Diskriminasi. Rasisme adalah suatu sistem kepercayaan atau doktrin yang menyatakan bahwa perbedaan biologis yang melekat pada ras manusia menentukan pencapaian budaya atau individu &ndash; bahwa suatu ras tertentu lebih superior dan memiliki hak untuk mengatur ras yang lainnya.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\"><span style=\"box-sizing: border-box; font-weight: bolder;\">Tema Peringatan&nbsp;</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\">Pada tahun 2019 ini, tema yang dipilih dalam memperingati hari Hari Penghapusan Diskriminasi Rasial adalah mitigasi dan melawan meningkatnya supremasi nasionalisme dan ideologi yang ekstrim. Adanya gerakan gerakan ekstrim berbasis ras dan ideology untuk tujuan populis dan nasionalis berkembang di seluruh dunia, menyuburkan &nbsp;diskriminasi rasial dan kecurigaan serta intoleransi dengan menyasar &nbsp;pada kelompok migran dan pengungsi dan masyarakat kelompok berwarna, &nbsp;khususnya mereka yang memiliki keturunan Afrika.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\">Baru-baru ini terjadi kasus penembakan massal di dua masjid di kota Christchurch, Selandia Baru, terjadi pada Jumat siang, 15 Maret 2019 saat umat Islam selesai melaksanakan solat Jumat. Jumlah korban tewas telah bertambah dari 40 orang menjadi 49 orang. Mereka yang menjadi korban tewas mungkin adalah imigran atau pengungsi yang berlindung dan memilih Selandia Baru sebagai rumah mereka.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\">Kasus itu merupakan termasuk tindakan diskriminasi rasial. Tersangka yang tertangkap diketahui &nbsp;tergabung dalam kelompok ekstrimis sayap kanan. Salah satu teroris diidentifikasi sebagai pria kelahiran Australia yang menulis telah merencanakan aksi itu hingga dua tahun. Dokumen setebal lebih dari 70 halaman yang dikutip oleh media Australia dipenuhi dengan referensi `<em style=\"box-sizing: border-box;\">white power</em>`, menyebut imigran sebagai &quot; penjajah asing&quot; , dan menggambarkan serangan itu sebagai upaya untuk &quot; menciptakan suasana ketakutan&quot; .</p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\">Komunitas muslim di sana sudah pernah mengadu kepada pemerintah soal kekhawatiran tentang meningkatnya aksi kekerasan dan rasisme selama lima tahun belakangan. S<span style=\"box-sizing: border-box;\">eperti dilansir&nbsp;</span><em style=\"box-sizing: border-box;\">Associated Press</em><span style=\"box-sizing: border-box;\">, Kamis (21/3), seorang komisioner hubungan antar-ras Selandia Baru, Susan Devoy, menyatakan umat Islam di negara itu memang menghadapi kejahatan kebencian, pelecehan, dan ekstremisme selama bertahun-tahun.&nbsp;</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\">Contoh kasus tersebut menunjukan masih terdapat kasus rasis dan intoleransi masih berkembang. Perlu ada tindakan tegas dari Polisi dan aparat berwenang guna menindak kaum intoleran, dengan dukungan konstitusional. Sebab, persoalan intoleransi bukanlah sekadar sentimen sosial, melainkan persoalan elit dengan motif politik di belakangnya.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\"><span data-key=\"164\" style=\"box-sizing: border-box; font-weight: bolder;\">Nilai Kemajemukan bagi Indonesia</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\">Di Indonesia, peringatan itu mungkin kurang begitu digalakkan. Namun secara relevansi, tentu saja amat berkaitan. Sebagai negara&nbsp;<em style=\"box-sizing: border-box;\">mega cultural diversity</em>, &nbsp;Indonesia memiliki 250 kelompok etnis dengan 500 jenis bahasa daerah. &nbsp;Bermacam-macam agama dan kepercayaan pun berkembang tanpa batasan di &nbsp;sini. Namun sayang, perlakuan &nbsp;diskriminatif masih saja terjadi. Agama menjadi isu yang paling kerap &nbsp;&lsquo;digoreng&rsquo; hingga berujung pertikaian. Bahkan momentum Pemilihan &nbsp;Presiden 2019 sekalipun, tak sungkan dikait-kaitkan dengan agama. Inilah &nbsp;pentingnya penanaman nilai toleransi dan dialog di atas perbedaan sejak &nbsp;dini. Walau bagaimanapun, Indonesia akan selalu tumbuh majemuk. Tidak &nbsp;bisa disamakan dengan negara yang menerapkan satu hukum agama saja.</p>\r\n\r\n<p data-key=\"92\" style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\">Sebagai bangsa yang majemuk, peringatan hari ini tidak hanya relevan, namun sifatnya sangat krusial. Indonesia dikenal sebagai&nbsp;<em data-key=\"165\" style=\"box-sizing: border-box;\">mega cultural diversity</em>. Setidaknya terdapat 250 kelompok etnis dengan lebih dari 500 jenis &nbsp;bahasa daerah di Indonesia. Bermacam-macam agama dan kepercayaan juga &nbsp;berkembang di negara ini.Setelah &nbsp;periode reformasi, banyak kalangan meramalkan dengan tingginya tingkat &nbsp;keberagaman yang dimiliki Indonesia, negara ini pada akhirnya akan &nbsp;menjadi negara gagal (<em data-key=\"166\" style=\"box-sizing: border-box;\">failed state</em>), apalagi dengan lepasnya wilayah Timor-Timur serta pergolakan di Aceh dan Papua.</p>\r\n\r\n<p data-key=\"110\" style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\">Fund For Peace (FfP), sebuah lembaga penelitian independen internasional berusaha &nbsp;memberikan analisa yang lebih mendalam atas penilaian ini. Menurut FfP, &nbsp;terdapat dua belas indikator yang menentukan apakah suatu negara dapat dinilai sebagai&nbsp;<em data-key=\"169\" style=\"box-sizing: border-box;\">failed state</em>&nbsp;atau tidak. Berdasarkan berbagai indikator tersebut, FfP bekerja sama &nbsp;dengan majalah Foreign Policy tiap tahunnya menghasilkan laporan Failed &nbsp;State Index (FSI) yang seringkali digunakan sebagai rujukan publik untuk &nbsp;menganalisa kondisi kerentanan suatu negara.&nbsp;</p>\r\n\r\n<p data-key=\"127\" style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\">Berdasarkan &nbsp;laporan FSI terakhir (2017), Sudan Selatan menempati ranking pertama, &nbsp;disusul oleh Somalia dan Republik Afrika Tengah. Bagaimana posisi Indonesia. Indonesia&nbsp;sendiri berada di ranking 94 dari 178 negara dengan total skor 72.9. &nbsp;Posisi tersebut sesungguhnya naik dari ranking sebelumnya di tahun 2016 &nbsp;dimana Indonesia berada pada ranking 86 dengan total skor 74.9. Apalagi &nbsp;jika dibandingkan dengan posisi sepuluh tahun lalu yang menunjukkan &nbsp;Indonesia berada di ranking 55.</p>\r\n\r\n<p data-key=\"149\" style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\">Meskipun &nbsp;bagi banyak negara, Indonesia dinilai dapat mencegah kemajemukan &nbsp;menjadi suatu ancaman kebangsaan, penanaman nilai toleransi dan &nbsp;pentingnya dialog di atas perbedaan tetap perlu dilakukan sejak dini dan &nbsp;dilakukan sehari-hari. Terlebih lagi menjelang Pemilihan Presiden 2019, keberagaman ini hampir pasti akan menjadi isu yang dipolitisasi yang &nbsp;dapat menghasilkan perpecahan bangsa. Semuanya tergantung dari kita &nbsp;semua, apakah kita bisa memaknai kemajemukan yang kita miliki sebagai &nbsp;suatu berkah, atau sebagai suatu musibah.&nbsp;</p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\">&nbsp;</p>\r\n', 'Rabu', '2020-04-29', '00:15:14', '99thumb_99_1200_564_0_0_exact.jpg', 1, '');
INSERT INTO `berita` VALUES (162, 1, 'admin', 'Mencapai Kesetaraan Gender Dan Memberdayakan Kaum Perempuan', 'mencapai-kesetaraan-gender-dan-memberdayakan-kaum-perempuan', '<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\">Gender adalah pembedaan peran, atribut, sifat, sikap dan perilaku &nbsp;yang tumbuh dan berkembang dalam masyarakat. Dan peran gender terbagi &nbsp;menjadi peran produktif, peran reproduksi serta peran sosial &nbsp;kemasyarakatan.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\">Kata gender dapat diartikan sebagai peran yang dibentuk oleh masyarakat serta perilaku yang tertanam lewat proses sosialisasi yang &nbsp;berhubungan dengan jenis kelamin perempuan dan laki-laki. Ada perbedaan &nbsp;secara biologis antara perempuan dan laki-laki-namun kebudayaan &nbsp;menafsirkan perbedaan biologis ini menjadi seperangkat tuntutan sosial &nbsp;tentang kepantasan dalam berperilaku, dan pada gilirannya hak-hak, sumber daya, dan kuasa. Kendati tuntutan ini bervariasi di setiap masyarakat, tapi terdapat beberapa kemiripan yang mencolok. Misalnya, hampir semua kelompok masyarakat menyerahkan tanggung jawab perawatan &nbsp;anak pada perempuan, sedangkan tugas kemiliteran diberikan pada &nbsp;laki-laki. Sebagaimana halnya ras, etnik, dan kelas, gender adalah sebuah kategori sosial yang sangat menentukan jalan hidup seseorang dan partisipasinya dalam masyarakat dan ekonomi. Tidak semua masyarakat &nbsp;mengalami diskriminasi berdasarkan ras atau etnis, namun semua &nbsp;masyarakat mengalami diskriminasi berdasarkan gender-dalam bentuk &nbsp;kesenjangan dan perbedaan-dalam tingkatan yang berbeda-beda. Seringkali dibutuhkan waktu cukup lama untuk mengubah ketidakadilan ini. Suasana ketidakadilan ini terkadang bisa berubah secara drastis karena kebijakan &nbsp;dan perubahan sosial-ekonomi.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\">Pengertian kesetaraan gender merujuk kepada suatu keadaan setara &nbsp;antara laki-laki dan perempuan dalam pemenuhan hak dan kewajiban. Diskriminasi berdasarkan gender masih terjadi pada seluruh aspek &nbsp;kehidupan, di seluruh dunia. Ini adalah fakta meskipun ada kemajuan yang &nbsp;cukup pesat dalam kesetaraan gender dewasa ini. Sifat dan tingkat &nbsp;diskriminasi sangat bervariasi di berbagai negara atau wilayah. Tidak ada satu wilayah pun di negara dunia ketiga di mana perempuan telah &nbsp;menikmati kesetaraan dalam hak-hak hukum, sosial dan ekonomi. Kesenjangan gender dalam kesempatan dan kendali atas sumber daya, ekonomi, kekuasaan, dan partisipasi politik terjadi di mana-mana. Perempuan dan anak perempuan menanggung beban paling berat akibat &nbsp;ketidaksetaraan yang terjadi, namun pada dasarnya ketidaksetaraan itu merugikan semua orang. Oleh sebab itu, kesetaraan gender merupakan persoalan pokok suatu tujuan pembangunan yang memiliki nilai tersendiri.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\">Kesetaraan gender akan memperkuat kemampuan negara untuk berkembang, mengurangi kemiskinan, dan memerintah secara efektif. Dengan demikian &nbsp;mempromosikan kesetaraan gender adalah bagian utama dari strategi &nbsp;pembangunan dalam rangka untuk memberdayakan masyarakat (semua &nbsp;orang)-perempuan dan laki-laki-untuk mengentaskan diri dari kemiskinan dan meningkatkan taraf hidup mereka. Pembangunan ekonomi membuka banyak jalan untuk meningkatkan &nbsp;kesetaraan gender dalam jangka panjang. Agenda Tujuan Pembangunan &nbsp;Berkelanjutan memiliki makna yang penting karena setelah diadopsi maka akan dijadikan acuan secara global dan nasional sehingga agenda pembangunan menjadi lebih fokus. Setiap butir tujuan tersebut menjunjung tinggi Hak Asasi Manusia (HAM) dan untuk mencapai kesetaraan gender dan &nbsp;pemberdayaan perempuan, baik tua mau-pun muda.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\"><span style=\"box-sizing: border-box; font-weight: bolder;\">Sasaran Global</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\">- Mengakhiri segala bentuk diskriminasi terhadap kaum perempuan di mana pun</p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\">- Menghilangkan segala bentuk kekerasan terhadap kaum perempuan di ruang publik dan pribadi, termasuk &nbsp;perdagangan manusia dan eksploitasi seksual, serta berbagai jenis eksploitasi lainnya</p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\">- Menghilangkan semua praktek berbahaya, seperti pernikahan anak, pernikahan dini dan paksa, serta sunat perempuan</p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\">- Menjamin partisipasi penuh dan efektif, dan kesempatan yang sama bagi perempuan untuk memimpin di semua tingkat &nbsp;pengambilan keputusan dalam kehidupan politik, ekonomi, dan masyarakat</p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\">- Menjamin akses universal terhadap kesehatan seksual dan reproduksi, dan hak reproduksi seperti yang telah disepakati sesuai dengan Programme of Action of the International Conference on Population and Development and the Beijing Platform serta dokumen-dokumen hasil review dari konferensi-konferensi tersebut</p>\r\n', 'Rabu', '2020-04-29', '00:15:43', '77thumb_70_1200_564_0_0_exact.jpg', 1, '');
INSERT INTO `berita` VALUES (163, 1, 'admin', 'Pembangunan Gender', 'pembangunan-gender', '<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: center;\"><span style=\"box-sizing: border-box; font-weight: bolder;\">PEMBANGUNAN GENDER, DAN HAL-HAL YANG (BELUM) SELESAI</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\"><span style=\"box-sizing: border-box;\">Pernah dengar ungakapan &ldquo;belajarlah sampai ke negeri Cina? Gambaran tersebut, diibaratkan bahwa untuk &nbsp;mendapatkan pendidikan yang baik penduduk Indonesia harus belajar di &nbsp;negara lain. Memang tidak semiris itu, namun faktanya kita tidak dapat &nbsp;menutup mata jika pendidikan di Indonesia masih berada pada level &nbsp;sedang, jika dibandingkan dengan Negara-negara lain di dunia. Tapi tau &nbsp;kah anda, rata-rata penduduk di Indonesia bersekolah berapa lama? Hanya &nbsp;sampai setingkat kelas 7 Sekolah Menengah Pertama (SMP)!</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\">Hasil penghitungan Kementerian Pemberdayaan &nbsp;Perempuan dan Perlindungan Anak (Kemen PPPA) kerjasama BPS (2017) &nbsp;menunjukkan, capaian Indeks Pembangunan Gender (IPG) Indonesia tahun &nbsp;2016 sebesar 90,82 atau mengalami penurunan sebesar 0,21 poin atau 0,23% &nbsp;dari tahun sebelumnya sebesar 91,03. Padahal, selama tahun 2010-2015, &nbsp;IPG selalu mengalami peningkatan. Semakin dekat angka IPG ke 100, maka &nbsp;semakin kecil kesenjangan pembangunan antara laki-laki dan perempuan. &nbsp;Ada banyak hambatan dalam implementasinya yang dihadapi sehingga angka IPG Indonesia menurun, salah satunya adalah pendidikan.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\"><span style=\"box-sizing: border-box;\">Menurunnya &nbsp;IPG Indonesia tahun 2016 berasal dari pertumbuhan komponen IPM perempuan &nbsp;yang lambat dibandingkan dengan laki-laki, terutama pada komponen &nbsp;harapan lama sekolah (HLS). Di Indonesia, HLS menghitung harapan &nbsp;penduduk dari usia 7 tahun ke atas dalam memperoleh pendidikan. Harapan &nbsp;lama sekolah menggambarkan keberhasilan pembangunan pendidikan jangka &nbsp;pendek. Dalam film Laskar Pelangi, pada awal cerita, anda akan disuguhkan kondisi sekolah SD Muhammadiyah Gantung, Belitung yang akan &nbsp;ditutup karena kekurangan satu orang siswa apabila tidak genap 10. &nbsp;Artinya saat itu, kurang lebih ada 9 orang anak yang harapannya untuk &nbsp;dapat bersekolah, terancam gagal. Realitasnya saat ini, harapan lama &nbsp;sekolah anak-anak Indonesia masih rendah jika dibandingkan negara lain &nbsp;di ASEAN. Kondisi infrastruktur dan sarana prasarana menjadi contoh &nbsp;faktor yang dapat mempengaruhi harapan lama sekolah (HLS) seorang anak.</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\">Data&nbsp;<em style=\"box-sizing: border-box;\">Human Development Report</em>&nbsp;(HDR) 2016 menunjukkan, Indonesia hanya berada di urutan 5 setingkat &nbsp;ASEAN dalam capaian komponen harapan lama sekolah (HLS) IPM tahun 2015. &nbsp;Seorang anak (tanpa melihat gender) di Indonesia, kemungkinannya dapat &nbsp;bersekolah hanya selama 12,9 tahun. Dengan kata lain, harapan seorang &nbsp;anak di Indonesia dapat mengenyam pendidikan kira-kira hingga lulus SMA &nbsp;atau masuk perguruan tinggi semester awal saja. Sedangkan Singapura &nbsp;menempati peringkat 1 di level ASEAN, dengan harapan lama sekolah &nbsp;seorang anak di sana mencapai 15,4 tahun atau hampir lulus setingkat &nbsp;perguruan tinggi. Maka tidak heran jika akhirnya banyak orang Indonesia mengimpikan bersekolah atau kuliah di luar negeri terutama negara maju.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\"><span style=\"box-sizing: border-box;\">Jangankan &nbsp;bermimpi bisa bersekolah di luar negeri, tidak jarang kita mendengar ada &nbsp;anak yang bercita-cita ingin sekolah di luar daerah asalnya. Bisa jadi &nbsp;karena kondisi di daerahnya tidak memungkinkan ia dapat bersekolah lebih &nbsp;lama. Misalnya dalam Film Laskar Pelangi, para siswa SD Muhammadiyah &nbsp;Gantung yang berada di Kecamatan Gantung Belitung Timur, dianjurkan &nbsp;harus pergi ke ibu kota kabupaten atau daerah lainnya untuk bisa &nbsp;melanjutkan sekolah setingkat SMP, karena di daerahnya belum ada &nbsp;fasilitas sekolah setingkat sekolah menengah. Faktanya, Provinsi Kep. &nbsp;Bangka Belitung tahun 2016 menjadi daerah dengan angka harapan sekolah &nbsp;penduduknya hanya sebesar 11,71 tahun. Terendah kedua, setelah Provinsi &nbsp;Papua sebesar 10,23 tahun. Yogyakarta menjadi provinsi dengan AHH paling &nbsp;tinggi sebesar 15,23 tahun, kemudian menyusul berurutan adalah Provinsi &nbsp;Aceh 13,89 tahun, Sumatera Barat 13,79 tahun.</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\">Itu baru &nbsp;fakta harapan penduduk Indonesia bisa sekolah. Mari bandingkan dengan &nbsp;kenyataan sebenarnya lewat angka rata-rata lama sekolah (RLS). Berdasarkan laporan&nbsp;<em style=\"box-sizing: border-box;\">Human Development Report</em>&nbsp;(HDR) yang &nbsp;dilakukan oleh UNDP pada tahun 2016, Rata-rata seseorang bersekolah di &nbsp;Indonesia tahun 2015, hanya selama 7,9 tahun, yang hitungannya bahkan &nbsp;hanya sampai kelas 8 atau belum lulus setingkat sekolah menengah pertama (SMP). Jauh tertinggal jika kembali dibandingkan dengan Singapura yang &nbsp;lama sekolah penduduknya rata-rata adalah 11,6 tahun atau kurang lebih &nbsp;bersekolah hingga kelas 12 setingkat sekolah menengah atas (SMA).</p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\"><span style=\"box-sizing: border-box;\">Sekarang kita kerucutkan dengan melihat capaian pendidikan antara perempuan dan laki-laki. Secara data menunjukkan ketimpangan lama sekolah &nbsp;antara perempuan dan laki-laki memang terjadi di Indonesia. Data &nbsp;Pembangunan Manusia Berbasis Gender 2017 menunjukkan, tahun 2016, rata-rata lama penduduk perempuan sekolah hanya selama 7,5 tahun. Cukup &nbsp;berbeda jika dibandingkan dengan laki-laki yang bersekolah selama 8,41 &nbsp;tahun. Artinya, perempuan di Indonesia rata-rata bersekolah hanya sampai &nbsp;kelas 8 (SMP). Sedangkan secara rata-rata, laki-laki mengenyam &nbsp;pendidikan sekitar 1 tahun lebih lama dibandingkan perempuan atau hingga &nbsp;kelas 9 (SMP). Tetap saja, faktanya rata-rata penduduk Indonesia bahkan &nbsp;tidak lulus setingkat SMP.</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\">Ketimpangan &nbsp;pendidikan juga dirasakan oleh penduduk satu daerah dengan daerah &nbsp;lainnya, misalnya antara Provinsi DKI Jakarta dan Provinsi Papua. Sesuai &nbsp;dengan data Pembangunan Manusia Berbasis gender 2017, DKI Jakarta pada &nbsp;tahun 2016 menjadi provinsi dengan rata-rata penduduknya bersekolah &nbsp;paling lama baik perempuan maupun laki-laki. Rata-rata lama sekolah &nbsp;perempuan di Jakarta mencapai 10,42 tahun, atau mengenyam pendidikan &nbsp;hingga kelas 11 SMA dan laki-laki mencapai 11,34 tahun atau hingga kelas &nbsp;12 SMA. Bandingkan dengan Provinsi Papua. Papua menjadi provinsi dengan &nbsp;rata-rata lama sekolah paling rendah, baik laki-laki maupun perempuan. Rata-rata perempuan di Papua hanya mengenyam pendidikan selama 5,32 &nbsp;tahun atau tidak menamatkan sekolah dasar (SD), sedangkan penduduk &nbsp;laki-laki kondisinya sedikit lebih baik dengan bersekolah selama 6,90 &nbsp;tahun atau minimal menamatkan SMP. Capaian tersebut bahkan lebih rendah dari angka rata-rata lama sekolah secara nasional.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\"><span style=\"box-sizing: border-box;\">Perbedaan &nbsp;capaian rata-rata lama sekolah antara laki-laki dan perempuan &nbsp;dipengaruhi banyak faktor yang saling terkait, salah satunya adalah budaya. Budaya patriarki yang masih kuat di Indonesia menyebabkan anak &nbsp;perempuan lebih dikesampingkan untuk mendapatkan pendidikan dibandingkan &nbsp;anak laki-laki. Meski demikian, setidaknya perempuan semakin sadar &nbsp;untuk mengakses pendidikan dan bersekolah, yang ditunjukkan dari angka &nbsp;rata-rata lama sekolah pada perempuan tahun 2016 meningkat sebesar 2,04 &nbsp;dari tahun sebelumnya. Pemerintah baik pusat maupun daerah sebagai &nbsp;penyelenggara negara perlu melakukan upaya-upaya serius untuk menyelesaikan masalah-masalah diatas, terutama mendongkrak keberhasilan pembangunan pendidikan bukan hanya jangka pendek tapi juga jangka &nbsp;panjang. Mendorong pemenuhan hak anak atas pendidikan sesuai dengan &nbsp;Keputusan Presiden No.36 Tahun 1990 tentang Konvensi Hak Anak, dan &nbsp;menyukseskan agenda Nawa Cita pemerintahan Jokowi yang bertujuan meningkatkan kualitas hidup manusia Indonesia, dari segi pendidikan. &nbsp;(ach).</span></p>\r\n', 'Rabu', '2020-04-29', '00:16:12', '96thumb_67_1200_564_0_0_exact.jpeg', 1, '');
INSERT INTO `berita` VALUES (155, 2, 'operator', 'OLAHRAGA PEMBUKAAN DI AWAL TAHUN 2020 DINAS PEMBERDAYAAN PEREMPUAN, PERLINDUNGAN ANAK DAN KEPENDUDUKAN (DP3AK) PROVINSI JAWA TIMUR', 'olahraga-pembukaan-di-awal-tahun-2020-dinas-pemberdayaan-perempuan-perlindungan-anak-dan-kependuduka', '<figure class=\"wp-block-image size-large\" style=\"box-sizing: border-box; margin: 0px 0px 1em; padding: 0px; border-width: 0px; border-style: initial; border-color: initial; font-size: 14px; vertical-align: baseline; background-color: rgb(255, 255, 255); max-width: 100%; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif; text-align: start;\">\r\n<figcaption style=\"box-sizing: border-box; margin-top: 0.5em; margin-bottom: 1em;\">Olahraga Pembukaan di Awal Tahun 2020 Dinas Pemberdayaan Perempuan, Perlindungan Anak dan kependudukan (DP3AK) Provinsi Jawa Timur</figcaption>\r\n</figure>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 24px; font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif; color: rgb(102, 102, 102);\">&nbsp;</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 24px; font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif; color: rgb(102, 102, 102);\">Dinas Pemberdayaan Perempuan, Perlindungan Anak dan Kependudukan (DP3AK) Provinsi Jawa Timur, pada awal tahun mengadakan olahraga senam bersama seluiruh pegawai, Jum&rsquo;at (3/01). Seluruh pegawai setiap hari Jum&rsquo;at sudah absen pada pukul 06.30 WIB karena pada pukul 07.00 WIB pegawai sudah melaksanakan senam selama 30 menit.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 24px; font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif; color: rgb(102, 102, 102);\">Kegiatan tersebut termasuk Gerakan Masyarakat Hidup Sehat (GERMAS) yang merupakan gerakan nasional yang diprakarsai oleh Presiden RI yang mengedepankan upaya promotif dan preventif. Senam yang dilaksanakan di halaman depan Dinas P3AK Provinsi Jatim.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 24px; font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif; color: rgb(102, 102, 102);\">Senam pagi pada minggu pertama ini, seluruh pegawai Dinas P3AK Provinsi Jatim tampak kompak dan penuh semangat dalam mengikuti gerakan senam yang telah diinstruksikan oleh instruktur senam.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 24px; font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif; color: rgb(102, 102, 102);\">Senam pagi setiap hari Jum&rsquo;at wajib diikuti oleh seluruh pegawai Dinas P3AK Provinsi Jatim, pada senam tersebut guna merekatkan antar pegawai sehingga terjalin kerja sama dengan baik. Setelah senam pagi dilanjutkan dengan Apel Pagi guna untuk memulai awal kegiatan. Kemudian dilanjut dengan permainan voli.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 24px; font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif; color: rgb(102, 102, 102);\">L.A &ndash; UPN</p>\r\n', 'Selasa', '2020-04-28', '23:31:31', '62WhatsApp-Image-2020-01-31-at-07.55.59-1024x472.jpeg', 1, '');
INSERT INTO `berita` VALUES (156, 2, 'operator', 'Rapat Evaluasi Kinerja PNS Dalam Rangka Prestasi Kinerja PNS Tahun 2020', 'rapat-evaluasi-kinerja-pns-dalam-rangka-prestasi-kinerja-pns-tahun-2020', '<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 24px; font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif; color: rgb(102, 102, 102);\">Dinas Pemberdayaan Perempuan, Perlindungan Anak dan Kependudukan (DP3AK) Provinsi Jawa Timur mengadakan rapat evaluasi kinerja PNS guna meningkatkan target kinerja dari tahun sebelumnya di ruang rapat DP3AK. Rapat yang berlangsung pada 8 Januari 2020 dihadiri Riamiki dan Nurul dari BKD Provinsi Jawa Timur sebagai narasumber dan Diana Rimayanti selaku Sekretaris Dinas P3AK Provinsi Jawa Timur.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 24px; font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif; color: rgb(102, 102, 102);\"><br style=\"box-sizing: border-box;\" />\r\nRapat tersebut dihadiri oleh seluruh karyawan DP3AK Jatim yang berstatus Pegawai Negeri Sipil (PNS). Dalam rapat tersebut Riamiki mengungkapkan bahwa Organisasi Perangkat Daerah (OPD) yang nilainya lebih dari 100 itu semua awalnya dari target awal tahun. Jadi sasaran melebihi 75.000 menit, sudah pasti realisasi akhir tahun melebihi nilai 100.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 24px; font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif; color: rgb(102, 102, 102);\"><br style=\"box-sizing: border-box;\" />\r\nKesepakatan pada tahun 2020 bagi seluruh karyawan yang naik pangkat bisa turun status dan tidak ada larang sasaran kinerja pegawai (SKP) terlalu tinggi melebihi nilai 100. Tidak ada sanksi bagi pelaksana yang memiliki nilai lebih tinggi dari pengawas kecuali jika terjadi penurunan nilai dari tahun lalu maka akan mendapatkan sanksi. Pada tahun 2020 sudah tidak menggunakan SKP manual lagi melainkan sudah online. Namun bagi karyawan yang belum selesai menegrjakan SKP pada tahun 2019 maka karyawan tidak bisa mengerjakan SKP tahun 2020.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 24px; font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif; color: rgb(102, 102, 102);\"><br style=\"box-sizing: border-box;\" />\r\nKendala pada tahun ini adalah tingginya nilai SKP yang melebihi nilai 100 pada akhir tahun. Tetapi tidak terdapat standarisasi nilai SKP bagi seorang pelaksana melainkan tergantung kebijakan dari masing-masing OPD tentang penetapan nilai SKP. Capaian realisasi benar-benar perlu diperhatikan karena penilaiannya di akhir tahun. Karyawan perlu memperhatikan dalam mengisi kuantitas target pada aplikasi karena akan menjadi acuan dalam mengisi realisasi setiap bulan dan berkesinambungan. Dalam kenaikan pangkat untuk 2 tahunnya terdapat penilaian perilaku minimal 77</p>\r\n', 'Selasa', '2020-04-28', '23:32:12', '991-1024x686.jpeg', 1, '');
INSERT INTO `berita` VALUES (157, 2, 'operator', 'Dharma Wanita Dinas Pemberdayaan Perempuan Perlindungan Anak Dan Kependudukan Jawa Timur Di Awal Tahun 2020', 'dharma-wanita-dinas-pemberdayaan-perempuan-perlindungan-anak-dan-kependudukan-jawa-timur-di-awal-tah', '<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 24px; font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif; color: rgb(102, 102, 102);\">Kegiatan Dinas Pemberdayaan Perempuan Perlindungan Anak dan Kependudukan Jawa Timur mengadakan pertemuan Dharma Wanita di awal tahun. Pertemuan tersebut bertujuan untuk merekatkan para istri Pegawai Negeri Sipil (PNS) yang lama sudah senyap dan mulai dihidupkan kembali pada tahun 2020. Acara yang diadakan di ruang rapat hanya 20%&nbsp; dari istri PNS DP3AK Jatim (10/01).</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 24px; font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif; color: rgb(102, 102, 102);\">Kegiatan Dharma Wanita tersebut dihadiri oleh Diana Rimayanti Sekretaris Dinas P3AK Provinsi Jawa Timur sebagai pembuka acara dan Lala sebagai pengisi acara dari Oriflame. Diana menyampaikan bahwa akan dihidupkan kembali pertemuan Dharma Wanita setiap dua bulan sekali untuk merekatkan para istri. Setiap 2 bulan sekali diadakan arisan Rp.50.000 dari potongan gaji. Jika ada salah satu anggota mendapat bencana maka akan diadakan kontribusi kurang lebih Rp. 250.000 dari iuran sosial.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 24px; font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif; color: rgb(102, 102, 102);\">Pertemuan pertama memang diisi materi umum yang mana ibu-ibu bisa menghasilkan uang tanpa keluar rumah dengan menggunakan gadget. Oriflame memberikan materi tentang produk dan menjadi member yang menguntungkan bagi ibu-ibu rumah tangga. Dengan bergabung hanya dikenai biaya Rp.300.000 sudah menjadi member sekaligus mendapatkan satu produk Oriflame.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 24px; font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif; color: rgb(102, 102, 102);\">Diakhir acara terdapat doorprize berupa kebutuhan pokok misal minyak goreng, deterjen dan sebagainya. Hal ini menjadi daya tarik bagi para istri untuk mengikuti acara selanjutnya. Selain itu terdapat sisa kotak jajan, kemudian dilelang seharga Rp. 10.000 perkotak.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 24px; font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif; color: rgb(102, 102, 102);\">L.A &ndash; UPN</p>\r\n', 'Selasa', '2020-04-28', '23:33:26', '31WhatsApp-Image-2020-01-31-at-07.58.05-2-1024x768.jpeg', 1, '');
INSERT INTO `berita` VALUES (158, 2, 'operator', 'Upacara KORPRI Awal Tahun 2020 Dinas Pemberdayaan Perempuan Perlindungan Anak Dan Kependudukan Jawa Timur', 'upacara-korpri-awal-tahun-2020-dinas-pemberdayaan-perempuan-perlindungan-anak-dan-kependudukan-jawa-', '<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 24px; font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif; color: rgb(102, 102, 102);\">Aparatur Sipil Negara (ASN) wajib melakukan upacara KORPRI disetiap bulannya pada tanggal 17, upacara rutin dilakukan karena pada tanggal 17 Agustus dilaksanakan upacara bendera dalam rangka memperingati HUT Kemerdekaan RI sehingga harus menggunakan seragam KORPRI bagi semua ASN. Dinas Pemberdayaan Perempuan perlindungan Anak dan Kependudukan (DP3AK) Jawa Timur melakukan upacara rutin tersebut di halaman kantor&nbsp; DP3AK Jatim(17/01). Upacara dibuka oleh Santi Ani sebagai protokol dengan komandan upacara Eddo Putra Irianto dan Mochammad Wahyu Adi selaku pembaca Teks Pembukaan UUD 1945. Upacara yang berlangsung lancar dan dilakukan secara khidmat oleh seluruh pegawai DP3AK Jatim.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 24px; font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif; color: rgb(102, 102, 102);\">Pegawai Negeri Sipil atau PNS memiliki lima butir janji atau komitmen terhadap Negara Kesatuan Republik Indonesia. Dalam upacara tersebut Ahmad Ramli membacakan Panca Prasetya KORPRI dan diikuti seluruh pegawai DP3AK Jatim. Pegawai negeri Sipil memiliki janji/sumpah yang disebut Panca prasetya KORPRI dengan tujuan pegawai yang bekerja secara profesional, jujur, mengutamakan kepentingan negara dan masyarakat diatas kepentingan pribadi.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 24px; font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif; color: rgb(102, 102, 102);\">Inspektur upacara Diana Rimayanti Sekretaris Dinas P3AK Jatim berpesan &ldquo; Dari sosialisasi KPK bahwa eselon 3 diwajibkan untuk mengisi Laporan Harta Kekayaan Penyelenggara Negara (LHKPN) Tahun 2020. Untuk mengisi LHKPN khususnya untuk eselon 3 harus menggunakan username dan efin yang harus diterima BKD paling lambat 20 Januari 2020. Jika belum mengirimkan sampai tanggal 31 Maret 2020 akan di potong Tunjangan Penghasilan Pegawai (TPP) sebesar 20% pada bulan pertama.&nbsp; Selanjutnya diharapkan seluruh pegawai DP3AK mematuhi peraturan yang sudah dibuat seperti tidak merokok sembarangan, kedisiplinan pegawai yaitu masuk pukul 07.00 WIB kemudian pada hari Jum&rsquo;at masuk pukul 06.30 WIB dan mengikuti senam setiap hari Jum&rsquo;at dan sebagainya&rdquo;.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 24px; font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif; color: rgb(102, 102, 102);\">Upacara diakhiri dengan pembacaan doa yang dipimpin oleh Ferdy Hermawan secara khusyuk. Dilanjut dengan laporan komandan upacara kepada inspektur upacara dan penghormatan. Upacara selesai pasukan bisa dibubarkan dan melakukan aktivitas seperti biasa sesuai dengan bidangnya.</p>\r\n', 'Selasa', '2020-04-28', '23:33:54', '69WhatsApp-Image-2020-01-17-at-07.30.32-1024x768.jpeg', 1, '');
INSERT INTO `berita` VALUES (159, 2, 'operator', 'Rapat Koordinasi PUSPA â€œGayatriâ€ Terkait Rencana Kegiatan Tahun 2020 Terutama Di Desa Kepuh Kiriman Sidoarjo', 'rapat-koordinasi-puspa-â€œgayatriâ€-terkait-rencana-kegiatan-tahun-2020-terutama-di-desa-kepuh-kiri', '<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 24px; font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif; color: rgb(102, 102, 102);\">Partisipasi Publik untuk kesejahteraan perempuan dan anak (PUSPA) Gayatri merupakan forum di Provinsi Jawa Timur pada sektor pemberdayaan perempuan dan anak. Dalam rapat koordinasi PUSPA Gayatri tersebut di buka oleh Rofie Narulita sekretaris PUSPA Gayatri dan dalam rapat tersebut dihadiri oleh perwakilan dari Pokja Anak, Pokja Masyarakat, Pokja Perempuan. Pembahasan rapat kali ini tentang kegiatan PUSPA Gayatri di tahun 2020. Itu merupakan topik dari diskusi para sukarelawan yang dilaksanakan di ruang rapat Kartini Dinas P3AK Jatim pada hari Jum&rsquo;at (23/01).</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 24px; font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif; color: rgb(102, 102, 102);\">Indarsyah Chalifayanti sebagai wakil ketua I PUSPA menyatakan bahwa saya berharap PUSPA Gayatri tidak hanya di miliki Dinas P3AK saja melainkan Dinas lain yang bersinergi dan berkerjasama dengan PUSPA Gayatri. Dengan adanya kerjasama antar Dinas mampu mengembangkan dan memperkenalkan PUSPA Gayatri. &ldquo;Saya ingin kita menguplek Desa Kepuh Kiriman, Waru Sidoarjo pada pokja Anak seperti Peraturan Desa (PERDES), rumah curhat, Forum anak. Kemudian pada Pokja perempuan saya berkeinginan memberikan pelatihan sentra makanan yang berasal dari sumber daya alam, akssesoris yang berasal dari kain perca&rdquo;&nbsp; ujar Indarsyah Chalifayanti. Dengan adanya program yang direncanakan mampu memberikan keterampilan dan mengurangi tingkat kekerasan pada perempuan dan anak di Desa Kepuh Kiriman kecamatan Waru, Sidoarjo.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 24px; font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif; color: rgb(102, 102, 102);\">Dipilihnya Desa Kepuh Kiriman Kecamatan Waru karena dilihat dari data kekerasan pada perempuan dan anak di Jawa Timur masih sangat tinggi di Desa tersebut. PUSPA Gayatri pada tahun 2018 berkesempatan memilih satu Desa satu Kecamatan untuk mengakhiri kekerasan pada perempuan dan anak. Berbagai program diharapkan tidak terdapat kesenjangan perempuan dan laki-laki.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 24px; font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif; color: rgb(102, 102, 102);\">Namun PUSPA Gayatri belum banyak diketahui oleh masyarakat terutama di Provinsi Jawa Timur. Padahal dibentuknya forum PUSPA Gayatri bertujuan menyetarakan gender terutama mengakhiri kesenjangan ekonomi bagi perempuan dan mengakhiri ketertinggalan perempuan dalam politik. Untuk memperkenalkan PUSPA Gayatri para sukarelawan berencana untuk lebih aktif dalam acara-acara tertentu seperti membuka stand di event Surabaya Fun Run yang akan diadakan pada 2 Februari 2020. Mereka akan mendirikan stand sekaligus memberikan informasi kepada masyarakat tentang PUSPA Gayatri.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 24px; font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif; color: rgb(102, 102, 102);\">A.W.U &ndash; UPN</p>\r\n', 'Selasa', '2020-04-28', '23:35:11', '89Screenshot_1.jpg', 1, '');
INSERT INTO `berita` VALUES (160, 2, 'operator', 'Kegiatan Studi Banding DPR Dan Dinas Pemberdayaan Perempuan Sulawesi Barat Terhadap Jatim Dalam Mempertahankan Penghargaan Mentor APE', 'kegiatan-studi-banding-dpr-dan-dinas-pemberdayaan-perempuan-sulawesi-barat-terhadap-jatim-dalam-memp', '<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 24px; font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif; color: rgb(102, 102, 102);\">Provinsi Jawa Timur masih mempertahankan penghargaan Mentor APE pada tahun 2018 yang lalu. Rapat kali ini di hadiri tamu dari DPR dan Dinas Pemberdayaan Perempuan Sulawesi Barat yang berlangsung di ruang rapat Kartini lantai satu Dinas Pemberdayaan Perempuan, Perlindungan Anak dan Kependudukan (DP3AK) Jatim. Rapat yang diadakan dalam rangka studi banding tentang Peraturan Daerah No. 9 Tahun 2019 tentang Pengarusutamaan Gender (PUG) sebagai komitmen Jawa Timur dalam pembangunan Responsif Gender. Pada tahun 2018 Jatim memperoleh 27 Trophy penghargaan Anugerah Parahita Ekapraya (APE) untuk kategori Mentor dengan penghargaan tersebut Dinas Pemberdayaan Perempuan Sulawesi Barat ingin memperoleh informasi lebih tentang pengambilan keputusan, Peraturan Daerah (PERDA) maupun Peraturan Gubernur (PERGUB) di Jawa Timur.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 24px; font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif; color: rgb(102, 102, 102);\">Dalam rapat tersebut dibuka oleh Diana Rimayanti Sekretaris Dinas P3AK Jatim. &ldquo;Dinas Pemberdayaan Perempuan, Perlindungan Anak dan Kependudukan Jatim memiliki 3 kewenangan yang terdiri bidang pemberdayaan perempuan perlindungan anak, pengendalian penduduk, dan Kependudukan&rdquo;ujarnya. Dengan adanya bidang-bidang tersebut mampu memfokuskan pegawai dalam menangani kasus yang terjadi di Jawa Timur.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 20px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 24px; font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif; color: rgb(102, 102, 102);\">Meskipun Jawa Timur mendapat penghargaan APE tetapi masih memiliki banyak kekurangan dan PR. One Widyawati Kepala Bidang PUG dan PUHA DP3AK Jatim menyatakan &ldquo;Dalam pertemuan ini dijelaskan bagaimana penyusuna PERDA dan tahapannya dari 7 prasayarat gender kalau ingin membuat PERDA maka posisi komitmen sangat penting untuk menuju APE&rdquo;.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 24px; font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif; color: rgb(102, 102, 102);\">A.W.U &ndash; UPN</p>\r\n', 'Selasa', '2020-04-28', '23:35:56', '48WhatsApp-Image-2020-01-31-at-10.26.07.jpeg', 1, '');
INSERT INTO `berita` VALUES (165, 1, 'admin', 'Gender dan Perjalanan Indonesia Menuju Kesetaraan', 'gender-dan-perjalanan-indonesia-menuju-kesetaraan', '<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: center;\"><span style=\"box-sizing: border-box; font-weight: bolder;\">GENDER DAN PERJALANAN INDONESIA MENUJU KESETARAAN</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\"><span style=\"box-sizing: border-box;\"><em style=\"box-sizing: border-box;\">Sudahkah anda menonton film Laskar &nbsp;Pelangi dan Dilan 1990? Tahukah anda jika kedua film tersebut secara &nbsp;tidak langsung menggambarkan perjalanan pembangunan manusia berbasis &nbsp;gender di Indonesia?</em></span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\">Film Laskar Pelangi dan Dilan 1990, &nbsp;merupakan film yang mengambil tema pendidikan atau lebih tepatnya kisah &nbsp;tentang anak sekolah. Meski berada pada&nbsp;<em style=\"box-sizing: border-box;\">setting</em>&nbsp;waktu yang &nbsp;berbeda, kedua film menggambarkan pendidikan di Indonesia pada masanya. Tidak hanya itu, alur film didukung berdasarkan kisah nyata atau&nbsp;<em style=\"box-sizing: border-box;\">true story</em>, yang tentu tidak salah jika menyebut gambaran pendidikan Indonesia sedikit banyak dikonstruksi kembali oleh kedua film tersebut. Lalu apa kaitannya film Laskar Pelangi dan Dilan 1990 dengan pembangunan manusia di Indonesia? Berikut penjelasannya.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\"><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-weight: bolder;\">Ketidaksetaraan Gender di Indonesia</span></span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\">Ada hal yang perlu diluruskan, sebelum akhirnya berpindah ke-ranah isu &lsquo;kesetaraan gender&rsquo;, yakni pemahaman &nbsp;tentang gender itu sendiri. Tidak dapat dipungkiri, bahwa pemahaman &nbsp;mengenai gender seringnya salah kaprah di masyarakat. Gender, seringkali &nbsp;dikaitkan dengan jenis kelamin. Padahal, gender dan jenis kelamin &nbsp;merupakan dua hal yang berbeda. Jenis kelamin mengacu pada kondisi fisik &nbsp;yang secara lahiriah dimiliki oleh seseorang. Sedangkan gender adalah pembedaan peran, atribut, sifat, sikap dan perilaku yang tumbuh dan &nbsp;berkembang dalam masyarakat. Dan peran gender terbagi menjadi peran produktif, peran reproduksi serta peran sosial kemasyarakatan. Lalu, kondisi apa yang menyebabkan ketidaksetaraan gender? Yakni adanya perbedaan perlakuan yang diterima antara laki-laki dan perempuan di &nbsp;masyarakat berdasarkan alasan gender.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\"><span style=\"box-sizing: border-box;\">Pada Film Laskar Pelangi yang mengambil &nbsp;latar waktu tahun 1970-an, anda akan disuguhkan cerita 10 pelajar di SD Muhammadiyah Belitung, Provinsi Kepulauan Bangka Belitung yang berjuang &nbsp;mengeyam pendidikan di tengah kondisi ekonomi dan situasi sekolah yang &nbsp;tidak pasti. Namun menarik diperhatikan bahwa hanya ada satu anak &nbsp;perempuan bernama Sahara yang terdaftar sebagai siswa di sekolah &nbsp;tersebut, ke-9 lainnya adalah anak laki-laki. Hal ini menunjukkan, &nbsp;terpuruknya kualitas hidup perempuan saat itu yang ditandai dengan &nbsp;rendahnya akses pendidikan mereka dibanding laki-laki. Alasannya, dalam &nbsp;budaya Indonesia, perempuan lebih diarahkan untuk melakukan peran &nbsp;domestik dari pada peran publik. Misalnya saja pelarangan perempuan &nbsp;untuk bersekolah karena adanya pelabelan &ldquo;sumur, dapur, kasur&rdquo; sebagai &nbsp;tempat dimana perempuan seharusnya berada. Hal ini mengakibatkan ketidaksetaraan dan diskriminasi terhadap perempuan kerap terjadi sehingga akses dan peran mereka dalam berbagai sektor terhambat. Disaat itu pula, belum ada kebijakan pemerintah yang menangani khusus masalah kesetaraan gender.</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\"><span style=\"box-sizing: border-box; font-weight: bolder;\">Membaiknya Kualitas Hidup Perempuan</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\"><span style=\"box-sizing: border-box;\">Hadirnya Konvensi Penghapusan Segala Bentuk Diskriminasi Terhadap Perempuan atau&nbsp;<em style=\"box-sizing: border-box;\">Convention on the Elimination of All Forms of Discrimination Against Women</em>&nbsp;(CEDAW) adopsi PBB tahun 1979 untuk melindungi hak-hak perempuan yang &nbsp;disahkan pada tanggal 3 September 1981, menjadikan Indonesia 1 dari 189 &nbsp;negara yang menandatangani hasil konvensi tersebut pada tanggal 29 Juli &nbsp;1980. Baru kemudian di tanggal 13 September 1984, Indonesia &nbsp;meratifikasinya melalui Undang-Undang Nomor 7 Tahun 1984 Tentang &nbsp;Pengesahan Konvensi Mengenai Penghapusan Segala Bentuk Diskriminasi Terhadap Wanita (Convention On The Elimination Of All Forms Of &nbsp;Discrimination Against Women). Keterlibatan Indonesia pada isu-isu &nbsp;global mempengaruhi arah kebijakan pemerintah dalam pembangunan khususnya pembangunan manusia di berbagai sektor. Hal tersebut &nbsp;pelan-pelan mempersempit kesenjangan kesempatan antara laki-laki dan &nbsp;perempuan serta meningkatkan kualitas hidup keduanya. Salah satu &nbsp;contohnya, adalah bertambahnya perempuan yang mengeyam pendidikan. Dalam Film Dilan 1990, dengan perbedaan latar waktu 20 tahun dari Laskar &nbsp;Pelangi, representasi perempuan yang bersekolah digambarkan cukup &nbsp;banyak. Kita dengan mudahnya melihat Milea dan perempuan-perempuan lain &nbsp;mengenakan seragam sekolah. Hal ini sekaligus menunjukkan bahwa kualitas &nbsp;hidup perempuan dalam hal akses terhadap pendidikan semakin membaik.</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\">Sebagai langkah nyata pemerintah dalam melaksanakan percepatan dan pemerataan pembangunan di berbagai daerah di &nbsp;Indonesia, isu pengarusutamaan gender tertuang dalam visi pembangunan &nbsp;nasional melalui penghapusan diskriminasi gender. Rencana Pembangunan &nbsp;Jangka Menengah Nasional (RPJMN) 2015-2019 mencantumkan sasaran &nbsp;pembangunan perspektif gender yaitu peningkatan kualitas hidup perempuan, peningkatan peran perempuan di berbagai bidang kehidupan, pengintegrasian perspektif gender di semua tahapan pembangunan, dan &nbsp;penguatan kelembagaan pengarusutamaan gender, baik di level pusat maupun daerah.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\"><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-weight: bolder;\">Meningkatnya IPM Indonesia</span></span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\">Kualitas hidup sangat erat kaitannya &nbsp;dengan pembangunan khususnya pembangunan manusia. Dimana indikator untuk &nbsp;mengukur kualitas pembangunan manusia adalah terpenuhinya kebutuhan &nbsp;dasar dalam hal kesehatan, pendidikan dan perekonomian. Dari film Laskar &nbsp;Pelangi dan Dilan 1990, kita bisa melihat sekilas bahwa pembangunan &nbsp;manusia di Indonesia mengalami perbaikan dari waktu ke waktu, terlebih &nbsp;dalam konteks kekinian. Lihat saja masa depan dari Milea dalam film &nbsp;Dilan 1990 dan Ikal dalam film Laskara Pelangi, mereka kemudian &nbsp;digambarkan memiliki kualitas hidup yang baik ditandai dengan kesuksesan dalam hal finansial, karir dan pendidikan.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\"><span style=\"box-sizing: border-box;\">Secara kuantitatif, membaiknya kualitas hidup ditandai dengan peningkatan Indeks Pembangunan Manusia (IPM) baik &nbsp;pada laki-laki maupun perempuan. Indeks Pembangunan Manusia (IPM) adalah &nbsp;sebuah model statistik yang diperkenalkan&nbsp;<em style=\"box-sizing: border-box;\">United Nations Development Programme</em>&nbsp;(UNDP) pada tahun 1990, untuk mengukur kualitas hidup suatu wilayah. &nbsp;IPM sebagai suatu indeks disusun dari 3 (tiga) dimensi yakni; (1) &nbsp;Dimensi Kesehatan yang diwakili oleh Angka Harapan Hidup Saat Lahir; (2) &nbsp;Dimensi Pendidikan yang diwakili oleh 2 Indikator yakni angka Harapan Lama Sekolah (HLS) dan angka Rata-Rata Lama Sekolah (RLS); dan (3) &nbsp;Dimensi Standar Hidup Layak (SHL) yang diwakili oleh indikator PNB &nbsp;Perkapita.</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\">Berdasarkan laporan&nbsp;<em style=\"box-sizing: border-box;\">Human Development Report</em>&nbsp;(HDR) yang dilakukan oleh UNDP pada tahun 2016, Indeks Pembangunan &nbsp;Manusia (IPM) Indonesia tahun 2015 berada pada level sedang dengan &nbsp;capaian IPM sebesar 68,9 atau berada di peringkat 113 dari 188 negara. &nbsp;IPM Indonesia meningkat 0,3 poin atau sebesar 0,44 persen dari tahun &nbsp;2014. Capaian tersebut sebenarnya bukan suatu kebanggan mengingat fakta &nbsp;bahwa IPM Indonesia masih berada di bawah rata-rata dunia (71,7) dan &nbsp;setingkat&nbsp;<em style=\"box-sizing: border-box;\">Asociation of Southeast Asian Nations</em>&nbsp;(ASEAN) berada &nbsp;antara peringkat 5-6 untuk masing-masing indikator penyusunan IPM tersebut (UNDP, 2016). Oleh karena itu, dibutuhkan usaha ekstra bagi &nbsp;Indonesia untuk meningkatkan kualitas pembangunan manusia dari berbagai sisi agar menjadi Negara di kelomok pembangunan manusia level tinggi.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\"><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-weight: bolder;\">Menurunnya IPG 2016</span></span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\">Angka IPM laki-laki dan IPM perempuan sama-sama mengalami peningkatan dalam tujuh tahun terakhir. Sejak tahun &nbsp;2010 hingga sekarang, IPM laki-laki termasuk kategori &ldquo;tinggi&rdquo; yakni &nbsp;pada level di atas 70 dan perempuan berada pada level &ldquo;sedang&rdquo;. Artinya, &nbsp;kualitas hidup laki-laki dan perempuan semakin membaik. Hal ini diperkuat dari hasil penghitungan Badan Pusat Statistik (BPS) pada tahun &nbsp;2015-2016 yang menunjukkan IPM perempuan naik sebesar 0,69 persen dari &nbsp;angka 66,98 menjadi 67,44. Sedangkan IPM laki-laki naik sebesar 0.92 &nbsp;persen dari angka 73,58 menjadi 74,26.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\"><span style=\"box-sizing: border-box;\">IPM mengukur capaian pembangunan manusia di suatu wilayah secara umum, sehingga disparitas atau perbedaan jarak &nbsp;antara IPM laki-laki dan perempuan tidak terlihat. Untuk melihat capaian pembangunan manusia yang terpilih gender, UNDP memperkenalkan sebuah ukuran yakni Indeks Pembangunan Gender (IPG). Pada tahun 2010, penghitungan IPM mengalami perubahan dengan menggunakan metode baru, sehingga berdampak pada perubahan penghitungan IPG. Saat ini, IPG diformulasikan sebagai rasio antara IPM Perempuan dan IPM Laki-laki. &nbsp;Nilai IPG dapat digunakan sebagai bahan analisis perbandingan kualitas pembangunan perempuan dan laki-laki. Semakin dekat angka IPG ke 100, maka semakin kecil kesenjangan pembangunan antara laki-laki dan perempuan.</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\">Seperti yang telah disebutkan &nbsp;sebelumnya, IPM Indonesia baik laki-laki maupun perempuan dalam kurun &nbsp;waktu 6 tahun terakhir mengalami peningkatan termasuk di tahun 2016. &nbsp;Paradoksnya, IPG Indonesia pada tahun 2016 justru mengalami penurunan. Hasil pengukuran Kementerian pemberdayaan Perempuan dan Perlindungan &nbsp;Anak (Kemen PPPA) bekerjasama dengan BPS menunjukkan capaian Indeks Pembangunan Gender (IPG) Indonesia pada tahun 2016 sebesar 90,82 atau mengalami penurunan sebesar 0,21 poin atau 0,23 persen dari tahun &nbsp;sebelumnya dimana IPG tahun 2015 sebesar 91,03.&nbsp;</p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\"><span style=\"box-sizing: border-box;\">Mengapa hal ini bisa terjadi? Padahal &nbsp;IPM laki-laki dan perempuan meningkat? Meningkatnya IPM laki-laki dan perempuan tidak lantas membuat angka IPG ikut meningkat. Perumpaan &nbsp;sederhananya seperti ini, kembali ke Film Laskar Pelangi, meski di film &nbsp;tersebut representasi perempuan dan laki-laki sama-sama bersekolah, &nbsp;namun siapa yang akhirnya bersekolah hingga perguruan tinggi bahkan sampai ke luar negeri? Ya, Ikal, seorang laki-laki. Hal ini menunjukkan &nbsp;bahwa partisipasi sekolah pada perempuan lebih lambat dibandingkan &nbsp;laki-laki atau terjadi kesenjangan.</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\">Menurut data yang dikeluarkan BPS, Selama tahun 2010-2015, kecepatan pertumbuhan IPM perempuan selalu lebih besar dibandingkan IPM laki-laki. Hal tersebut menyebabkan IPG selalu &nbsp;naik setiap tahunnya. Namun, berbeda halnya dengan yang terjadi di tahun &nbsp;2016, IPM perempuan tumbuh sebesar 0,69 persen. Pertumbuhan tersebut &nbsp;nyatanya kalah cepat dengan IPM laki-laki yang tumbuh sebesar 0,92 &nbsp;persen. Hanya komponen rata-rata lama sekolah yang pertumbuhannya lebih &nbsp;baik dari tahun sebelumnya. Kontras dengan Angka Harapan Hidup (AHH), &nbsp;Harapan lama Sekolah (HLS) dan Pengeluaran perkapita yang justru &nbsp;mengalami perlambatan dibandingkan tahun 2015. Komponen HLS lah yang menjadi penyebab utama perlambatan IPM perempuan. HLS perempuan bahkan &nbsp;hanya tumbuh sebesar 0,87 persen, yang turun cukup signifikan &nbsp;dibandingkan tahun 2015 yang mencapai 2,27 persen. Pertumbuhan perempuan &nbsp;yang melambat ini kemudian menjadi faktor penyebab turunnya IPG pada &nbsp;tahun 2016.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: justify;\"><span style=\"box-sizing: border-box;\">Menurut Menteri Pemberdayaan Perempuan &nbsp;dan Perlindungan Anak (PPPA), Yohana Yembise, luas dan besarnya cakupan &nbsp;kesetaraan gender dalam berbagai bidang pembangunan, sangat membutuhkan &nbsp;sinergitas antar K/L, pusat-daerah, dan antar daerah juga berperan besar &nbsp;untuk meningkatkan daya ungkit pembangunan untuk mewujudkan tujuan &nbsp;pembangunan nasional, termasuk SDGs, secara merata dan adil. &ldquo;Mari &nbsp;bersama-sama meningkatkan kualitas hidup perempuan dan anak melalui &nbsp;strategi pengarusutamaan gender guna mewujudkan keadilan dan kesetaraan gender dalam berbagai dimensi pembangunan,&quot; ujar Menteri Yohana Yembise.</span></p>\r\n', 'Rabu', '2020-04-29', '00:17:04', '43thumb_68_1200_564_0_0_exact.jpeg', 1, '');
INSERT INTO `berita` VALUES (167, 2, 'admin', 'Aplikasi Andorid DP3AK', 'aplikasi-andorid-dp3ak', '<p>Download Aplikasi DP3AK&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"https://drive.google.com/file/d/1qVualQ4gaclHdP1X1GCO4NMcXxbUfvTg/view?usp=sharing\">disini</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Kamis', '2020-05-14', '13:10:46', '35download.jpg', 1, '');
INSERT INTO `berita` VALUES (168, 2, 'admin', 'DP3AK Jatim Minta Komitmen Daerah dalam Pembangunan Responsif Gender', 'dp3ak-jatim-minta-komitmen-daerah-dalam-pembangunan-responsif-gender', '<p><span style=\"color: rgb(71, 71, 71); font-family: verdana, sans-serif; font-size: 12px;\">Pelaksanaan pengarusutamaan gender (PUG) tidak akan terlaksana baik apabila tidak ada koordinasi yang maksimal. Baik antara tim penggerak, Pokja PUG yang anggotanya adalah semua perangkat daerah ditambah dengan lembaga-lembaga terkait.</span></p>\r\n\r\n<p><br style=\"box-sizing: border-box; color: rgb(71, 71, 71); font-family: verdana, sans-serif; font-size: 12px;\" />\r\n<span style=\"color: rgb(71, 71, 71); font-family: verdana, sans-serif; font-size: 12px;\">Kepala Dinas Pemberdayaan Perempuan, Perlindungan Anak dan Kependudukan (DP3AK) Provinsi Jatim, Dr Andriyanto SH MKes mengatakan, sampai saat ini setiap perangkat daerah telah solid dalam berkoordinasi melalui Tim Pokja PUG, aktif dalam menyelenggarakan pembangunan responsif gender. Termasuk dalam menyusun Perencanaan Penganggarn Responsif Gender (PPRG) atau Anggaran Resposif Gender (ARG).</span><br style=\"box-sizing: border-box; color: rgb(71, 71, 71); font-family: verdana, sans-serif; font-size: 12px;\" />\r\n<span style=\"color: rgb(71, 71, 71); font-family: verdana, sans-serif; font-size: 12px;\">&ldquo;Saya mengucapkan terima kasih atas komitmen perangkat daerah ini. Kebetulan tahun 2020 adalah tahun evaluasi pembangunan responsif gender. Saya berharap komitmen ini semakin meningkat karena evaluai tahun ini semakin berat untuk mempertahankan Anugrah Parahita Ekapraya(APE) pada katagori &lsquo;mentor&rsquo; yang sudah diperoleh Jatim sebanyak tiga kali berturut-turut,&rdquo; kata Andriyanto, saat acara Pertemuan Persiapan Evaluasi Pembangunan Responsif Gender Bagi Perangkat Daerah Provinsi Jatim, di Hotel Elmi Surabaya yang digelar 18-19 Februari 2019.</span></p>\r\n\r\n<p><br style=\"box-sizing: border-box; color: rgb(71, 71, 71); font-family: verdana, sans-serif; font-size: 12px;\" />\r\n<span style=\"color: rgb(71, 71, 71); font-family: verdana, sans-serif; font-size: 12px;\">Andriyanto yakin semua focal poin dapat membantu menyiapkan evaluasi melalui data-data yang akan dikumpulkan. Mulai data sarana, data 7 prasayat, data evaluasi renstra, dokumen PPRG dan lain sebagainya. Selain itu, juga yang saat ini paling dibutuhkan adalah dampak dari kegiatan pembangunan responsif gender yang ada diperangkat.</span></p>\r\n\r\n<p><br style=\"box-sizing: border-box; color: rgb(71, 71, 71); font-family: verdana, sans-serif; font-size: 12px;\" />\r\n<span style=\"color: rgb(71, 71, 71); font-family: verdana, sans-serif; font-size: 12px;\">Contohnya seperti tentang kemiskinan, tentang penurunan AKI dan AKB termasuk penurunan stunting, peningkatan koperasi wanita, peningkatan kesejahteraan bagi wanita tani hingga penurunan angka kecelakaan diupayakan dengan sarana prasarana perhubungan yang responsif gender. Kemudian peningkatan peran perempuan dalam perikanan, kesembuhan pasien kanker wanita di rumah sakit.</span><br style=\"box-sizing: border-box; color: rgb(71, 71, 71); font-family: verdana, sans-serif; font-size: 12px;\" />\r\n<span style=\"color: rgb(71, 71, 71); font-family: verdana, sans-serif; font-size: 12px;\">Menurut Andriyanto, pembangunan responsive gender dilaksanakan melalui strategi PUG dengan mengacu pada Inpres No 9 Tahun 2000 tentang PUG dalam Pembangunan Nasional dan memperhatikan Permendagri Nomor 67 Tahun 2011 tentang Pelaksanaan PUG di Daerah, yang mengamanahkan bahwa PUG harus dilaksanakan dalam semua aspek pembangunan mulai dari perencanaan, pelaksanaan, pemantauan dan evaluasi.</span></p>\r\n\r\n<p><br style=\"box-sizing: border-box; color: rgb(71, 71, 71); font-family: verdana, sans-serif; font-size: 12px;\" />\r\n<span style=\"color: rgb(71, 71, 71); font-family: verdana, sans-serif; font-size: 12px;\">Sementara dalam Perda No 7 Tahun 2019 tentang RPJMD Provinsi Jawa Timur Tahun 2019 &ndash; 2024, PUG merupakan strategi pembangunan Provinsi Jawa Timur. Dan terlebih lagi saat ini telah di terbitkan Perda No 9 Tahun 2019 tentang PUG sebagai pedoman pembangunan responsif gender DI Provinsi Jatim.</span></p>\r\n\r\n<p><br style=\"box-sizing: border-box; color: rgb(71, 71, 71); font-family: verdana, sans-serif; font-size: 12px;\" />\r\n<span style=\"color: rgb(71, 71, 71); font-family: verdana, sans-serif; font-size: 12px;\">&ldquo;Saya mohon dapat didukung persiapan evaluasi tersebut. Dinas P3AK Jatim dan tim penggerak lainnya sebagai motor penggerak juga diharapkan meningkatkan komitmen terhadap kegiatan tersebut. Satu hal yang penting, Ibu Gubernur (Khofifah Indar Parawansa, red) kita perempuan. Maka Provinsi Jatim mau tidak mau harus lebih responsive terhadap gender. Mari kita dukung menjadi Jatim yang maju dan berjaya dalam pembangunan responsive gender,&rdquo; tandasnya. (iib)</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<blockquote>\r\n<p style=\"font-family: Georgia, Times, &quot;Times New Roman&quot;, serif; font-style: italic;\"><strong>Sumber</strong>:&nbsp;</p>\r\n\r\n<p style=\"font-family: Georgia, Times, &quot;Times New Roman&quot;, serif; font-style: italic;\">https://www.harianbhirawa.co.id/dp3ak-jatim-minta-komitmen-daerah-dalam-pembangunan-responsif-gender/</p>\r\n</blockquote>\r\n', 'Jumat', '2020-07-24', '22:02:21', '8402-iib-benta-ok.jpg', 1, '');
INSERT INTO `berita` VALUES (169, 2, 'admin', 'Penyerahan Bantuan 20 Unit Mesin Anjungan Dukcapil Mandiri (ADM) Kepada Perwakilan 20 Kab/Kota se-Jawa Timur', 'penyerahan-bantuan-20-unit-mesin-anjungan-dukcapil-mandiri-adm-kepada-perwakilan-20-kabkota-sejawa-t', '<p>Menyerahkan bantuan 20 unit Mesin Anjungan Dukcapil Mandiri (ADM) kepada perwakilan 20 Kab/Kota se-Jawa Timur di Gedung Negara Grahadi Surabaya, Jum&rsquo;at (24/7).<br />\r\n.<br />\r\nMasing-masing kepada Kab. Pamekasan, Kab. Malang, Kota Kediri, Kab. Bojonegoro, Kab. Tulungagung, Kab. Sumenep, Kab. Lumajang, Kab. Bondowoso, Kab. Banyuwangi, Kab. Pacitan, Kab. Situbondo, Kab. Probolinggo, Kab. Sidoarjo, Kab. Mojokerto, Kab. Jombang, Kab. Madiun, Kab. Magetan, Kab. Ngawi, Kab. Tuban dan Kab. Bangkalan.<br />\r\n.<br />\r\nDengan mesin ADM ini akan semakin memudahkan masyarakat dalam mencetak dokumen kependudukan seperti e-KTP, KK, keterangan kematian, kartu identitas anak&nbsp; dan akte kelahiran. Mesin ini memangkas sistem birokrasi sehingga lebih ringkas ,&nbsp; efisien dan gratis.</p>\r\n', 'Kamis', '2020-07-30', '10:45:59', '60rsz_5f223de9799da.jpg', 1, '');
INSERT INTO `berita` VALUES (171, 2, 'admin', 'DP3AK Jatim Tingkatkan Kapasitas Politik bagi Perempuan', 'dp3ak-jatim-tingkatkan-kapasitas-politik-bagi-perempuan', '<p><span style=\"color: rgb(71, 71, 71); font-family: verdana, sans-serif; font-size: 12px;\">Pemprov Jatim melalui Dinas Pemberdayaan Perempuan, Perlindungan Anak dan Kependudukan (DP3AK) Provinsi Jatim menggelar acara Peningkatan Kapasitas Politik bagi Perempuan Anggota Partai dan 7 Organisasi Perempuan di Provinsi Jatim.</span></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: rgb(71, 71, 71); font-family: verdana, sans-serif; font-size: 12px;\">&nbsp;</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: rgb(71, 71, 71); font-family: verdana, sans-serif; font-size: 12px;\">&nbsp;</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: rgb(71, 71, 71); font-family: verdana, sans-serif; font-size: 12px;\">Kepala DP3AK Provinsi Jatim, Andriyanto menuturkan, tujuan acara ini adalah untuk memberikan pemahaman dan tambahan pengetahuan serta wawasan terkait dengan partisipasi perempuan dalam bidang politik.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: rgb(71, 71, 71); font-family: verdana, sans-serif; font-size: 12px;\">Selain itu, juga memberikan kesempatan pada perempuan agar dapat memotivasi dirinya untuk berperan serta di bidang politik dan masuk rana politik.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: rgb(71, 71, 71); font-family: verdana, sans-serif; font-size: 12px;\">&ldquo;Program-program pemberdayaan perempuan perlu senantiasa diintegrasikan dalam berbagai bidang pembangunan yang diarahkan guna mendorong kemajuan perempuan, agar mampu meningkatkan kedudukan dan peran sertanya sejajar dengan laki-laki. Sehingga kesenjangan gender ini dapat dihindari. Disini perlu adanya peningkatan kapasitas politik bagi perempuan,&rdquo; tutur Andriyanto, saat membuka acara, Selasa (28/9) malam.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: rgb(71, 71, 71); font-family: verdana, sans-serif; font-size: 12px;\">Menurut dia, selama ini ada beberapa kendala yang menerpa kaum perempuan. Pertama; kendala politik. Hingga saat ini kaum laki-laki masih mendominasi arena politik, memformulasikan aturan main dan mendifinisikan standar untuk evaluasi dan minimnya suport perempuan dalam politik yang mengakibatkan perempuan enggan berpolitik. Sehingga jaringan maupun akses kepada kekuasaan sangat tinggi.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: rgb(71, 71, 71); font-family: verdana, sans-serif; font-size: 12px;\">Kedua; kendala ideologi dan psikologi. Ideologi gender yang disosialisasikan oleh tradisi budaya, agama perempuan enggan untuk bersaing dengan laki-laki. Khususnya dalam lembaga-lembaga publik. Lebih-lebih opini perempuan yang diliput dan ditayangkan diberbagai media massa dan elektronik banyak didasarkan pada cara pandang fisik dibandingkan kemampuan intelektual dan kepekaannya.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: rgb(71, 71, 71); font-family: verdana, sans-serif; font-size: 12px;\">&ldquo;Ketiga adalah adanya penolakan atau keengganan perempuan sendiri untuk berpartisipasi dibidang politik. Untuk menghapus dan membongkar mitos tersebut, perempuan tentunya harus memposisikan diri untuk lebih maju dengan memanfaatkan peluang dan kesempatan yang ada saat ini,&rdquo; kata Andriyanto.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: rgb(71, 71, 71); font-family: verdana, sans-serif; font-size: 12px;\">Oleh karena itu, lanjutnya, DP3AK Provinsi Jatim melaksanakan kegiatan Peningkatan Kapasitas Politik bagi Perempuan Anggota Partai dan 7 Organisasi Perempuan di Provinsi Jatim Tahun 2020 ini. Kegiatan ini untuk mendorong kelompok perempuan agar mampu mewarnai kebijakan politik yang akan datang dengan isu-isu kesenjangan yang dialami oleh perempuan dan anak.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: rgb(71, 71, 71); font-family: verdana, sans-serif; font-size: 12px;\">Andriyanto mengatakan, acara ini digelar mulai 28-29 September 2020 di Tretes Raya Hotel Resort, Prigen, Pasuruan. &ldquo;Kegiatan ini diikuti 75 orang. Mereka mendapatkan materi yakni Peningkatan Kapasitas Politik Perempuan yang dipaparkan anggota DPRD Jatim, Motivasi Menjadi Perempuan Kuat dan Hebat dalam Berorganisasi dipaparkan pemateri dari Universitas Brawijaya dan Hak Konstitusi Perempuan dari Universitas Surabaya,&rdquo; jelasnya.n [iib]</p>\r\n\r\n<blockquote>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: rgb(71, 71, 71); font-family: verdana, sans-serif; font-size: 12px;\">Sumber:</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: rgb(71, 71, 71); font-family: verdana, sans-serif; font-size: 12px;\">https://www.harianbhirawa.co.id/dp3ak-jatim-tingkatkan-kapasitas-politik-bagi-perempuan/</p>\r\n</blockquote>\r\n', 'Jumat', '2020-11-06', '10:57:13', '2802-iib-DP3AK-Jatim-Tingkatkan-Kapasitas-Politik-bagi-Perempuan.jpg', 1, '');
INSERT INTO `berita` VALUES (172, 2, 'admin', 'SE Pencegahan Pernikahan Dini untuk Menurunkan Pernikahan Anak', 'se-pencegahan-pernikahan-dini-untuk-menurunkan-pernikahan-anak', '<div class=\"deduktif-paragraph text-justify\" style=\"box-sizing: border-box; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; height: auto; border-top-width: 0px; border-bottom-width: 0px; border-left-width: 0px; margin: 0px; padding: 0px; transition: all 0.4s ease-out 0s; text-align: justify; overflow: visible; font-family: arial, sans-serif;\">\r\n<p class=\"first-paragraph-bottom-zero\" style=\"box-sizing: border-box; outline: 0px; font-size: 17px; vertical-align: baseline; background: transparent; height: auto; border-top-width: 0px; border-bottom-width: 0px; border-left-width: 0px; margin: 32px 0px 0px; padding: 0px; transition: all 0.4s ease-out 0s; overflow: visible; font-family: UtopiaStdRegular !important; line-height: 30px; color: rgb(0, 0, 0);\">Kepala Dinas Pemberdayaan Perempuan, Perlindungan Anak dan Kependudukan (DP3AK) Jawa Timur Andriyanto menyebut angka pernikahan anak di Jatim masih cukup tinggi. Menurut data yang diperolehnya dari Pengadilan Agama, sepanjang 2020 sebanyak 9.453 pernikahan di bawah usia yang dianjurkan dalam Undang-undang Nomor 1 Tahun 1974 tentang perkawinan.</p>\r\n</div>\r\n\r\n<div class=\"text-justify\" style=\"box-sizing: border-box; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; height: auto; border-top-width: 0px; border-bottom-width: 0px; border-left-width: 0px; margin: 0px; padding: 0px; transition: all 0.4s ease-out 0s; text-align: justify; font-family: arial, sans-serif; clear: both;\">\r\n<p style=\"box-sizing: border-box; outline: 0px; font-size: 17px; vertical-align: baseline; background: transparent; height: auto; border-top-width: 0px; border-bottom-width: 0px; border-left-width: 0px; margin: 32px 0px; padding: 0px; transition: all 0.4s ease-out 0s; font-family: UtopiaStdRegular !important; line-height: 30px; color: rgb(0, 0, 0);\">&quot;Angka itu setara 4,97 persen dari total 197.068 pernikahan. Secara persentase memang meningkat dibanding 2019 yang hanya 3,6 persen. Namun, menurut jumlah sebenarnya turun. Pada tahun tersebut angka pernikahan anak sebanyak 19.211 kasus dari total 340.613 perkawinan,&quot; ujarnya.</p>\r\n</div>\r\n\r\n<div class=\"text-justify\" style=\"box-sizing: border-box; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; height: auto; border-top-width: 0px; border-bottom-width: 0px; border-left-width: 0px; margin: 0px; padding: 0px; transition: all 0.4s ease-out 0s; text-align: justify; font-family: arial, sans-serif;\">\r\n<p style=\"box-sizing: border-box; outline: 0px; font-size: 17px; vertical-align: baseline; background: transparent; height: auto; border-top-width: 0px; border-bottom-width: 0px; border-left-width: 0px; margin: 32px 0px; padding: 0px; transition: all 0.4s ease-out 0s; font-family: UtopiaStdRegular !important; line-height: 30px; color: rgb(0, 0, 0);\">Meski demikian, Andriyanto menyampaikan, angka pernikahan anak masih perlu ditekan lagi. Gubernur Jatim Khofifah Indar Parawansa mengeluarkan Surat Edaran (SE) tentang pencegahan perkawinan anak yang sudah ditandatangani per 18 Januari 2021 lalu. &quot;Artinya ini akan menjadi salah satu langkah pemprov menekan angka pernikahan dini,&quot; tuturnya.</p>\r\n</div>\r\n\r\n<div class=\"text-justify\" style=\"box-sizing: border-box; outline: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; height: auto; border-top-width: 0px; border-bottom-width: 0px; border-left-width: 0px; margin: 0px; padding: 0px; transition: all 0.4s ease-out 0s; text-align: justify; font-family: arial, sans-serif;\">\r\n<p style=\"box-sizing: border-box; outline: 0px; font-size: 17px; vertical-align: baseline; background: transparent; height: auto; border-top-width: 0px; border-bottom-width: 0px; border-left-width: 0px; margin: 32px 0px; padding: 0px; transition: all 0.4s ease-out 0s; font-family: UtopiaStdRegular !important; line-height: 30px; color: rgb(0, 0, 0);\">Andriyanto berharap agar bupati dan wali kota bisa melakukan langkah-langkah seperti pada surat edaran tersebut, terutama dalam rangka penurunan perkawinan anak. Ada enam langkah yang harus dilakukan bupati dan wali kota dalam surat edaran bernomor 474.14/810/109.5/2021 tersebut.</p>\r\n\r\n<p style=\"box-sizing: border-box; outline: 0px; font-size: 17px; vertical-align: baseline; background: transparent; height: auto; border-top-width: 0px; border-bottom-width: 0px; border-left-width: 0px; margin: 32px 0px; padding: 0px; transition: all 0.4s ease-out 0s; font-family: UtopiaStdRegular !important; line-height: 30px; color: rgb(0, 0, 0);\">&quot;Di antaranya, memerintahkan atau mengajak semua stakeholder mulai kantor urusan agama (KUA), camat, lurah/kepala desa, ketua rukun tetangga (RT) hingga tokoh masyarakat bersama-sama mencegah pernikahan anak. Setidaknya tak memperkenankan perkawinan di bawah 19 tahun untuk laki-laki dan 16 tahun bagi perempuan,&quot; katanya.</p>\r\n\r\n<p style=\"box-sizing: border-box; outline: 0px; font-size: 17px; vertical-align: baseline; background: transparent; height: auto; border-top-width: 0px; border-bottom-width: 0px; border-left-width: 0px; margin: 32px 0px; padding: 0px; transition: all 0.4s ease-out 0s; font-family: UtopiaStdRegular !important; line-height: 30px; color: rgb(0, 0, 0);\">Dalam SE tersebut, gubernur mengajak untuk menyosialisasikan usia matang menikah yakni 25 tahun untuk laki-laki dan 21 tahun bagi perempuan. Kemudian menganjurkan bupati dan wali kota membuat komitmen untuk OPD melakukan pencegahan perkawinan anak.</p>\r\n\r\n<p style=\"box-sizing: border-box; outline: 0px; font-size: 17px; vertical-align: baseline; background: transparent; height: auto; border-top-width: 0px; border-bottom-width: 0px; border-left-width: 0px; margin: 32px 0px; padding: 0px; transition: all 0.4s ease-out 0s; font-family: UtopiaStdRegular !important; line-height: 30px; color: rgb(0, 0, 0);\">&quot;Selanjutnya menganjurkan, mendukung, mendorong, serta memfasilitasi kepada seluruh warga untuk dapat memenuhi pelaksanaan Program Wajib Belajar 12 tahun,&quot; ujar Andriyanto.</p>\r\n\r\n<p style=\"box-sizing: border-box; outline: 0px; font-size: 17px; vertical-align: baseline; background: transparent; height: auto; border-top-width: 0px; border-bottom-width: 0px; border-left-width: 0px; margin: 32px 0px; padding: 0px; transition: all 0.4s ease-out 0s; font-family: UtopiaStdRegular !important; line-height: 30px; color: rgb(0, 0, 0);\">Dalam Surat Edaran Gubernur Jatim juga tertuang pemerintah daerah untuk menyiapkan sarana prasarana pembentukan Pusat Pembelajaran Keluarga (PUSPAGA). Tugasnya untuk memberikan layanan konseling keluarga, dan sebagainya untuk mendorong masyarakat apabila terjadi perkawinan anak.&nbsp;&nbsp;</p>\r\n\r\n<p style=\"box-sizing: border-box; outline: 0px; font-size: 17px; vertical-align: baseline; background: transparent; height: auto; border-top-width: 0px; border-bottom-width: 0px; border-left-width: 0px; margin: 32px 0px; padding: 0px; transition: all 0.4s ease-out 0s; font-family: UtopiaStdRegular !important; line-height: 30px; color: rgb(0, 0, 0);\">Poin lainnya yakni memfasilitasi dan mendorong pelaksanaan Sekolah Calon Pengantin bagi remaja yang akan melaksanakan pernikahan. Ini bertujuan agar calon pengantin mendapat ketrampilan dan pengetahuan persiapan kehidupan berumah tangga.</p>\r\n\r\n<p style=\"box-sizing: border-box; outline: 0px; font-size: 17px; vertical-align: baseline; background: transparent; height: auto; border-top-width: 0px; border-bottom-width: 0px; border-left-width: 0px; margin: 32px 0px; padding: 0px; transition: all 0.4s ease-out 0s; font-family: UtopiaStdRegular !important; line-height: 30px; color: rgb(0, 0, 0);\">Terakhir yaitu mendorong masyarakat untuk aktif mencegah dan melaporkan jika terjadi perkawinan anak ke pengurus lingkungan RT dan RW. Lalu diteruskan secara terstruktur ke jajaran Pemerintahan yang lebih tinggi ke kepala desa/lurah, camat, sampai bupati/wali kota.</p>\r\n\r\n<p style=\"box-sizing: border-box; outline: 0px; font-size: 17px; vertical-align: baseline; background: transparent; height: auto; border-top-width: 0px; border-bottom-width: 0px; border-left-width: 0px; margin: 32px 0px; padding: 0px; transition: all 0.4s ease-out 0s; font-family: UtopiaStdRegular !important; line-height: 30px; color: rgb(0, 0, 0);\">&quot;Surat edaran tersebut dalam keterangannya menyebutkan bahwa anak itu perlu kita lindungi. Anak juga perlu kita penuhi haknya, dan pada akhirnya perlu kita tingkatkan kualitas sumber daya manusia di Jatim. Karena itu perlu dilakukan pencegahan,&quot; pungkasnya.</p>\r\n\r\n<p style=\"box-sizing: border-box; outline: 0px; font-size: 17px; vertical-align: baseline; background: transparent; height: auto; border-top-width: 0px; border-bottom-width: 0px; border-left-width: 0px; margin: 32px 0px; padding: 0px; transition: all 0.4s ease-out 0s; font-family: UtopiaStdRegular !important; line-height: 30px; color: rgb(0, 0, 0);\">Disadur dari: <a href=\"https://radarsurabaya.jawapos.com/read/2021/01/22/236736/pernikahan-anak-meningkat-khofifah-keluarkan-se-cegah-nikah-dini\" target=\"_blank\">Radar Surabaya</a></p>\r\n</div>\r\n', 'Senin', '2021-02-15', '07:40:05', '4pernikahan-anak-meningkat-khofifah-keluarkan-se-cegah-nikah-dini_m_236736.jpg', 1, '');
INSERT INTO `berita` VALUES (173, 1, 'admin', 'Stop Perkawinan Anak! Kesehatan Fisik dan Mental, hingga Nyawa Anak jadi Taruhannya', 'stop-perkawinan-anak-kesehatan-fisik-dan-mental-hingga-nyawa-anak-jadi-taruhannya', '<h3 align=\"center\"><strong>Stop Perkawinan Anak!</strong></h3>\r\n\r\n<h3 align=\"center\"><strong>Kesehatan Fisik dan Mental, hingga Nyawa Anak jadi Taruhannya</strong></h3>\r\n\r\n<p align=\"center\">Oleh: Aghnis Fauziah, S. Psi., M. Psi., Psikolog</p>\r\n\r\n<p align=\"center\">&nbsp;</p>\r\n\r\n<p>Beberapa waktu lalu, nama <em>Wedding Organizer </em>Aisha Wedding mencuat dan ramai diperbincangkan di media sosial. WO Aisha Wedding menuai kontroversi karena materi promosinya yang mengampanyekan menikah di usia 12-21 tahun. Kasus ini seakan menjadi <em>alarm</em> bahwa perkawinan anak masih menjadi masalah darurat di Indonesia.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Perkawinan Anak di Indonesia</strong></p>\r\n\r\n<p>Perkawinan anak adalah perkawinan formal maupun informal yang dilakukan oleh seseorang sebelum 18 tahun<sup>1</sup>. Laporan hasil penelitian mengenai perkawinan anak yang dilakukan oleh Pusat Kajian dan Advokasi Perlindungan dan Kualitas Hidup Anak (Puskapa) dengan UNICEF, Badan Pusat Statistik (BPS), dan Badan Perencanaan Pembangunan Nasional (Bappenas) yang diterbitkan tahun 2020 menyebutkan bahwa berdasarkan populasi, Indonesia menempati peringkat ke-10 perkawinan anak tertinggi di dunia.</p>\r\n\r\n<p>Berdasarkan data dari BPS, sebanyak 1.220.900 anak di Indonesia mengalami pernikahan dini. Laporan itu mengungkapkan bahwa 1 dari 9 anak perempuan di Indonesia menikah sebelum berusia 18 tahun. Sebagai tambahan, berdasarkan data dari BPS tahun 2020 tentang proporsi perempuan umur 20-24 tahun yang berstatus kawin sebelum umur 18 tahun pada tahun 2019 adalah 10,82 % secara nasional, dan persentase Jawa Timur sedikit lebih tinggi di atas data nasional, yaitu 11,1 %. Salah satu hal yang menjadi kekhawatiran adalah dalam 10 tahun terakhir, tingkat perkawinan anak di Indonesia hanya mengalami sedikit penurunan yaitu 3,5 %.</p>\r\n\r\n<p>Selain itu, selama pandemi ini tercatat terdapat kenaikan 300% angka perkawinan anak. Artinya, saat ini perkawinan anak menjadi salah satu masalah darurat yang harus mendapatkan perhatian dari seluruh pihak.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Faktor Pendorong Perkawinan Anak </strong></p>\r\n\r\n<p>Banyak hal yang membuat anak akhirnya menikah sebelum usia 18 tahun. Di Indonesia sendiri, faktor yang ditengarai berkontribusi dalam perkawinan anak antara lain kehamilan yang tidak diinginkan, hubungan seks pranikah, pengaruh teman sebaya, teknologi, peran orangtua, tingkat pendidikan, kurangnya pengetahuan tentang kesehatan reproduksi dan seksual, kemiskinan, paparan media, konflik sosial, bencana, pandemi, budaya, interpretasi agama yang parsial, etnis dan faktor geografis lainnya.<sup>2,3</sup></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Dampak Perkawinan Anak</strong></p>\r\n\r\n<p>Perkawinan anak memberikan dampak buruk yang luas, tidak hanya bagi anak yang menikah itu sendiri, tetapi juga berdampak pada generasi berikutnya. Risiko perkawinan anak antara lain:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol style=\"list-style-type:upper-alpha;\">\r\n	<li><strong>Pendidikan</strong></li>\r\n</ol>\r\n\r\n<p style=\"margin-left:35.45pt;\">Perkawinan anak secara universal dikaitkan dengan tingkat pendidikan yang rendah. Remaja perempuan yang menikah berisiko lebih besar untuk putus sekolah dan tidak melanjutkan pendidikan sekolah<sup>4</sup>. Hak anak untuk mendapatkan pendidikan dan masa depan yang lebih baik dirampas karena perkawinan anak.</p>\r\n\r\n<p align=\"center\" style=\"margin-left:35.45pt;\"><img alt=\"\" src=\"https://i.postimg.cc/1XX7w24T/Picture1.jpg\" style=\"width: 300px; height: 539px;\" /></p>\r\n\r\n<p align=\"center\" style=\"margin-left:35.45pt;\"><em>Sumber: unicef.org</em></p>\r\n\r\n<ol style=\"list-style-type:upper-alpha;\">\r\n	<li value=\"2\"><strong>Kemiskinan</strong></li>\r\n</ol>\r\n\r\n<p style=\"margin-left:35.45pt;\">Keluarga dengan tingkat perekonomian yang rendah seringkali melihat perkawinan anak sebagai hal yang menguntungkan secara ekonomi dalam jangka pendek. Tetapi realitanya, hal tersebut tidak meningkatkan status ekonomi rumah tangga dalam jangka panjang karena tidak memberikan keamanan finansial untuk masa depan. Perkawinan anak memiliki potensi negatif secara ekonomi karena remaja perempuan yang menikah seringkali memiliki tingkat pendidikan yang rendah serta tidak bekerja. Dari perspektif ini, perkawinan anak di Indonesia cenderung mempertahankan atau memperburuk kemiskinan, bukan mengentaskannya.</p>\r\n\r\n<p style=\"margin-left:35.45pt;\">&nbsp;</p>\r\n\r\n<ol style=\"list-style-type:upper-alpha;\">\r\n	<li value=\"3\"><strong>Kesehatan remaja perempuan</strong></li>\r\n</ol>\r\n\r\n<p style=\"margin-left:35.45pt;\">Perkawinan anak akan membuat perempuan berhubungan seksual di masa remaja (&lt;18 tahun). Padahal, hubungan seksual pertama kali di usia remaja (&lt;18 tahun) pada perempuan membuat mereka 3 kali lebih berisiko menderita kanker serviks. Karena pada remaja perempuan, sel serviknya masih belum matang dan lebih sensitif, sehingga rentan berubah menjadi kondisi abnormal <sup>5</sup><strong>.</strong> Remaja perempuan (&lt;18 tahun) yang berhubungan seksual rentan terhadap infeksi HPV. Hubungan seksual yang dimulai sebelum 18 tahun merupakan faktor risiko kanker serviks yang sangat kuat. Infeksi HPV sering terjadi segera setelah pertama kali hubungan seksual. Sehingga hubungan seksual yang dilakukan pada usia dini ditengarai merupakan paparan awal dari HPV. Infeksi HPV menyebabkan sel kanker tumbuh pada sel-sel di leher rahim yang disebut kanker serviks.<sup>6</sup></p>\r\n\r\n<p style=\"margin-left:35.45pt;\">Selain itu, kehamilan remaja yang berusia di bawah 18 tahun sangat rentan terhadap anemia dan risiko medis, seperti preeklamsia, perdarahan, dan transfusi darah. Bukti global menunjukkan, perkawinan anak membuat perempuan berisiko lebih tinggi mengalami kematian ibu. Penelitian menunjukkan bahwa komplikasi saat melahirkan dan kehamilan adalah salah satu penyebab utama kematian di kalangan remaja perempuan. Tingkat kematian perempuan yang menikah pada usia 15-19 tahun dua kali lipat lebih besar dibandingkan perempuan yang menikah setelah usia 20 tahun. Hal ini disebabkan karena tubuh mereka yang belum matang mempengaruhi kesehatan mereka saat melahirkan seorang anak. Penyebab utama kematian remaja berusia 15&ndash;19 tahun adalah kematian ibu yang berhubungan dengan kehamilan dan persalinan, yang menyebabkan 70.000 kematian per tahun di seluruh dunia<sup>7</sup>.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol style=\"list-style-type:upper-alpha;\">\r\n	<li value=\"4\"><strong>Kesehatan bayi yang dilahirkan</strong></li>\r\n</ol>\r\n\r\n<p style=\"margin-left:35.45pt;\">Perkawinan anak secara signifikan berisiko terhadap kesehatan remaja serta anak yang dilahirkannya. Kemungkinan kematian bayi yang dilahirkan oleh remaja perempuan yang berusia di bawah 18 tahun 60 % lebih tinggi dibandingkan bayi yang dilahirkan oleh ibu yang berusia di atas 19 tahun<sup>7</sup>. Bahkan jika bayi bertahan hidup, terdapat kemungkinan bayi tersebut lahir secara prematur, memiliki berat badan lahir rendah atau lebih lemah secara fisiologis maupun psikologis dari pada anak normal lainnya<sup>7</sup>. Kondisi fisik yang belum matang dari ibu yang berusia remaja membentuk risiko 2-3 kali lebih tinggi pada bayi yang dilahirkan untuk &nbsp;memiliki berat lahir rendah dan hambatan pertumbuhan janin, prematuritas, dan kesehatan bayi baru lahir yang buruk.</p>\r\n\r\n<p style=\"margin-left:35.45pt;\">&nbsp;</p>\r\n\r\n<ol style=\"list-style-type:upper-alpha;\">\r\n	<li value=\"5\"><strong>Stunting</strong></li>\r\n</ol>\r\n\r\n<p style=\"margin-left:35.45pt;\">Kebutuhan gizi anak dimulai sejak 1.000 hari pertama kehidupan (HPK) atau saat kehamilan hingga usia 2 tahun. Kehamilan remaja dapat menyebabkan bayi lahir dengan&nbsp;<a href=\"https://genbest.id/articles?article_tag_id=7\" target=\"_blank\">risiko stunting</a>&nbsp;lebih tinggi karena umumnya remaja belum memperoleh edukasi secara menyeluruh mengenai kehamilan dan perawatan gizi bayi.</p>\r\n\r\n<p style=\"margin-left:35.45pt;\">Pada saat hamil, remaja yang tidak mengetahui pentingnya gizi yang harus dikonsumsi oleh ibu hamil bisa membuat remaja tersebut terkena anemia dan berpengaruh pada janin yang dikandungnya. Ibu yang anemia akan berisiko melahirkan anak yang stunting karena bayi yang lahir juga akan kekurangan zat besi karena bayi tersebut tidak diwarisi zat besi dari sang ibu.</p>\r\n\r\n<p style=\"margin-left:35.45pt;\">Selain itu, terdapat hubungan antara kehamilan tidak diinginkan dan gizi buruk pada anak. Remaja yang menikah karena kehamilan yang tidak diinginkan membuat mereka mengabaikan anak secara sadar ataupun tidak sadar. Hal ini mengurangi kemampuan ibu untuk memenuhi kebutuhan anak sehari-hari dan mengurangi kualitas perilaku pengasuhannya, sehingga menuju pada konsekuensi kesehatan yang negatif bagi anak<sup>8</sup>. Kehamilan yang tidak diinginkan mempengaruhi perilaku ibu selama kehamilan hingga saat membesarkan anak. Risiko stunting anak usia dini dari kehamilan yang tidak diinginkan 2 kali lebih besar dari anak-anak yang lahir dari kehamilan diinginkan.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol style=\"list-style-type:upper-alpha;\">\r\n	<li value=\"6\"><strong>KDRT dan Kesehatan Mental</strong></li>\r\n</ol>\r\n\r\n<p align=\"center\"><img alt=\"\" src=\"https://i.postimg.cc/vZFXZc7C/Picture2.jpg\" /></p>\r\n\r\n<p align=\"center\" style=\"margin-left:35.45pt;\"><em>Sumber: shutterstock.com</em></p>\r\n\r\n<p align=\"center\" style=\"margin-left:35.45pt;\">&nbsp;</p>\r\n\r\n<p style=\"margin-left:35.45pt;\">Pernikahan adalah langkah menuju kemandirian yang membawa banyak tanggung jawab, pengambilan keputusan, dan komitmen yang serius. Anak berusia di bawah 18 tahun akan kesulitan untuk mengatasinya karena pernikahan membutuhkan tingkat kedewasaan dan rasa tanggung jawab yang besar. Usia remaja, di mana anak lain masih berkumpul dan bermain dengan teman sebaya, mengenyam pendidikan, dan belajar keterampilan-keterampilan baru untuk kehidupan, namun remaja yang menikah harus memikul tanggung jawab besar melayani suami, melakukan tugas domestik, dan mengasuh anak-anak yang mereka lahirkan. Padahal, mereka tidak memiliki pengetahuan atau ilmu yang mumpuni untuk menjadi seorang istri dan ibu, dan bahkan juga tidak memiliki informasi yang memadai tentang hubungan seksual dan persalinan.</p>\r\n\r\n<p style=\"margin-left:35.45pt;\">Besarnya tanggung jawab yang dipikul, yang tidak sesuai dengan perkembangan remaja membuat mereka stres dan tertekan sehingga lebih rentan mengalami berbagai masalah terkait kehidupan perkawinan. Stres dan tekanan yang dialami remaja perempuan ini dapat menyebabkan gangguan psikologis maupun fisiologis. Masalah yang dialami dapat membuat remaja depresi, berujung pada perceraian, atau bunuh diri.</p>\r\n\r\n<p style=\"margin-left:35.45pt;\">Remaja perempuan yang secara fisik belum cukup matang untuk melakukan hubungan seksual membuat hubungan seksual dengan suami dapat menjadi pengalaman traumatis. Hubungan seksual seperti itu, seringkali tidak dibangun atas dasar persetujuan kedua belah pihak, sehingga menjadi hubungan seksual yang dipaksakan. Penelitian menegaskan bahwa perempuan yang memiliki trauma seksual berisiko tinggi menderita PTSD <em>(Post Traumatic Syndrome Disorder)</em>, depresi, dan gejala komorbid PTSD dengan gangguan kecemasan sosial.</p>\r\n\r\n<p style=\"margin-left:35.45pt;\">Selain kekerasan seksual, remaja perempuan yang menikah dini lebih berisiko mengalami kekerasan secara fisik dan psikologis dari suami atau mertuanya. Hal ini karena mereka cenderung memiliki suami yang lebih tua, sehingga suami dan mertua cenderung memiliki kendali yang lebih besar atas diri remaja. Beberapa remaja perempuan yang menikah memiliki pasangan yang jauh lebih tua dan lebih berpendidikan dari mereka, sehingga mereka tidak memiliki intelektualitas yang sama seperti yang dimiliki suami mereka. Hal ini menyebabkan mereka tidak mampu untuk memenuhi tuntutan suami, bahkan terhadap hal-hal yang kecil. Remaja ini kemudian dipandang rendah oleh suaminya, direndahkan, dan tak jarang dipukuli<sup>9.</sup></p>\r\n\r\n<p style=\"margin-left:35.45pt;\">Kekerasan dalam rumah tangga (KDRT) meningkatkan masalah kesehatan mental perempuan, seperti depresi atau bahkan bunuh diri, dan memperburuk gangguan somatik, serta membentuk risiko gangguan kesehatan, seperti kardiovaskular tinggi dan reaktivitas stres. KDRT juga mempengaruhi kesehatan reproduksi. Perempuan yang terpapar kekerasan memiliki 16% kemungkinan lebih besar untuk memiliki bayi dengan berat lahir rendah, dan dua kali cenderung melakukan aborsi, dibandingkan dengan perempuan yang tidak pernah mengalami kekerasan dari pasangan.</p>\r\n\r\n<p style=\"margin-left:35.45pt;\">Selain itu, terdapat penelitian yang menemukan bahwa remaja yang hamil, berhubungan dengan kondisi depresi yang tinggi pada saat kehamilan dan setelah persalinan, mencapai 40-50% dengan gejala yang sedang hingga berat. Penelitian tersebut dilakukan di Afrika-Amerika dan negara-negara Eropa dengan hasil konsisten. Depresi terbukti berlanjut dari tahun-tahun awal pengasuhan, dan <em>follow up</em> selama 17 tahun menemukan kenaikan tingkat depresi pada perempuan yang hamil pada saat remaja, khususnya yang mendapatkan kekerasan dari pasangan.</p>\r\n\r\n<p style=\"margin-left:35.45pt;\">Mengenai perkawinan anak, usia perkawinan yang sangat dini, seringkali segera setelah <em>menarche</em>, juga menyebabkan masalah kesehatan mental tertinggi<sup>10</sup>. Terdapat bukti bunuh diri dan melukai diri sendiri pada remaja yang menikah di seluruh dunia.</p>\r\n\r\n<p style=\"margin-left:35.45pt;\">Berdasarkan paparan tersebut, remaja perempuan yang menikah sangat berisiko mengalami kekerasan seksual, fisik, dan psikologis, yang umumnya didefinisikan sebagai kekerasan terkait gender.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol style=\"list-style-type:upper-alpha;\">\r\n	<li value=\"7\"><strong>Pola asuh yang buruk pada anak</strong></li>\r\n</ol>\r\n\r\n<p style=\"margin-left:35.45pt;\">Remaja belum memiliki kematangan dalam berpikir dan mengambil keputusan, sehingga mengemban tugas menjadi orangtua adalah sesuatu yang berat. Penyesuaian menjadi orangtua berkaitan dengan persiapan dan pengetahuan mengenai bagaimana merawat anak sejak hamil, melahirkan, hingga membesarkannya. Hal ini merupakan hal yang berat untuk dilakukan oleh remaja, sehingga banyak ibu yang berusia remaja merasa tertekan dan memiliki kesehatan mental yang buruk, seperti mengalami depresi <sup>11</sup>.</p>\r\n\r\n<p style=\"margin-left:35.45pt;\">Remaja yang depresi dapat membuat mereka kurang efektif dalam menjalankan pengasuhan pada anaknya, mengabaikan anaknya, hingga melakukan kekerasan pada anak. Pengasuhan dari ibu yang berusia remaja ini banyak menggunakan disiplin dengan kekerasan dan pengabaian. Banyak ibu yang berusia remaja menarik diri secara fisik dan emosional terhadap bayinya, sehingga mereka tidak mampu membentuk kelekatan yang aman pada anak. Anak-anak ini kemudian sering diabaikan secara fisik, emosional, keamanan, kesehatan, hingga pendidikannya. Pengasuhan ibu usia remaja ini akan menjadi lebih buruk saat mereka menjadi korban kekerasan dari suami, memiliki masalah ekonomi, dan menderita depresi. Anak-anak yang diasuh kemudian bisa memiliki gangguan perilaku dan membuat mereka menjadi sangat berisiko mengalami kekerasan<sup>11</sup>.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Perkawinan Anak merupakan Bentuk Kekerasan Pada Anak</strong></p>\r\n\r\n<p>Perkawinan anak membawa banyak risiko dan dampak buruk bagi anak hingga generasi berikutnya. Perkawinan anak merupakan bentuk kekerasan pada anak karena merampas hak-hak anak sehingga membuat mereka:</p>\r\n\r\n<ol>\r\n	<li>Kehilangan kesempatan untuk mengenyam pendidikan</li>\r\n	<li>Kehilangan kesempatan untuk mendapatkan kecakapan kejuruan dan kecakapan/keterampilan hidup</li>\r\n	<li>Memaparkan anak pada risiko kesehatan hingga kematian</li>\r\n	<li>Menjadi ibu sebelum mereka siap secara fisik dan psikologis</li>\r\n	<li>Meningkatkan risiko mendapatkan kekerasan seksual, fisik, dan psikologis dari pasangan mereka</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Faktor Protektif Perkawinan Anak</strong></p>\r\n\r\n<p>Pendidikan merupakan faktor pelindung yang kuat terhadap perkawinan anak dan terhadap pilihan dan sikap terhadap perkawinan anak di Indonesia. Artinya, kebijakan yang mendorong anak perempuan menyelesaikan SMA/sederajat hingga pendidikan yang lebih tinggi dapat membantu menurunkan jumlah perkawinan anak. Kebijakan pemerintah dan lembaga lain yang bertujuan untuk mendidik keluarga dan masyarakat, meningkatkan kesadaran yang melibatkan orang tua dan memberdayakan anak perempuan melalui pendidikan dan keterampilan dapat membantu menghentikan perkawinan anak<sup>8</sup>. Selain itu, pendidikan tidak hanya efektif dalam menunda perkawinan, kehamilan, dan melahirkan, tetapi juga dapat meningkatkan pengetahuan tentang masalah kesehatan reproduksi, sehingga efektif dalam mengubah perilaku remaja yang mengarah pada perilaku seksual berisiko dalam perkawinan.</p>\r\n\r\n<p>Pencegahan perkawinan anak di Indonesia membutuhkan peran serta dari seluruh elemen masyarakat. Baik orangtua, institusi pendidikan, tokoh agama, dunia usaha, masyarakat, media, maupun pemerintah harus saling bahu-membahu dan bergotong-royong menghapus perkawinan anak demi melindungi anak dan mewujudkan generasi emas di Indonesia.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Referensi:</strong></p>\r\n\r\n<ol>\r\n	<li>UNICEF. (2014). <em>Ending Child Marriage: Progress and Prospects</em>. UNICEF.</li>\r\n	<li>Kementerian Perencanaan Pembangunan Nasional/Bappenas (2020) <em>Strategi Nasional Pencegahan Perkawinan Anak</em></li>\r\n	<li>Windiarti, S. dan Besral (2018) Determinants of Early Marriage In Indonesia: A Systematic Review. <em>Proceeding of International Conference on Applied Science and Health</em>, no: 3</li>\r\n	<li>Brown, G. (2012) <em>Out of wedlock, into school: combating child marriage through education</em>. London: Overseas Development</li>\r\n	<li>Lubis R, Siregar F, Sanusi S. (2017) Pengaruh usia pertama kali melakukan hubungan seksual, paritas, bergantiganti pasangan seksual, merokok terhadap kejadian Kanker Serviks di RSUD Dr. Pirngadi Medan. <em>Jurnal Muara Sains, Teknologi, Kedokteran, dan Ilmu Kesehatan</em>.;1(2):145&ndash;52.</li>\r\n	<li>Plummer, M, Peto, J &amp; Franceschi, S. (2012) Time since first sexual intercourse and the risk of cervical cancer. <em>International Journal of Cancer.</em> 120(11):2638&ndash;44</li>\r\n	<li>UNICEF (2009) <em>State of the World&rsquo;s Children</em></li>\r\n	<li>Rahman, M.M, (2015). Is Unwanted Birth Associated with Child Malnutrition in Bangladesh? <em>International Perspectives on Sexual and Reproductive Health </em>41(2): 80&ndash;88</li>\r\n	<li>UNICEF. (2005). <em>Early marriage: A harmful traditional practice. A Statistical Exploration</em>. UNICEF, New York, 32.</li>\r\n	<li>UNPF (2013) <em>State of world population 2013.Motherhood in childhood. Facing the challenge in adolescence pregnancy. </em>United Nations Population Fund, New York</li>\r\n	<li>Rahayu, K.S dan Basoeki, L. (2018) Pengasuhan anak pada ibu usia remaja. <em>Jurnal Psikiatri Surabaya</em>. Vol 7. No 2</li>\r\n</ol>\r\n', 'Senin', '2021-03-29', '12:11:57', '8710-11-24-akar-masalah-pernikaha-anak.jpg', 1, '');
INSERT INTO `berita` VALUES (174, 1, 'admin', 'Perempuan dan Anak dalam Lingkar Kekerasan', 'perempuan-dan-anak-dalam-lingkar-kekerasan', '<h3 align=\"center\"><strong>Perempuan dan Anak dalam Lingkar Kekerasan</strong></h3>\r\n\r\n<p align=\"center\">oleh Ajeng Harlika Puspitasari, M.Psi., Psikolog</p>\r\n\r\n<p align=\"center\">&nbsp;</p>\r\n\r\n<p>Kekerasan dapat terjadi kepada siapa saja di berbagai lingkungan, laki &ndash; laki maupun perempuan, dewasa maupun anak &ndash; anak, dalam lingkup hubungan sedarah maupun hubungan yang tak lekat, dalam lingkungan pekerjaan maupun perkawinan. Topik mengenai kekerasan bukanlah suatu hal yang asing dan beredar di sekitar kita. Korban kekerasan didominasi oleh perempuan dan anak, yang trend angka nya semakin meningkat dari hari ke hari. Satu diantara tiga orang perempuan &nbsp;dan anak &ndash; anak pernah menjadi korban kekerasan fisik maupun seksual (Guedes, Bott, Moreno, &amp; Colombini, 2016). Lemah dan tidak berdaya merupakan stigma yang melekat kuat pada diri perempuan dan anak &ndash; anak, sedangkan pelaku kekerasan identik dengan sosok yang lebih dominan dan berdaya. Stigma yang melekat, menempatkan perempuan dan anak pada posisi rentan menjadi korban kekerasan, baik dalam lingkungan rumah tangga, maupun pada situasi &ndash; situasi yang lebih umum.</p>\r\n\r\n<p>Kekerasan sendiri dapat didefinisikan sebagai setiap perbuatan mengakibatkan timbulnya kesengsaraan atau penderitaan baik secara fisik, psikologis, seksual, dan/atau penelantaran, termasuk ancaman untuk melakukan perbuatan, pemaksaan, atau perampasan kemerdekaan secara melawan hukum. Angka kejadian kekerasan pada perempuan dan anak semakin meningkat setiap tahunnya. Lebih dari 1700 kejadian kekerasan terjadi pada perempuan dan lebih dari 1100 kekerasan terjadi pada anak di tahun 2020. Kekerasan seksual menjadi bentuk kekerasan dengan jumlah korban tertinggi, baik pada perempuan maupun anak &ndash; anak. Sedangkan rumah tangga menjadi lingkungan yang paling sering menjadi tempat terjadinya kekerasan.</p>\r\n\r\n<p>Kekerasan terjadi di pengaruhi oleh beberapa faktor yang saling terkait satu sama lain, diantaranya (Moreno; Guedes; Knerr, 2012) :</p>\r\n\r\n<ol>\r\n	<li><strong>Faktor Individual</strong></li>\r\n</ol>\r\n\r\n<p>Faktor yang berasal dari kondisi internal dari pelaku kekerasan maupun korban kekerasan. Faktor individual yang berasal dari pelaku kekerasan dapat meliputi : usia yang terlalu muda, tingkat pendidikan yang rendah, mengalami/melihat kekerasan masa anak &ndash; anak, penggunaan alkohol dan obat &ndash; obatan, gangguan kepribadian, menyetujui perilaku kekerasan, dan memiliki pengalaman menganiaya pasangan. Sedangkan faktor individual yang menyebabkan korban kekerasan menerima perlakuan kekerasan yakni : rendahnya tingkat pendidikan, mengalami kekerasan oleh orangtuanya selama masa anak &ndash; anak, mengalami pelecehan seksual selama anak &ndash; anak, menerima perilaku kekerasan sebagai hal yang wajar untuk dilakukan, dan mengalami berbagai bentuk kekerasan lainnya.</p>\r\n\r\n<ol>\r\n	<li value=\"2\"><strong>Faktor Relasi</strong></li>\r\n</ol>\r\n\r\n<p>Faktor &ndash; faktor terjadinya kekerasan yang diakibatkan karena situasi hubungan antara pelaku dan korban kekerasan, diantaranya : adanya konflik atau ketidakpuasan dalam hubungan, laki &ndash; laki memiliki peran yang lebih dominan, tekanan ekonomi, laki &ndash; laki memiliki pasangan lain, dan kesenjangan tingkat pendidikan misalnya perempuan memiliki pendidikan lebih tinggi dibanding pasangannya.</p>\r\n\r\n<ol>\r\n	<li value=\"3\"><strong>Faktor Komunitas dan Sosial</strong></li>\r\n</ol>\r\n\r\n<p>Beberapa faktor yang bukan berasal dari internal pelaku maupun korban kekerasan, meliputi : norma sosial terkait dengan kesenjangan gender (misalkan gagasan yang menyatakan bahwa laki &ndash; laki adalah sosok yang harus menunjukkan peran lebih dominan dan agresif dibandingkan perempuan), faktor kemiskinan, status sosial dan status ekonomi perempuan yang lebih rendah, sanksi hukum yang lemah, kurangnya hak-hak sipil perempuan, aturan perceraian yang membatasi/tidak dapat dihindari, serta aturan undang-undang pernikahan yang melemahkan posisi perempuan, sanksi sosial yang lemah, penerimaan sosial bahwa kekerasan sebagai salah satu upaya menyelesaikan konflik, konflik bersenjata/konflik sosial, dan tingginya kekerasan umum yang terjadi di masyarakat kita.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\" Â© Tatiana Zelenskaya\" src=\"https://i.postimg.cc/QNRd4TrB/2.jpg\" style=\"margin-left: 12px; margin-right: 12px; float: left; width: 377px; height: 212px;\" />Badan Pusat Statistik memberikan pandangan yang lebih luas terkait dengan&nbsp; sebab terjadinya kekerasan khususnya yang terjadi pada perempuan. Melalui Survei Pengalaman Hidup Perempuan Nasional (SPHPN) yang dilakukan pada tahun 2016, selain tiga faktor</p>\r\n\r\n<p>yang telah diuraikan diatas, terdapat faktor ekonomi yang secara spesifik memberikan kontribusi sebab terjadinya kekerasan. Tingkat ekonomi yang rendah meningkatkan prevalensi perempuan &nbsp;mengalami tindak kekerasan. Kekerasan karena faktor ekonomi dapat berupa memaksa pasangan untuk memenuhi segala kebutuhan diluar batas kemampuannya, sehingga dapat mengarah pada &nbsp;eksploitasi ekonomi atau menguras harta pasangan (BPS, 2017).</p>\r\n\r\n<p>Kekerasan tentunya menimbulkan dampak negatif pada aspek yang kompleks, tidak hanya menimbulkan luka fisik, kekerasan juga memberikan dampak secara psikologis, sosial, ekonomi, spiritual, dan kesejahteraan emosional bagi korban, pelaku, maupun lingkungan yang terlibat&nbsp;(Susmitha, 2016). Dampak kekerasan secara fisik adalah hal yang dapat teramati oleh mata, yakni timbulnya cedera, luka dan kecacatan pada tubuh, sedangkan dampak jangka panjang kekerasan pada fisik korban dapat berupa gangguan menstruasi dan kesuburan, sindroma iritasi usus, gangguan syaraf dan gangguan motorik.</p>\r\n\r\n<p>Kekerasan memiliki dampak yang jauh lebih luas dan menetap pada aspek psikologis/kesehatan mental, khususnya pada korban kekerasan. Pada perempuan korban kekerasan, dampak psikologis ringan dapat ditunjukkan melalui perasaan tertekan (stress), perasaan takut/terancam, merasa terisolir secara sosial, menurunnya kepercayaan diri, dan perasaan tidak berdaya. Dampak psikologis pada tingkat yang lebih berat dapat ditunjukkan melalui gejala &ndash; gejala depresi, gangguan stress pasca trauma (PTSD), gangguan makan, gangguan keberfungsian diri sehari &ndash; hari, gagasan/percobaan bunuh diri, dan keluhan gangguan psikotik-halusinasi (Moreno;Rossler, 2013). Dampak serupa juga dialami pada anak &ndash; anak korban kekerasan, anak &ndash; anak berpotensi mengembangkan kepribadian antisosial, kepercayaan diri yang rendah, agresivitas dan menjadi pelaku kekerasan, depresi, gangguan stress pasca trauma (PTSD), dan kehilangan keyakinan akan pentingnya fungsi keluarga&nbsp;(Lucas &amp; Grych, 2011).</p>\r\n\r\n<center>\r\n<table cellpadding=\"0\" cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<td height=\"0\">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td><img src=\"https://i.postimg.cc/9F5ctHGZ/3.jpg\" style=\"width: 307px; height: 307px;\" /></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</center>\r\n\r\n<p><br clear=\"ALL\" />\r\nLuasnya dampak yang ditimbulkan akibat perilaku kekerasan memerlukan penanganan serius oleh berbagai pihak. Perlu adanya sinergi antar individu, pemerintah, dan khususnya masyarakat dalam mewujudkan upaya perlindungan bagi perempuan dan anak. Masyarakat sebagai entitas terbesar dapat berperan menjadi garda terdepan sebagai pelopor dan pelapor perlindungan perempuan dan anak. Dinas Pemberdayaan Perempuan, Perlindungan Anak, dan Kependudukan (DP3AK) Provinsi Jawa Timur sebagai <em>stakeholder </em>dalam pencegahan dan penanggulangan kekerasan berperan aktif untuk mewujudkan perlindungan terhadap perempuan dan anak. Salah satu upaya nyata DP3AK Provinsi Jawa Timur dalam penanggulangan kekerasan terhadap perempuan dan anak melalui program konseling dan psikoterapi gratis bagi perempuan dan anak korban kekerasan di wilayah Jawa Timur. Untuk memanfaatkan program layanan ini dapat menghubungi hotline base counseling di nomor <strong>0895348771070</strong> pada hari <strong>Senin - Jumat pukul 08.00 - 15.00</strong>.</p>\r\n\r\n<p><em>Referensi : </em></p>\r\n\r\n<ol>\r\n	<li>Moreno,C.G;Guedes A;Bott S;Colombini M. 2016. Violence Against Women and Violence Againts Children - The Points of Intersection : Causes, Consequences, and Solutions. Global Health Action Journal.</li>\r\n	<li>Moreno, C.G; Guedes A; Knerr W. 2012. <em>Understanding and Addressing Violence Against Women</em>. WHO Department of Reproductibe Health Website.</li>\r\n	<li>Susmitha B. 2016. Domestic Violence : Causes, Impact, and Remedial Measures. SAGE Publications.</li>\r\n	<li>Lucas R.L.D &amp; Grych C.H. 2011. Children&rsquo;s Perceptions of Intimate Partner Violence : Causes, Consequences, and Coping. Springer Journal.</li>\r\n</ol>\r\n', 'Senin', '2021-03-29', '14:35:41', '521.jpg', 1, '');
INSERT INTO `berita` VALUES (175, 1, 'admin', 'Mendisiplinkan Anak dengan Hukuman dan Kekerasan, Efektif Kah?', 'mendisiplinkan-anak-dengan-hukuman-dan-kekerasan-efektif-kah', '<p align=\"center\"><strong>Mendisiplinkan Anak dengan Hukuman dan Kekerasan, Efektif Kah?</strong></p>\r\n\r\n<p align=\"center\">Oleh: Aghnis Fauziah, S.Psi, M.Psi, Psikolog</p>\r\n\r\n<p align=\"center\"><img src=\"https://i.postimg.cc/76Yxz8zt/pukul-1.png\" style=\"width: 290px; height: 272px;\" /></p>\r\n\r\n<p align=\"center\"><em>Sumber: https://www.shutterstock.com</em></p>\r\n\r\n<p>Setiap orangtua yang mengasuh anak pasti pernah frustasi ketika menghadapi perilaku buruk anak. Salah satu reaksi yang sering&nbsp; dilakukan oleh orangtua adalah dengan menghukum anak secara fisik, dengan memukul, menampar, atau mencubit anak.</p>\r\n\r\n<p>Hukuman didefinisikan sebagai tindakan dengan niat menyakiti, baik secara fisik maupun psikologis, untuk memberikan pelajaran. Namun hukuman sebenarnya cenderung kontraproduktif dalam membangun hubungan yang saling menghormati dengan anak-anak, mengajari anak, dan mendorong perkembangan yang optimal.</p>\r\n\r\n<ol>\r\n	<li>Hukuman tidak efektif untuk mengajari anak perilaku yang lebih baik. Penelitian menunjukkan bahwa anak yang dihukum malah akan melakukan lebih banyak perilaku negatif. Selain itu, mereka juga akan berperilaku semakin negatif dari waktu ke waktu.</li>\r\n	<li>Hukuman membuat anak merasa yakin bahwa dirinya buruk. Banyak penelitian membuktikan bahwa anak akan berperilaku seperti ekspektasi orangtua, sehingga anak yang mengira dirinya buruk akan bertindak buruk.</li>\r\n	<li>Selain itu, hukuman sebenarnya membuat anak tidak bertanggung jawab terhadap perilakunya karena ia membentuk lokus kontrol eksternal, yaitu didasarkan pada orangtua atau figur otoritas. Ketika seorang anak dihukum, ia akan mulai melihat dirinya tidak mampu berperilaku baik. Ia merasa bahwa berperilaku baik bukan tugasnya, tetapi tugas figur otoritas untuk &ldquo;membuatnya&rdquo;.</li>\r\n	<li>Hukuman membuat perhatian anak bergeser dari perilakunya sendiri dan cara mengubahnya, ke respon orangtua/pengasuh terhadap perilku tersebut. Artinya, anak tidak lagi mempertimbangkan tindakannya sama sekali. Sebaliknya, anak hanya berpikir mengenai betapa jahatnya orangtuanya karena menyakitinya, atau betapa menakutkannya orangtuanya. Maka respon orangtua malah tidak dapat mencapai tujuan utama disiplin, yaitu mengubah perilaku dan membangun otak anak, karena anak tidak mendapatkan kesempatan untuk memikirkan perilakunya sendiri dan bahkan tidak memiliki perasaan bersalah atau penyesalan yang sehat.</li>\r\n	<li>Hukuman mengajarkan anak untuk fokus pada apakah perilaku negatif mereka akan ketahuan dan dihukum, daripada dampak negatif dari perilaku mereka. Hal ini sebenarnya menghambat perkembangan moral, seperti yang disebutkan oleh Alfie Kohn, hukuman mengarahkan anak untuk fokus pada konsekuensi dari perilakunya untuk dirinya sendiri daripada dampaknya terhadap orang lain. Hukuman yang semakin menyakitkan akan membuat anak semakin dalam mendapatkan pelajaran negatif, dan semakin buruk perilakunya.</li>\r\n	<li>Manusia secara naluri menjauhi rasa sakit. Otak yang memproses ini juga merupakan otak yang memproses penolakan sosial. Menimbulkan rasa sakit secara fisik menciptakan penolakan sosial di otak anak. Ketika anak melakukan kesalahan, anak otomatis memilih untuk menyembunyikan apa yang telah mereka lakukan. Anak bisa melakukan apa pun untuk menghindari rasa sakit akibat hukuman fisik dan penolakan sosial, sehingga perilaku yang muncul adalah berbohong dan bersembunyi, bukan berkomunikasi secara kolaboratif dan terbuka untuk belajar.</li>\r\n	<li>Hukuman juga membuat anak marah karena orangtua sengaja menyakitinya. Sehingga ia akan menolak untuk berperilaku yang baik baginya seperti yang diharapkan orangtua. Anak menjadi pemberontak, marah, lebih agresif, dan lebih mungkin bertindak buruk.</li>\r\n	<li>Hukuman fisik berpengaruh pada anak secara fisiologis dan neurologis. Otak mengartikan rasa sakit sebagai ancaman. Sehingga, ketika orangtua memberikan rasa sakit pada anak, anak akan menghadapi paradoks biologis yang membingungkan. Pada satu sisi, kita semua terlahir dengan naluri untuk mencari pengasuh untuk mendapatkan perlindungan saat kita terluka atau takut. Tapi saat pengasuh yang menjadi sumber rasa sakit dan rasa takut, ketika orangtua menyebarkan terror dalam diri anak dengan apa yang ia lakukan, hal tersebut membingungkan otak anak. Satu sirkuit mendorong anak untuk mencoba melarikan diri dari orangtua yang menimbulkan rasa sakit, tapi sirkuit yang lain mendorong anak mencari perlindungan. Jadi ketika orangtua menjadi sumber ketakutan atau rasa sakit, otak bisa berfungsi tidak teratur karena tidak menemukan pemecahan masalah. Pada keadaan ekstrim, hal Ini membuat anak memiliki kelekatan disorganisasi. Hormon stress kortisol dilepaskan dalam keadaan yang tidak teratur, perasaan marah dan takut berulang kali dapat menyebabkan dampak negatif jangka panjang pada perkembangan otak anak. Hormon kortisol beracun bagi otak dan menghambat pertumbuhan yang sehat. Hukuman dapat menyebabkan perubahan signifikan pada otak, seperti matinya sambungan otak dan bahkan sel-sel otak.</li>\r\n	<li>Saat kita terancam atau diserang secara fisik, maka otak reptil atau primitif aktif dan mengambil alih. Kita masuk ke dalam mode bertahan hidup, yaitu &ldquo;melarikan diri, melawan, atau membeku&rdquo;. Pingsan juga merupakan salah satu respon yang muncul pada beberapa orang saat merasa benar-benar tidak berdaya. Ketika kita menyebabkan anak-anak mengalami ketakutan, rasa sakit, dan kemarahan, kita mengaktifkan peningkatan aliran energi dan informasi ke otak primitif, bukannya mengarahkan pada wilayah otak untuk berpikir reseptif, otak yang berpotensi membuat anak dapat dengan bijak membuat pilihan yang sehat dan fleksibel serta menangani emosi mereka dengan baik. Saat mengaktifkan otak primitif, maka kita kehilangan kesempatan untuk mengembangkan bagian otak yang berpikir. Kita kehilangan kesempatan berharga mengembangkan otak &ldquo;atas&rdquo;, kehilangan kesempatan untuk membuat anak lebih mampu menjadi orang yang bertanggung jawab.</li>\r\n	<li>Hukuman fisik mengajarkan kepada anak bahwa orangtua tidak memiliki cara yang efektif untuk menyelesaikan masalah selain dengan agresi/kekerasan. Artinya orangtua sedang memberikan contoh pada anak bahwa cara menyelesaikan konflik adalah dengan agresi/kekerasan, terutama pada orang yang tidak berdaya atau tidak bisa melawan.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p align=\"center\"><img src=\"https://i.postimg.cc/zfdf0GqY/pukul-2.png\" style=\"width: 299px; height: 221px;\" /></p>\r\n\r\n<p align=\"center\"><em>Sumber: https://www.shutterstock.com</em></p>\r\n\r\n<p align=\"center\">&nbsp;</p>\r\n\r\n<p>Banyak juga pendekatan disiplin tanpa hukuman fisik yang juga sama merusaknya dengan memukul. Mengisolasi anak-anak untuk jangka waktu yang lama, mempermalukan mereka, menakut-nakuti mereka dengan meneriakkan ancaman, dan menggunakan kekerasan verbal atau psikologis juga merupakan bentuk disiplin yang dapat melukai dan berdampak buruk pada anak, meskipun orangtua tidak memberikan hukuman secara fisik.</p>\r\n\r\n<p>Menjadi orangtua yang permisif atau membiarkan anak melakukan apapun yang mereka inginkan juga tidak dianjurkan. Anak perlu bimbingan dan arahan dari orangtua. Ketika orangtua tidak memberikan bimbingan, anak akan merasa tidak aman, dan&nbsp; anak mencoba mendorong batasan. Itulah mengapa anak sering berperilaku untuk mencari batas. Tetapi ketika menetapkan batas, orangtua perlu melakukannya dengan baik dan penuh kasih dengan anak bukan dengan paksaan maupun hukuman. Orantua dapat membimbing perilaku dengan cara yang membuat anak kita akan menerima standar tersebut sebagai standar miliknya. Momen pembelajaran hanya akan efektif jika murid siap untuk belajar.</p>\r\n\r\n<p>Kata disiplin berasal dari bahasa Latin &ldquo;disciplina&rdquo;, yang artinya mengajari, belajar, dan memberikan arahan. Namun, umumnya disiplin diasosiasikan hanya sebagai hukuman atau konsekuensi. Namun, sebenarnya kapanpun kita mendisiplinkan anak kita, tujuan kita bukan untuk menghukum atau memberi konsekuensi, tetapi untuk mengajari.</p>\r\n\r\n<p>Sedangkan akar kata disiplin dalam bahasa Inggris adalah <em>disciple</em>, yang artinya murid dan pembelajar, yaitu orang yang mendapatkan disiplin, bukan narapidana atau penerima hukuman, tetapi seseorang yang belajar melalui arahan. Hukuman mungkin dapat menghilangkan perilaku negatif dalam jangka pendek, tetapi disiplin berbasis pengajaran akan menawarkan keterampilan yang bertahan selama hidup anak.</p>\r\n\r\n<p>&nbsp;Disiplin sebenarnya merupakan salah satu hal paling penuh kasih dalam pengasuhan yang dapat diberikan orangtua pada anaknya. Dalam disiplin, orangtua mengajari anak mengelola dorongan, perasaan marah yang besar, dan mempertimbangkan dampak perilaku mereka terhadap orang lain. Sehingga anak mampu mengendalikan diri, menghormati orang lain, berpartisipasi dalam hubungan dengan orang lain, dan hidup dengan tuntunan moral. Oleh karena itu, penting untuk membedakan disiplin dengan hukuman atau kontrol. Disiplin adalah tentang pengajaran dan pengembangan keterampilan, dengan cara yang penuh kasih, rasa hormat, dan koneksi emosional antara orangtua dan anak.</p>\r\n\r\n<p>Dinas Pemberdayaan Perempuan, Perlindungan Anak, dan Kependudukan Provinsi Jawa Timur membuka <em>Desk Counseling</em> atau layanan psikologi untuk memberikan konseling, psikoedukasi, dan juga psikoterapi untuk anak-anak dan perempuan korban kekerasan, serta anak dan remaja yang memiliki gangguan emosi maupun perilaku. Layanan ini bersifat gratis dan tidak dipungut biaya apapun. Anda juga bisa melakukan konseling secara online dengan menghubungi hotline yang tertera berikut ini.</p>\r\n\r\n<p align=\"center\"><img src=\"https://i.postimg.cc/L6z6GTmT/Whats-App-Image-2021-04-30-at-6-24-40-AM.jpg\" style=\"width: 413px; height: 413px;\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Referensi:</strong></p>\r\n\r\n<p style=\"margin-left:28.65pt;\">Markham, L. (2012). <em>Peaceful parent, happy kids: how to stop yelling and start connecting. </em>New York: Penguin Group, Inc.</p>\r\n\r\n<p style=\"margin-left:28.65pt;\">Siegel, D.J. &amp; Bryson, T.P. (2014).<em>No-drama discipline: the whole-brain way to calm the chaos and nurture your child&rsquo;s developing mind</em>.New York: Batam Books.</p>\r\n\r\n<p style=\"margin-left:28.65pt;\">&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Jumat', '2021-04-30', '12:50:28', '56pukul 2.jpg', 1, '');
INSERT INTO `berita` VALUES (176, 1, 'admin', 'Kekerasan Berbasis Gender Online :  Terbatasnya Ruang Aman Bagi Perempuan dalam Bersosial Media', 'kekerasan-berbasis-gender-online---terbatasnya-ruang-aman-bagi-perempuan-dalam-bersosial-media', '<p align=\"center\"><strong>Kekerasan Berbasis Gender Online :&nbsp; Terbatasnya Ruang Aman Bagi Perempuan dalam Bersosial Media.</strong></p>\r\n\r\n<p align=\"center\"><strong>Oleh : Ajeng H. Puspitasari, M.Psi., Psikolog</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Perkembangan dan penyebaran teknologi informasi yang semakin pesat memberikan dampak yang signifikan dalam pola komunikasi individu. Populernya media sosial sebagai wadah untuk saling berinteraksi telah menghadirkan bentuk &ndash; bentuk baru kekerasan, termasuk kekerasan berbasis gender secara online. Kekerasan berbasis gender sendiri memiliki pengertian sebagai tindak kekerasan pada seseorang yang didasarkan atas jenis kelamin dan memiliki tujuan untuk melecehkan korban berdasarkan gender atau seksualnya. Hal ini termasuk dalam tindakan yang mengakibatkan bahaya, penderitaan fisik, mental, dan seringkali disertai ancaman, paksaan, maupun penghapusan kemerdekaan.&nbsp; Kekerasan berbasis gender online atau yang lebih populer dengan singkatan KBGO merujuk pada tindakan Kekerasan Berbasis Gender yang difasilitasi oleh teknologi atau secara spesifik terjadi didunia maya. Perempuan memiliki resiko yang lebih tinggi untuk menjadi korban kekerasan jenis ini. &nbsp;&nbsp;</p>\r\n\r\n<p>Sejak tahun 2015, komnas perempuan mulai mengidentifikasi kekerasan berbasis gender online sebagai salah satu bentuk kekerasan jenis baru dan memberikan sorotan tajam pada dampak yang ditimbulkannya. Komnas perempuan menggarisbawahi pola kekerasan yang lebih kompleks di ranah cyber, bila dibandingkan dengan kekerasan berbasis gender secara langsung. Dari tahun ke tahun jumlah kekerasan berbasis gender online semakin banyak dilaporkan. Pada tahun 2020 sendiri, terdapat 1458 kasus kekerasan berbasis gender yang berhasil dihimpun oleh komnas perempuan, 659 diantaranya adalah kekerasan berbasis gender online. Tentunya ini bukan angka riil yang terjadi di lapangan, banyak kasus yang tidak dilaporkan dan berlalu begitu saja. Kekerasan berbasis gender online lebih sering dianggap sebagai fenomena yang wajar dalam bersosial media, meskipun demikian dampak yang ditimbulkan oleh jenis kekerasan ini sama berbahayanya dengan kekerasan lainnya.</p>\r\n\r\n<p>Kekerasan berbasis gender online sendiri terbagi dalam delapan tipe perilaku utama, diantaranya : (1) Pendekatan&nbsp; yang bertujuan untuk memperdaya (<em>cyber grooming</em>), (2) Pelecehan secara online (<em>cyber harassment</em>), (3) Peretasan akun sosial media (<em>hacking</em>), (4) Penyebaran konten ilegal (<em>illegal content</em>), (5) Pelanggaran privasi (<em>infringement of privacy</em>), (6) Ancaman distribusi foto/video pribadi (<em>malicious distribution</em>), (7) Pencemaran nama baik (<em>online defamation</em>), dan (8) Rekrutmen online (<em>online recruitment</em>). Sayangnya tidak semua perempuan memahami bahwa delapan perilaku tersebut termasuk kedalam ranah kekerasan berbasis gender. &nbsp;Kekerasan berbasis gender yang dilakukan didunia maya, dianggap sebagai bagian dan resiko dalam bersosial media, sehingga menjadi perilaku yang dimaklumi. Berbagai tipe kekerasan berbasis gender online dapat disamarkan dalam berbagai aktivitas keseharian, lagi &ndash; lagi hal tersebut membuat jenis kekerasan ini dianggap sebagai hal yang wajar.</p>\r\n\r\n<p>Kekerasan berbasis gender online dapat dimanifestasikan dalam berbagai aktivitas, yakni :</p>\r\n\r\n<p align=\"center\"><img alt=\"\" src=\"https://i.postimg.cc/SNVS5kDx/Tabel.jpg\" style=\"width: 622px; height: 800px;\" /></p>\r\n\r\n<p>Kekerasan berbasis gender yang terjadi di dunia maya memiliki dampak yang sama kuatnya dengan jenis kekerasan umum. Jenis kekerasan ini memberikan jangkauan dampak yang lebih luas, tidak hanya pada lingkungan yang terdekat namun juga lingkungan sosial yang lain. Kekerasan berbasis gender online tidak memberikan resiko secara langsung pada fisik, melainkan berdampak signifikan secara psikologis. Korban kekerasan berbasis gender online memiliki <em>self esteem </em>yang lebih rendah sehingga merasa dirinya tidak lagi berharga dan cenderung kurang memiliki kepercayaan diri bila dihadapkan pada situasi sosial. Gangguan kecemasan pada situasi &ndash; situasi sosial menjadi reaksi umum yang sering dilaporkan sebagai dampak kekerasan berbasis gender. Korban akan cenderung&nbsp; menarik diri dari berbagai aktivitas sosial, terutama aktivitas di media sosial. Pada kasus yang lebih ekstrim, dampak yang dirasakan oleh korban dapat mengarah pada depresi, kecenderungan melakukan <em>self harm </em>dan bunuh diri.</p>\r\n\r\n<p>Kekerasan dalam bentuk apapun memberikan dampak yang signifikan pada kualitas hidup, terutama bagi korban. Dinas Pemberdayaan Perempuan, Perlindungan Anak, dan Kependudukan Provinsi Jawa Timur menyadari adanya kebutuhan untuk penanganan korban kekerasan. Dengan tujuan memperluas jangkauan terhadap korban, DP3AK Provinsi membuka layanan <em>Desk Counseling</em> atau layanan psikologi yang melayani konseling, psikoedukasi, dan juga psikoterapi untuk anak-anak dan perempuan korban kekerasan, serta anak dan remaja yang memiliki gangguan emosi maupun perilaku. Layanan ini bersifat gratis dan tidak dipungut biaya apapun. Anda dapat mendapatkan layanan psikologis secara langsung maupun online dengan menghubungi hotline yang tertera sebagai berikut :</p>\r\n\r\n<p align=\"center\"><br />\r\n<img alt=\"\" src=\"https://i.postimg.cc/9F5ctHGZ/3.jpg\" style=\"width: 400px; height: 400px;\" /></p>\r\n', 'Senin', '2021-05-31', '11:10:31', '39LOGO FIX putih (1).jpg', 1, '');
INSERT INTO `berita` VALUES (177, 1, 'admin', 'Bentuk Kekerasan pada Anak dan Dampaknya', 'bentuk-kekerasan-pada-anak-dan-dampaknya', '<div>\r\n<div>\r\n<p align=\"center\"><strong>Bentuk Kekerasan pada Anak dan Dampaknya</strong></p>\r\n\r\n<p align=\"center\">oleh Aghnis Fauziah, S. Psi., M. Psi., Psikolog</p>\r\n</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>\r\n<p>Anak adalah harapan bangsa di masa depan. Anak adalah generasi muda penerus bangsa yang mempunyai peran yang strategis dalam menjamin kelangsungan suatu bangsa dan negara pada masa yang akan datang. Oleh karena itu, anak harus dilindungi agar dapat tumbuh secara optimal baik secara fisik maupun psikologisnya agar mampu menjadi generasi emas untuk membangun Negara menjadi lebih maju.</p>\r\n\r\n<p>Namun demikian, di sekeliling kita, kekerasan pada anak kerap kali terjadi. Anak merupakan salah satu kelompok yang rentan mendapatkan perilaku kekerasan. Di Indonesia, berdasarkan Undang-Undang Perlindungan Anak No 23 Tahun 2002, anak adalah seseorang yang belum berusia 18 tahun, termasuk anak yang masih dalam kandungan.</p>\r\n\r\n<p>Menurut WHO, Kekerasan terhadap anak adalah suatu tindakan penganiayaan atau perlakuan salah pada anak dalam bentuk menyakiti fisik, emosional, seksual, melalaikan pengasuhan dan eksploitasi untuk kepentingan komersial yang secara nyata atau pun tidak, dapat membahayakan kesehatan, kelangsungan hidup, martabat atau perkembangannya.</p>\r\n\r\n<p>Kekerasan pada anak disebut juga dengan Child Abuse, yaitu semua bentuk kekerasan terhadap anak yang dilakukan oleh mereka yang seharusnya bertanggung jawab atas anak tersebut atau mereka yang memiliki kuasa atas anak tersebut, yang seharusnya dapat di percaya, misalnya orang tua, keluarga dekat, dan guru.</p>\r\n\r\n<p>Kekerasan terhadap anak tidak hanya terjadi di keluarga yang miskin atau lingkungan yang buruk. Fenomena ini dapat terjadi pada semua kelompok ras, ekonomi, dan budaya. Bahkan pada keluarga yang terlihat harmonis pun bisa saja terjadi KDRT pada anak. Berdasarkan&nbsp;<a href=\"https://www.http/www.depkes.go.id/download.php?file=download/pusdatin/infodatin/Kekerasan-terhadap-anak.pdf\" target=\"_blank\">data dari Departemen Kesehatan</a>, sebagian besar pelaku kekerasan pada anak merupakan anggota keluarga atau orang lain yang dekat dengan keluarga.</p>\r\n\r\n<p>Tahukah Anda bahwa kekerasan terhadap anak tidak hanya sebatas kekerasan fisik saja, namun ada beragam bentuk kekerasan pada anak yang mungkin tidak pernah Anda sadari sebelumnya.</p>\r\n\r\n<p><strong>Bentuk Kekerasan pada Anak</strong></p>\r\n\r\n<p>Bentuk-bentuk kekerasan pada anak dapat diklasifikasikan dalam 4 macam, yaitu:</p>\r\n\r\n<ol>\r\n	<li><strong>Kekerasan Fisik </strong></li>\r\n</ol>\r\n\r\n<p style=\"margin-left:35.45pt;\">Kekerasan anak secara fisik adalah kekerasan yang dilakukan seseorang berupa melukai bagian tubuh anak seperti penyiksaan, pemukulan, dan penganiayaan terhadap anak, dengan atau tanpa menggunakan bendabenda tertentu, yang menimbulkan luka-luka fisik atau kematian pada anak. Bentuk luka dapat berupa lecet atau memar akibat persentuhan atau kekerasan benda tumpul.</p>\r\n\r\n<p style=\"margin-left:35.45pt;\">Macam-macam kekerasan fisik, antara lain: ditampar, ditendang, dianiaya, dipukul/ditinju, diinjak, dicubit, dijambak, dicekik, didorong, digigit, dibenturkan, dicakar, dijewer, disetrika, disiram air panas, disundut rokok,dll</p>\r\n\r\n<p style=\"margin-left:35.45pt;\">Secara fisik, akibat kekerasan fisik antara lain: luka memar, berdarah, luka lecet,patah tulang, sayatan-sayatan, luka bakar, pembengkakan, jaringan-jaringan lunak, pendarahan di bawah kulit,pingsan, dan bentuk lain yang kondisinya lebih berat, dan akibat yang paling fatal adalah kematian</p>\r\n\r\n<p style=\"margin-left:35.45pt;\">Terjadinya kekerasan terhadap anak secara fisik umumnya dipicu oleh tingkah laku anak yang tidak disukai orangtuanya, seperti anak nakal atau rewel, menangis terus, minta jajan, buang air, kencing atau muntah disembarang tempat, memecahkan barang berharga. Beberapa kasus kekerasan yang dialami anak diantaranya dengan dalih mendisiplinkan anak. Padahal disiplin dengan cara ini tidak hanya membuat tubuh anak terluka, namun juga dapat meninggalkan trauma pada anak. Terdapat cara lain yang lebih efektif untuk mendisiplinkan anak.</p>\r\n\r\n<ol>\r\n	<li value=\"2\"><strong>Kekerasan Psikis </strong></li>\r\n</ol>\r\n\r\n<p style=\"margin-left:35.45pt;\">Kekerasan psikis adalah situasi perasaan tidak aman dan nyaman yang dialami anak. Kekerasan psikis dapat berupa menurunkan harga diri serta martabat korban; kekerasan psikis meliputi penghardikan, penghinaan, penyampaian kata-kata kasar dan kotor, perundungan (bully). Pelaku biasanya melakukan tindakan mental abuse, menyalahkan, melabeli, atau juga mengkambinghitamkan. Anak yang mendapatkan perlakuan ini umumnya menunjukkan gejala perilaku maladaptif, seperti menarik diri, pemalu, menangis jika didekati, takut ke luar rumah dan takut bertemu dengan orang lain.</p>\r\n\r\n<ol>\r\n	<li value=\"3\"><strong>Kekerasan seksual </strong></li>\r\n</ol>\r\n\r\n<p style=\"margin-left:35.45pt;\">Kekerasan seksual merupakan segala jenis aktivitas seksual dengan anak. Kekerasan&nbsp; seksual yang dibagi menjadi: (1) kekerasan seksual nonkontak seperti melihat kekerasan/kegiatan seksual, dipaksa terlibat dalam kegiatan seksual dan mengirimkan gambar foto/video/teks kegiatan seksual, dan (2) seksual kontak seperti sentuhan, diajak berhubungan seks, dipaksa berhubungan seks, dan berhubungan seks di bawah tekanan.</p>\r\n\r\n<p style=\"margin-left:35.45pt;\">Anak yang mengalami kekerasan seksual mengalami dampak psikologis maupun fisik yang serius pada anak.</p>\r\n\r\n<ol>\r\n	<li value=\"4\"><strong>Kekerasan Sosial </strong></li>\r\n</ol>\r\n\r\n<p style=\"margin-left:35.45pt;\">Mencakup Penelantaran Anak dan Eksploitasi Anak.</p>\r\n\r\n<ol style=\"list-style-type:lower-alpha;\">\r\n	<li>Penelantaran anak adalah sikap dan perlakuan orang tua yang tidak memberikan perhatian yang layak terhadap proses tumbuh kembang anak. Orang tua atau orang yang bertanggung jawab atas anak tidak mempedulikan kebutuhan anak.</li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>Kelalaian di bidang kesehatan seperti penolakan atau penundaan memperoleh layanan kesehatan, tidak memperoleh kecukupan gizi, dan perawatan medis saat sakit. Kelalaian ini akan sangat mempengaruhi tumbuh kembang anak, antara lain: terjadi kegagalan dalam tumbuh kembang, malnutrisi, yang menyebabkan fisiknya kecil, kelaparan, terjadi infeksi kronis, hygiene kurang, hormon pertumbuhan turun, sehingga dapat mengakibatkan stunting.</li>\r\n	<li>Kelalaian di bidang pendidikan meliputi pembiaran mangkir (membolos) sekolah yang berulang, tidak menyekolahkan pada pendidikan yang wajib diikuti setiap anak, atau kegagalan memenuhi kebutuhan pendidikan yang khusus.</li>\r\n	<li>Kelalaian di bidang fisik meliputi pengusiran dari rumah dan pengawasan yang tidak memadai.</li>\r\n	<li>Kelalaian di bidang emosional meliputi kurangnya perhatian, pengabaian, penolakan, kekerasan terhadap pasangan di hadapan anak dan pembiaran penggunaan rokok, alkohol dan narkoba oleh anak.</li>\r\n</ul>\r\n\r\n<ol style=\"list-style-type:lower-alpha;\">\r\n	<li value=\"2\">Eksploitasi anak merupakan perbuatan memanfaatkan anak secara sewenang-wenang yang dilakukan oleh keluarga atau orang lain dan memaksa anak melakukan sesuatu yang dapat mengganggu tumbuh kembang mental dan fisiknya. Eksploitasi anak berarti menghilangkan hak-hak anak.</li>\r\n</ol>\r\n\r\n<p style=\"margin-left:35.45pt;\">Contoh, memaksa anak untuk melakukan sesuatu demi kepentingan ekonomi, sosial atau politik tanpa memperhatikan hak-hak anak untuk mendapatkan perlindungan sesuai dengan perkembangan fisik, psikis dan status sosialnya. Misalnya pekerja anak dan prostitusi. Anak bekerja di pabrik-pabrik yang membahayakan (pertambangan, sektor alas kaki) dengan upah rendah dan tanpa peralatan yang memadai, atau dipaksa melakukan pekerjaan rumah tangga melebihi batas kemampuannya.</p>\r\n\r\n<p style=\"margin-left:46.35pt;\">&nbsp;</p>\r\n\r\n<p><strong>Dampak kekerasan pada anak</strong></p>\r\n\r\n<p>Dalam kebanyakan kasus, anak-anak yang mendapat kekerasan lebih menderita secara mental. Kekerasan pada anak tentu akan memberi efek pada diri mereka yang dapat berdampak buruk. Beberapa dampak kekerasan pada anak, yaitu:</p>\r\n\r\n<ol>\r\n	<li><strong>Gangguan Emosi</strong></li>\r\n</ol>\r\n\r\n<p style=\"margin-left:35.45pt;\">Anak menjadi lebih sering sedih atau marah, sulit tidur, bermimpi buruk, memiliki rasa percaya diri yang rendah, ingin melukai diri sendiri, atau bahkan keinginan untuk bunuh diri.</p>\r\n\r\n<ol>\r\n	<li value=\"2\"><strong>Kurang memiliki kepercayaan dan sulit menjalin hubungan</strong></li>\r\n</ol>\r\n\r\n<p style=\"margin-left:35.45pt;\">Anak yang pernah menjadi korban kekerasan akan lebih sulit percaya pada orang, termasuk pada orangtuanya sendiri. Hal ini juga dapat menyebabkan anak kesulitan dalam menjalin hubungan, atau bahkan menciptakan hubungan yang tidak sehat di masa depan. Kondisi ini berisiko membuat mereka merasa kesepian. Penelitian menunjukkan, banyak korban kekerasan anak yang mengalami kegagalan dalam membina hubungan asmara dan pernikahan pada saat dewasa.</p>\r\n\r\n<ol>\r\n	<li value=\"3\"><strong>Memiliki perasaan tidak berharga</strong></li>\r\n</ol>\r\n\r\n<p style=\"margin-left:35.45pt;\">Anak yang mendapat kekerasan juga akan memiliki perasaan bahwa dirinya tidak berharga. Hal ini dapat membuat anak mengabaikan pendidikannya dan hidupnya menjadi rusak dengan&nbsp;<a href=\"https://www.sehatq.com/penyakit/depresi\" target=\"_blank\">rasa depresi</a>, terutama pada korban kekerasan seksual.</p>\r\n\r\n<ol>\r\n	<li value=\"4\"><strong>Sulit mengatur emosi</strong></li>\r\n</ol>\r\n\r\n<p style=\"margin-left:35.45pt;\">Kekerasan pada anak juga dapat membuat mereka kesulitan mengatur emosinya. Anak akan kesulitan mengekspresikan emosi dengan baik hingga membuat emosinya tertahan dan keluar secara tak terduga. Bahkan saat dewasa, dapat mengalihkan depresi, kecemasan, atau kemarahannya dengan mabuk-mabukan atau&nbsp;<a href=\"https://www.sehatq.com/artikel/7-tips-jitu-mengenalkan-cara-menghindari-narkoba-pada-anak\" target=\"_blank\">mengonsumsi narkoba</a>.</p>\r\n\r\n<ol>\r\n	<li value=\"5\"><strong>Merusak perkembangan otak dan sistem saraf</strong></li>\r\n</ol>\r\n\r\n<p style=\"margin-left:35.45pt;\">Efek kekerasan pada anak juga dapat memengaruhi struktur dan perkembangan otak, hingga terjadi penurunan fungsi otak di bagian tertentu. Hal tersebut berpotensi menimbulkan efek jangka panjang, mulai dari penurunan prestasi akademik, hingga gangguan kesehatan mental pada saat dewasa.</p>\r\n\r\n<ol>\r\n	<li value=\"6\"><strong>Melakukan tindakan negatif</strong></li>\r\n</ol>\r\n\r\n<p style=\"margin-left:35.45pt;\">Anak yang mendapat kekerasan lebih mungkin melakukan tindakan negatif, seperti tingkat agresi yang tinggi, merokok, konsumsi alkohol berlebihan, penyalahgunaan obat-obatan terlarang, putus sekolah, dan terlibat hubungan seksual berisiko tinggi.</p>\r\n\r\n<ol>\r\n	<li value=\"7\"><strong>Luka atau cedera</strong></li>\r\n</ol>\r\n\r\n<p style=\"margin-left:35.45pt;\">Kekerasan fisik pada anak dapat menyebabkan luka atau cedera. Karena terlalu emosi, orangtua mungkin tidak menyadari bahwa penyerangan fisik yang dilakukannya bisa melukai anak.</p>\r\n\r\n<ol>\r\n	<li value=\"8\"><strong>Risiko kematian</strong></li>\r\n</ol>\r\n\r\n<p style=\"margin-left:35.45pt;\">Dampak kekerasan pada anak lainnya yang mungkin terjadi adalah kematian. Apabila orangtua melakukan kekerasan pada anak yang masih belum bisa membela diri, bisa saja orangtua terlalu keras memukul atau menyakiti anak, hingga anak kehilangan nyawa.Tak hanya itu, meskipun anak sudah memasuki usia remaja, dampak kekerasan pada anak yang satu ini pun masih tetap masih bisa terjadi. Apalagi jika orangtua tidak dapat mengontrol amarahnya yang mungkin bisa berakibat fatal bagi anak.</p>\r\n\r\n<ol>\r\n	<li value=\"9\"><strong>Memiliki risiko gangguan kesehatan yang lebih tinggi di masa depan</strong></li>\r\n</ol>\r\n\r\n<p style=\"margin-left:35.45pt;\">Efek kekerasan pada anak juga dapat memengaruhi kesehatan dan tumbuh kembang anak. Korban kekerasan anak berisiko mengalami gangguan kesehatan yang lebih tinggi, baik secara psikis maupun fisik, pada saat mereka tumbuh dewasa.</p>\r\n\r\n<p style=\"margin-left:35.45pt;\">Trauma akibat kekerasan pada anak bisa meningkatkan risiko seseorang mengalami asma, penyakit jantung koroner, stroke, diabetes, obesitas, hingga kecenderungan untuk mengonsumsi alkohol berlebih dan menggunakan narkoba.</p>\r\n\r\n<ol>\r\n	<li value=\"10\"><strong>Menjadi pelaku kekerasan pada anak atau orang lain</strong></li>\r\n</ol>\r\n\r\n<p style=\"margin-left:35.45pt;\">Saat anak korban kekerasan menjadi orang tua atau pengasuh, mereka berisiko melakukan hal yang sama pada anak. Siklus ini dapat terus berlanjut jika tidak mendapatkan penanganan yang tepat untuk mengatasi trauma.</p>\r\n\r\n<ol>\r\n	<li value=\"11\"><strong>Berisiko mengalamai gangguan mental saat dewasa</strong></li>\r\n</ol>\r\n\r\n<p style=\"margin-left:35.45pt;\">Seseorang yang menjadi korban kekerasan saat masa kanak-kanan akan berisiko mengalami gangguan mental saat beranjak dewasa seperti depresi, gangguan makan, serangan panik, keinginan bunuh diri, gangguan stres pasca trauma (PTSD), dan kualitas hidup yang lebih rendah. Sebuah penelitian mencatat prevalensi upaya bunuh diri yang cukup tinggi pada orang dewasa yang pernah menjadi korban kekerasan anak.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Jika Anda merasa bahwa anak Anda telah mengalami kekerasan, maka segeralah mencari bantuan psikolog. Anak korban kekerasan perlu mendapat pendampingan yang tepat sehingga kondisi mentalnya tidak terganggu.</p>\r\n\r\n<p>Namun, jika Anda merasa telah melakukan kekerasan pada anak, maka&nbsp;<strong>HENTIKAN</strong> perilaku tersebut. Segera lakukan konseling dengan psikolog untuk membantu Anda menghentikan hal tersebut sehingga tidak lagi terjadi.</p>\r\n\r\n<p>Dinas Pemberdayaan Perempuan, Perlindungan Anak, dan Kependudukan Provinsi Jawa Timur membuka layanan psikologi untuk memberikan konseling dan juga psikoterapi untuk anak-anak dan perempuan korban kekerasan, serta anak dan remaja yang memiliki gangguan emosi maupun perilaku. Layanan ini bersifat gratis dan tidak dipungut biaya apapun. Anda juga bisa melakukan konseling secara online dengan menghubungi hotline yang tertera berikut ini.</p>\r\n\r\n<p align=\"center\"><img src=\"https://i.postimg.cc/9F5ctHGZ/3.jpg\" style=\"border-width: 0px; border-style: solid; width: 413px; height: 413px;\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Referensi:</strong></p>\r\n\r\n<p style=\"margin-left:35.45pt;\">Gil, T. Psychology Today (2018). The Long-Term Impact of Child Abuse: Its effects on mothering and self-esteem.</p>\r\n\r\n<p style=\"margin-left:35.45pt;\">Holmens, L. Verywell Mind (2018). How Childhood Abuse Changes the Brain.</p>\r\n\r\n<p style=\"margin-left:35.45pt;\">Iannelli, V. Verywell Mind (2018). Important Facts, Figures and Examples of Child Abuse Cases Jedd, et al. NCBI. Long-term consequences of childhood maltreatment: Altered amygdala functional connectivity. Development and Psychopathology. 2015. 27(4 0 2), pp. 1577&ndash;1589.</p>\r\n\r\n<p style=\"margin-left:35.45pt;\">McDonald, K. Psych Central (2014). Adverse Childhood Experiences Affect Adult Behaviors.</p>\r\n\r\n<p style=\"margin-left:35.45pt;\">Morin, A. Verywell Mind (2018). The Effects of Childhood Trauma.</p>\r\n\r\n<p style=\"margin-left:35.45pt;\">Orenstein, B. Everyday Health (2016). How Childhood Abuse Could Impact Your Health.<br />\r\nKidsHealth (2015). For Parents. Child Abuse.</p>\r\n\r\n<p style=\"margin-left:35.45pt;\">Suharto, Edi. 1997. Anak Dan Kekerasan Pada Anak. Yayasan Matahariku. Bandung</p>\r\n</div>\r\n</div>\r\n', 'Rabu', '2021-06-30', '13:00:00', '72Cover.jpg', 1, '');
INSERT INTO `berita` VALUES (178, 1, 'admin', 'Bullying dan Dampaknya : Pola Interaksi Sosial yang Tak Wajar', 'bullying-dan-dampaknya--pola-interaksi-sosial-yang-tak-wajar', '<p align=\"center\"><strong>Bullying dan Dampaknya : Pola Interaksi Sosial yang Tak Wajar</strong></p>\r\n\r\n<p align=\"center\">oleh Ajeng H. Puspitasari, M.Psi, Psikolog</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Pernah kah Anda mendengar istilah <em>Bullying ? </em>atau Anda pernah mendapatkan jenis perilaku kekerasan ini ? <em>Bullying </em>dewasa ini sudah menjadi fenomena yang jamak terjadi disekitar kita dan semakin tersosialisasi dengan adanya sosial media. Merujuk pada pengertiannya, <em>bullying</em> (dalam bahasa Indonesia dikenal sebagai &ldquo;penindasan/risak&rdquo;) merupakan segala bentuk penindasan atau kekerasan yang dilakukan dengan sengaja oleh satu orang atau sekelompok orang yang lebih kuat atau berkuasa terhadap orang lain, dengan tujuan untuk menyakiti dan dilakukan secara terus menerus. Pelaku dan korbannya sama - sama tidak terbatas pada rentangan usia atau jenis kelompok tertentu, semua memiliki potensi untuk menjadi pelaku maupun korban <em>bullying</em>. Spektrum korban dan pelaku yang sangat luas menjadikan perilaku kekerasan ini banyak terjadi dan seringkali tidak disadari sebagai sebuah perilaku kekerasan yang berdampak negatif.</p>\r\n\r\n<p>Banyak kasus <em>bullying </em>yang viral di sosial media akhir &ndash; akhir ini menjadikan kita lebih mengenal dan peka terhadap perilaku tersebut, misalkan saja kasus pelajar SMP di bilangan Jakarta yang memutuskan untuk lompat dari lantai empat gedung sekolahnya karena merasa tertekan dengan <em>bullying </em>yang dilakukan oleh teman &ndash; temannya. Tidak berhenti pada satu kasus tersebut, kasus <em>bullying </em>yang pernah menjadi tajuk utama berita di sosial media, adalah kasus yang dialami oleh salah satu siswa SMP Negeri di Malang yang jarinya terpaksa harus diamputasi akibat membusuk setelah dijepit gesper oleh teman &ndash; teman sekelasnya. Kasus kemudian berkembang menjadi lebih besar, para pelaku perundungan tersebut menjadi sasaran <em>bullying </em>baik di sekolah maupun di media sosial yang mengakibatkan para pelaku <em>bullying </em>tersebut mengalami trauma. <em>Bullying </em>menjadi sebuah pusaran perilaku yang terus berulang dan melibatkan banyak pihak. Dua kasus tersebut merupakan contoh nyata bahwa perilaku kekerasan tersebut memiliki dampak negatif yang signifikan.</p>\r\n\r\n<p>Jumlah pengaduan terkait dengan kasus <em>bullying </em>semakin meningkat setiap tahunnya, tercatat Komisi Perlindungan Anak Indonesia (KPAI) menerima setidaknya 37.381 laporan perundungan dalam kurun waktu 2011 hingga 2019. Dari jumlah tersebut, sebanyak 2.473 kasus terjadi di ranah dunia pendidikan. Semakin berkembangnya teknologi dewasa ini, menyebabkan jenis <em>bullying </em>pun semakin beragam, setidaknya terdapat enam kategori perilaku <em>bullying</em>, diantaranya :</p>\r\n\r\n<ol>\r\n	<li><strong>Kontak fisik langsung. </strong></li>\r\n</ol>\r\n\r\n<p>Melibatkan adanya perilaku kekerasan fisik antara pelaku dan korban, yang meliputi tindakan memukul, mendorong, menggigit, menjambak, menendang, mengunci seseorang dalam ruangan, mencubit, mencakar, juga termasuk memeras dan merusak barang yang dimiliki orang lain. Jenis <em>bullying </em>ini memiliki dampak yang dapat teramati nyata oleh panca indra dan mengakibatkan luka fisik baik pada pelaku maupun korban.</p>\r\n\r\n<ol>\r\n	<li value=\"2\"><strong>Kontak verbal langsung</strong>.</li>\r\n</ol>\r\n\r\n<p>Jenis perilaku <em>bullying </em>yang tidak melibatkan sentuhan fisik secara langsung, dapat berupa perilaku mengancam, mempermalukan, merendahkan, mengganggu, memberi panggilan nama (<em>name-calling</em>), sarkasme, merendahkan (<em>put- downs</em>), mencela/mengejek, mengintimidasi, memaki, menyebarkan gosip. Jenis perilaku ini lebih banyak berdampak pada kondisi psikologis daripada fisik, dan membutuhkan waktu pemulihan trauma yang lebih lama.</p>\r\n\r\n<ol>\r\n	<li value=\"3\"><strong>Perilaku non-verbal langsung.</strong></li>\r\n</ol>\r\n\r\n<p>Merupakan perilaku yang diberikan secara langsung kepada korban namun tidak melibatkan kontak fisik. Tindakan melihat dengan sinis, menjulurkan lidah, menampilkan ekspresi muka yang merendahkan, mengejek, atau mengancam; biasanya disertai oleh bullying fisik atau verbal.</p>\r\n\r\n<ol>\r\n	<li value=\"4\"><strong>Perilaku non-verbal tidak langsung. </strong></li>\r\n</ol>\r\n\r\n<p>Merupakan perilaku dengan memanipulasi lingkungan dengan tujuan untuk memberikan rasa tidak nyaman kepada korban. Tindakan mendiamkan seseorang, memanipulasi persahabatan sehingga menjadi retak, sengaja mengucilkan atau mengabaikan, mengirimkan surat kaleng dengan tujuan untuk menekan korban.</p>\r\n\r\n<ol>\r\n	<li value=\"5\"><strong>Cyber Bullying </strong></li>\r\n</ol>\r\n\r\n<p>Tindakan menyakiti orang lain dengan sarana media elektronik (rekaman video intimidasi, pencemaran nama baik lewat media social). Perundungan di dunia maya ini meliputi mengunggah gambar atau video yang tidak pantas, menyebar gosip secara online, dan menggunakan informasi orang lain di media sosial.</p>\r\n\r\n<ol>\r\n	<li value=\"6\"><strong>Pelecehan seksual. </strong></li>\r\n</ol>\r\n\r\n<p>Kadang tindakan pelecehan dikategorikan perilaku agresi fisik atau verbal. Perundungan seksual adalah tindakan yang berbahaya dan memalukan seseorang secara seksual. Intimidasi seksual ini termasuk pemanggilan nama seksual atau cat-calling, gerakan vulgar, menyentuh, dan materi pornografi.&nbsp;</p>\r\n\r\n<p>Dampak dari perilaku <em>bullying </em>tidak bisa dianggap sepele. <em>Bullying </em>tidak hanya berdampak bagi korban saja, namun keseluruhan pihak yang terlibat didalamnya, baik pelaku, korban, maupun seseorang yang menonton perilaku penindasan tersebut (<em>bystanders</em>). <em>Bullying </em>tidak hanya memberikan luka secara fisik, namun juga memberikan dampak negatif pada kondisi psikologis orang &ndash; orang yang terlibat. Pada kasus yang lebih serius, <em>bullying </em>dapat mengarahkan seseorang pada tindakan yang berbahaya, seperti <em>self harm </em>dan bunuh diri. Secara umum dampak <em>bullying </em>dapat dikategorikan melalui perannya, antara lain :</p>\r\n\r\n<ol>\r\n	<li><strong>Bagi Korban </strong></li>\r\n</ol>\r\n\r\n<p><em>Bullying </em>dapat menyebabkan adanya luka pada fisik yang bila terjadi pada derajat yang parah akan menimbulkan hambatan pada organ tubuh. Dari sudut pandang psikologis, <em>bullying </em>dapat menjadi suatu pengalaman traumatik bagi korban yang memicu berbagai keluhan psikologis, seperti gangguan stress pasca trauma, gangguan kecemasan, depresi, dan keluhan gangguan emosi lainnya. Dampak &ndash; dampak psikologis ini relatif menetap bergantung pada kemampuan resiliensi korban itu sendiri. Pada gejala yang lebih ringan, jenis kekerasan ini terbukti menyebabkan adanya penurunan konsep diri dan kepercayaan diri pada korban, sehingga berpotensi menyebabkan masalah dalam interaksi sosial. Bila <em>bullying </em>dilakukan dalam ranah pendidikan,&nbsp; maka hal ini dapat berpengaruh pada prestasi akademik dan tingkat kehadiran di sekolah.</p>\r\n\r\n<ol>\r\n	<li value=\"2\"><strong>Bagi Pelaku </strong></li>\r\n</ol>\r\n\r\n<p>Pelaku <em>bullying </em>pada umumnya memiliki karakteristik yang dominan dengan tingkat kepercayaan diri yang lebih tinggi bila dibandingkan dengan korban yang ditindasnya. Melalui perilaku <em>bullying </em>yang dilakukannya, maka akan muncul rasa puas dalam diri pelaku yang bila dibiarkan akan menjadi sebuah kebutuhan untuk berperilaku agresif yang menetap.Agresivitas yang tinggi, diikuti kecenderungan merasa puas untuk menyakiti orang lain dapat berkembang menjadi pola &ndash; pola kepribadian antisosial. Perilaku agresif yang dilakukan dapat berkembang menjadi perilaku kriminal dan melanggar hukum. Namun tidak semua karakteristik pelaku <em>bullying </em>berkembang menjadi ke arah yang lebih destruktif. Pada beberapa kasus juga kerap ditemukan, pelaku <em>bullying </em>melakukan perisakan didasari oleh identitas kelompok, dan bukan kemauan sendiri. Posisi yang dilematis ini dapat memunculkan potensi perasaan bersalah yang mendalam sehingga memicu labeling negatif pada diri sendiri dan kehilangan konsep diri yang positif.</p>\r\n\r\n<ol>\r\n	<li value=\"3\"><strong>Bagi yang menyaksikan perilaku <em>bullying </em>(<em>Bystanders</em>) </strong></li>\r\n</ol>\r\n\r\n<p>Bila perilaku <em>bullying </em>tidak mendapatkan tindak lanjut yang tegas, maka perilaku ini akan menjadi sebuah konsep perilaku yang boleh dilakukan dan diterima secara sosial. Pola perilaku ini memiliki potensi untuk kembali berulang dengan menempatkan penonton menjadi pelaku di kemudian hari. Hal tersebut dapat terjadi karena beberapa sebab, diantaranya seseorang yang menonton perilaku <em>bullying </em>takut menjadi sasaran berikutnya, sehingga memilih untuk menjadi pelaku sebagai mekanisme pertahanan diri<em>.</em></p>\r\n\r\n<p><em>Bullying </em>bukanlah suatu perilaku yang dapat diterima sebagai bagian dari interaksi sosial antar manusia. Tidak hanya bersifat merusak dan menyakiti, namun juga memiliki kecenderungan untuk terus berulang dan semakin melibatkan banyak pihak. Namun sayangnya perilaku <em>bullying </em>sering menjadi samar dan bersembunyi dalam konteks kata &ldquo;bercanda&rdquo;, terutama bila perilakunya tergolong dalam jenis <em>bullying </em>yang bersifat tidak langsung. Normalisasi <em>bullying </em>yang paling umum terjadi pada ranah <em>cyber</em>. Mengemukakan pendapat, komentar, dan mengunggah postingan yang bertujuan untuk menyakiti orang lain di ranah <em>cyber </em>menjadi lebih dimaklumi dan bukan lagi dianggap sebagai masalah. Hal ini banyak dialami oleh publik figur, dimana <em>cyber bullying </em>yang dialamatkan kepada publik figur tersebut akan lebih dianggap sebagai resiko profesi. Kehidupan maya yang tidak serta merta menampilkan identitas asli pemilik akun, dianggap menjadi ruang berekspresi yang lebih bebas bagi sebagian orang meskipun merugikan orang lain. Perlu adanya sikap kemanusiaan dari semua pihak untuk menghentikan normalisasi terhadap jenis kekerasan ini, karena apapun bentuknya <em>bullying </em>memiliki dampak negatif yang nyata dan berbahaya. Menghentikan <em>bullying</em> dapat dimulai dengan langkah kecil dari diri kita sendiri. Membiasakan diri berpikir positif dan berperasaan positif, maka akan mengembangkan pada perilaku positif yang tidak merugikan pihak lain.</p>\r\n\r\n<p>Luasnya dampak yang ditimbulkan akibat perilaku kekerasan memerlukan penanganan serius oleh berbagai pihak. Perlu adanya sinergi antar individu, pemerintah, dan khususnya masyarakat dalam mewujudkan upaya perlindungan bagi perempuan dan anak. Masyarakat sebagai entitas terbesar dapat berperan menjadi garda terdepan sebagai pelopor dan pelapor perlindungan perempuan dan anak. Dinas Pemberdayaan Perempuan, Perlindungan Anak, dan Kependudukan (DP3AK) Provinsi Jawa Timur sebagai <em>stakeholder </em>dalam pencegahan dan penanggulangan kekerasan berperan aktif untuk mewujudkan perlindungan terhadap perempuan dan anak. Salah satu upaya nyata DP3AK Provinsi Jawa Timur dalam penanggulangan kekerasan terhadap perempuan dan anak melalui program konseling dan psikoterapi gratis bagi perempuan dan anak korban kekerasan di wilayah Jawa Timur. Untuk memanfaatkan program layanan ini dapat menghubungi hotline desk counseling di nomor <strong>0895348771070</strong> pada hari <strong>Senin - Jumat pukul 08.00 - 15.00</strong>.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<center><img alt=\"\" src=\"https://i.postimg.cc/9F5ctHGZ/3.jpg\" style=\"width: 400px; height: 400px;\" /></center>\r\n\r\n<p>&nbsp;</p>\r\n', 'Rabu', '2021-06-30', '13:15:00', '90Cover.jpg', 1, '');
INSERT INTO `berita` VALUES (179, 1, 'admin', 'Menyaksikan KDRT,  Apa Efeknya bagi Anak?', 'menyaksikan-kdrt--apa-efeknya-bagi-anak', '<p align=\"center\"><strong>Menyaksikan KDRT,&nbsp; Apa Efeknya bagi Anak?</strong></p>\r\n\r\n<p align=\"center\">oleh Aghnis Fauziah, S.Psi., M.Psi, Psikolog</p>\r\n\r\n<center>\r\n<p><img alt=\"\" src=\"https://postimg.cc/14c6rd0w\" /><img alt=\"\" src=\"https://postimg.cc/14c6rd0w\" /></p>\r\n</center>\r\n\r\n<p>Kekerasan dalam rumah tangga (KDRT) atau kekerasan domestik adalah kekerasan yang dialami baik secara fisik, psikologis/emosional, maupun seksual yang dialami di rumah, dimana kekerasan bertujuan untuk mendapatkan kekuasan dan kontrol terhadap pasangan.</p>\r\n\r\n<p>Banyak anak yang menyaksikan KDRT juga merupakan korban dari kekerasan fisik. Sekitar 70% laki-laki yang melakukan kekerasan pada pasangan perempuannya juga menyakiti anaknya. Selain itu, perempuan yang menjadi korban dari kekerasan oleh pasangan juga akan cenderung menyakiti atau menelantarkan anaknya.</p>\r\n\r\n<p>Anak-anak yang menyaksikan KDRT atau korban dari kekerasan itu sendiri memiliki risiko kesehatan secara fisik dan mental jangka panjang. Anak yang menyaksikan KDRT antara orangtuanya juga berisiko lebih tinggi melakukan KDRT di masa depan.</p>\r\n\r\n<p><strong>Apa dampak jangka pendek KDRT bagi anak?</strong></p>\r\n\r\n<p>Anak yang salah satu orangtuanya merupakan korban KDRT merasa takut dan cemas. Mereka mungkin selalu berjaga-jaga, mungkinkah hal tersebut akan terjadi lagi. Hal ini akan membuat mereka bereaksi dengan beberapa cara tergantung tingkat usianya,&nbsp; sebagai berikut:</p>\r\n\r\n<ul>\r\n	<li><strong>Bayi (0-2 tahun).</strong> Bayi yang berada dalam keluarga KDRT berpotensi terganggu kelekatannya dengan pengasuh, kebiasaan tidur yang buruk, gangguan makan, dan risiko luka fisik yang lebih tinggi.</li>\r\n	<li><strong>Balita</strong>. Anak yang menyaksikan KDRT pada kedua orangtua dapat mengalami regresi, yaitu mengalami kemunduran seperti ketika mereka lebih kecil, seperti mengompol, menghisap jari, menangis dan merengek lebih sering. Mengalami kesulitan untuk tidur, atau tidur tidak nyenyak, menunjukkan rasa takut dengan bicara gagap, atau bersembunyi, dan menunjukkan gejala kecemasan perpisahan yang berat.</li>\r\n	<li><strong>Usia 7-12 tahun</strong>. Anak pada usia tersebut menunjukkan rasa bersalah mengenai kekerasan dan menyalahkan diri sendiri. KDRT dan kekerasan melukai <em>self-esteem</em> anak, membuat anak minder dan tidak percaya diri. Mereka mungkin tidak berpartisipasi dalam aktivitas sekolah atau nilai yang baik di sekolah, memiliki lebih sedikit teman dibandingkan anak lainnya, dan sering terlibat dalam masalah. Mereka juga sering merasa pusing dan sakit perut.</li>\r\n	<li><strong>Remaja.</strong> Remaja yang menyaksikan kekerasan menjadi bertindak dengan cara yang negatif, seperti bertengkar dengan anggota keluarga atau bolos sekolah. Mereka mungkin juga melakukan perilaku berisiko, seperti melakukan seks bebas dan mengkonsumsi alkohol atau narkoba. Mereka memiliki <em>self-esteem</em> yang rendah dan punya masalah dalam berteman. Mereka mungkin mulai berkelahi atau membully orang lain dan mungkin memiliki masalah dengan hukum. Tipe perilaku ini sering ditemui pada remaja laki-laki yang mengalami kekerasan saat kecil daripada pada remaja perempuan. Remaja perempuan memiliki kemungkinan lebih besar untuk menarik diri dan mengalami depresi.</li>\r\n</ul>\r\n\r\n<p><strong>Apa dampak jangka panjang KDRT atau kekerasan pada anak?</strong></p>\r\n\r\n<p>Anak-anak yang menyaksikan KDRT atau kekerasan berisiko mengulangi siklus kekerasan tersebut ketika mereka dewasa dengan menjadi pelaku ataupun korban dari KDRT. Contohnya, anak laki-laki yang melihat ibunya mendapat kekerasan dari ayahnya 10x lebih mungkin melakukan kekerasan pada pasangan perempuannya saat dewasa. Seorang anak perempuan yang tumbuh dalam rumah di mana ayahnya melakukan kekerasan pada ibunya 6x lebih mungkin untuk mendapat kekerasan seksual dibandingkan anak perempuan yang orangtuanya tidak ada KDRT.</p>\r\n\r\n<p>Anak yang menyaksikan atau korban dari kekerasan emosiona,fisik, atau seksual berisiko lebih tinggi untuk mengalami gangguan kesehata saat dewasa. Ini termasuk dalam kondisi kesehatan mental, seperti depresi dan kecemasan, juga termasuk kesehatan fisik seperti diabetes, obesitas, sakit jantung, dan masalah lainnya.</p>\r\n\r\n<p>Anak yang menyaksikan KDRT juga mempelajari kekerasan dari lingkungannya tersebut, antara lain:</p>\r\n\r\n<ul>\r\n	<li>Tidak apa-apa menyakiti orang lain agar bisa mengontrol mereka</li>\r\n	<li>Malu dengan keluarganya</li>\r\n	<li>Merasa tidak berdaya dan tidak mampu (karena rendahnya harga diri)</li>\r\n	<li>Meyakini bahwa orang lain tidak bisa dipercaya</li>\r\n	<li>Meyakini bahwa dunia tempat yang mengerikan dan tidak aman</li>\r\n	<li>Meyakini bahwa dalam cinta ada kekerasan</li>\r\n	<li>Meyakini bahwa laki-laki jahat, suka mengontrol, dan kejam</li>\r\n	<li>Meyakini bahwa perempuan lemah dan tidak berdaya</li>\r\n</ul>\r\n\r\n<p><strong>Bisakah anak pulih setelah menyaksikan atau mengalami KDRT atau kekerasan?</strong></p>\r\n\r\n<p>Setiap anak merespon secara berbeda terhadap kekerasan dan trauma. Beberapa anak lebih resilien, dan beberapa lebih sensitif. Seberapa sukses seorang anak mampu pulih dari trauma karena kekerasan bergantung dari beberapa hal, yaitu:</p>\r\n\r\n<ul>\r\n	<li>Sistem dukungan yang baik atau hubungan yang baik dengan orang dewasa yang terpercaya</li>\r\n	<li><em>Self-esteem</em> yang tinggi</li>\r\n	<li>Pertemanan yang sehat</li>\r\n</ul>\r\n\r\n<p>Meskipun anak tidak akan mungkin melupakan apa yang ia lihat atau alami selama kekerasan, mereka bisa belajar cara yang sehat untuk mengatasi emosi dan memorinya saat mereka dewasa. Semakin cepat anak mendapat bantuan, semakin baik peluangnya untuk memiliki mental dan fisik yang sehat saat dewasa.</p>\r\n\r\n<p><strong>Bagaimana saya bisa membantu anak pulih setelah menyaksikan atau mengalami KDRT?</strong></p>\r\n\r\n<p>Anda bisa membantu anak dengan:</p>\r\n\r\n<ul>\r\n	<li>Membantunya merasa aman. Anak yang menyaksikan atau mengalami KDRT perlu merasa aman. Mempertimbangkan untuk meninggalkan hubungan mungkin membantu anak merasa lebih aman. Berbicaralah pada anak tentang seberapa penting hubungan yang sehat.</li>\r\n	<li>Berbicara pada anak mengenai ketakutannya. Biarkan mereka tahu bahwa bukan kesalahannya kekerasan yang terjadi.</li>\r\n	<li>Berbicara pada anak mengenai hubungan yang sehat. Membantu anak belajar dari pengalaman kekerasan yang ia rasakan dengan membicarakannya tentang bagaiamana hubungan yang sehat dan yang tidak sehat. Ini akan membantu mereka mengetahui bagaimana hubungan yang sehat ketika mereka mulai menjalani hubungan romantis ketika mereka mulai dewasa.</li>\r\n	<li>Berbicara pada anak mengenai <em>boundary</em>. Biarkan anak tahu bahwa tidak ada satu orang pun yang berhak untuk menyentuh mereka ketika mereka merasa tidak nyaman, termasuk anggota keluarga, guru, atau orang dewasa lain. Jelaskan juga pada anak ia tidak memiliki hak untuk menyentuh tubuh orang lain, dan jika seseorang mengatakan untuk berhenti, mereka sebaiknya berhenti melakukannya.</li>\r\n	<li>Membantu anak menemukan sistem dukungan. Selain orangtua, ada guru BK, psikolog, atau orang dewasa lain yang terpecaya yang menyediakan dukungan.</li>\r\n	<li>Mendapatkan bantuan professional. Terapi atau konseling dapat membantu anak untuk mengatasi kecemasan atau gangguan mental lain karena trauma dari kekerasan. Dinas Pemberdayaan Perempuan, Perlindungan Anak, dan Kependudukan (DP3AK) Provinsi Jawa Timur membuka layanan psikologi untuk memberikan konseling dan juga psikoterapi untuk anak-anak dan perempuan korban kekerasan. Layanan ini bersifat gratis dan tidak dipungut biaya apapun. Anda juga bisa melakukan konseling secara online dengan menghubungi hotline yang tertera berikut ini.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<center><img alt=\"\" src=\"https://i.postimg.cc/9F5ctHGZ/3.jpg\" style=\"width: 400px; height: 400px;\" /></center>\r\n\r\n<p><strong>Apakah lebih baik untuk tetap di dalam pernikahan dengan KDRT daripada membesarkan anak sebagai <em>single parent</em>?</strong></p>\r\n\r\n<p>Anak tumbuh paling baik dalam lingkungan yang aman, stabil, dan saling menyayangi, baik dengan hanya satu atau dua orangtua. Anda mungkin berpikir bahwa kekerasan yang Anda alami tidak berdampak pada anak-anak jika mereka tidak pernah melihatnya. Tetapi anak tetap dapat mendengar adanya kekerasan, seperti teriakan atau suara pemukulan. Mereka juga dapat merasakan tekanan dan rasa takut. Bahkan jika anak-anak tidak melihat Anda mendapat kekerasan, mereka tetap mendapatkan dampak negatif dari kekerasan yang mereka ketahui telah terjadi.</p>\r\n\r\n<p>Jika Anda merasa telah mendapat KDRT, Anda mungkin membutuhkan bantuan agar anak-anak merasa aman dan memulihkan traumanya agar tidak berdampak saat dewasa. Jika Anda memutuskan untuk meninggalkan pernikahan KDRT, Anda perlu melakukan beberapa tahapan untuk melindungi anak-anak dan diri Anda sendiri.</p>\r\n\r\n<p><strong>Bagaimana saya dan anak saya bisa aman sekarang jika saya tidak siap untuk meninggalkan pelaku kekerasan?</strong></p>\r\n\r\n<p>Keamanan dan keselamatan Anda dan anak-anak Anda adalah prioritas paling besar. Jika Anda belum siap untuk meninggalkan hubungan tersebut, anda dapat mengambil beberapa langkah untuk membantu Anda dan anak Anda sekarang, yaitu:</p>\r\n\r\n<ul>\r\n	<li>Membuat rencana darurat untuk Anda dan anak Anda</li>\r\n	<li>Mendengar dan berbicara pada anak dan memberitahu anak bahwa kekerasan tidak baik dan kekerasan terjadi bukan karena salah anak</li>\r\n	<li>Menghubungi Dinas Pemberdayaan Perempuan dan Perlindungan Anak, UPTD PPA, PPT PPA, atau P2TP2A untuk mendapatkan bantuan.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Referensi:</p>\r\n\r\n<p style=\"margin-left:.5in;\">Moles, K. (2001). <em>The Teen Relationship Workbook: for professional helping teens to develop healthy relationships and prevent domestic violence .</em> U.S.A: Wellness Reproductions and Publishing.</p>\r\n\r\n<p style=\"margin-left:.5in;\">Office of Women&#39;s Health. (2019). <em>Effects of domestic violence on children</em>. Retrieved August 30, 2021, from Office of Women&#39;s Health Web site: https://www.womenshealth.gov/relationships-and-safety/domestic-violence/effects-domestic-violence-children</p>\r\n\r\n<p style=\"margin-left:.5in;\">Stiles, M. (2002). Witnessing Domestic Violence: The Effect on Children. <em>American Family Physician</em>, 66(11):2052-2067.</p>\r\n', 'Senin', '2021-08-30', '13:15:00', '13Menyaksikan KDRT.jpg', 1, '');
INSERT INTO `berita` VALUES (181, 1, 'admin', 'Mengenali Tanda-Tanda Kekerasan di Dalam Relasi Dekat', 'mengenali-tandatanda-kekerasan-di-dalam-relasi-dekat', '<p align=\"center\"><strong>Mengenali Tanda-Tanda Kekerasan di Dalam Relasi Dekat</strong></p>\r\n\r\n<p align=\"center\">oleh Aghnis Fauziah, S.Psi., M.Psi., Psikolog</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Dalam relasi dekat, mungkin sulit untuk mengetahui apakah kita mengalami kekerasan <em>(abuse)</em>, khususnya ketika pasangan Anda mengatakan bahwa ia mencintai Anda, memberikan perhatian, atau menghidupi Anda. Memaksa seseorang berhubungan seks, mengatakan hal yang kasar, dan mengancam merupakan bentuk kekerasan.</p>\r\n\r\n<p>Kekerasan adalah usaha untuk mendapatkan <strong>kekuasaan</strong> atau <strong>kontrol</strong> terhadap orang lain dengan menggunakan <strong>taktik fisik, emosional, atau seksual</strong>. Tanda-tanda kekerasan antara lain:</p>\r\n\r\n<ol>\r\n	<li><strong>Melacak semua yang Anda lakukan</strong></li>\r\n</ol>\r\n\r\n<ul style=\"list-style-type:circle;\">\r\n	<li>Memantau apa yang Anda lakukan sepanjang waktu atau menanyakan di mana Anda berada dan dengan siapa Anda setiap detiknya</li>\r\n	<li>Meminta kata sandi media sosial dan akun email Anda</li>\r\n	<li>Menuntut agar Anda segera membalas SMS, chat, atau panggilan</li>\r\n	<li>Mencegah Anda bertemu teman atau keluarga</li>\r\n	<li>Mencegah Anda pergi bekerja atau sekolah</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li value=\"2\"><strong>Menjadi cemburu, mengontrol, atau marah</strong></li>\r\n</ol>\r\n\r\n<ul style=\"list-style-type:circle;\">\r\n	<li>Bertingkah sangat cemburu, termasuk terus-menerus menuduh Anda selingkuh</li>\r\n	<li>Memiliki temperamen yang cepat berubah, sehingga Anda tidak pernah tahu apa yang akan Anda lakukan atau katakan yang dapat menyebabkan masalah</li>\r\n	<li>Mengontrol bagaimana Anda membelanjakan uang Anda</li>\r\n	<li>Mengontrol penggunaan obat-obatan atau pengendalian kelahiran</li>\r\n	<li>Membuat keputusan sehari-hari untuk Anda yang biasanya Anda putuskan sendiri (seperti apa yang akan dikenakan atau makan)</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li value=\"3\"><strong>Merendahkan</strong></li>\r\n</ol>\r\n\r\n<ul style=\"list-style-type:circle;\">\r\n	<li>Merendahkan Anda, seperti menghina penampilan, kecerdasan, atau aktivitas Anda</li>\r\n	<li>Mempermalukan Anda di depan orang lain</li>\r\n	<li>Menghancurkan barang-barang penting yang Anda miliki</li>\r\n	<li>Menyalahkan Anda atas kekerasan yang dilakukannya</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li value=\"4\"><strong>Secara fisik menyakiti atau mengancam untuk menyakiti Anda atau orang yang Anda cintai</strong></li>\r\n</ol>\r\n\r\n<ul style=\"list-style-type:circle;\">\r\n	<li>Mengancam untuk menyakiti Anda, anak-anak, atau orang lain atau hewan peliharaan di rumah Anda</li>\r\n	<li>Menyakiti Anda secara fisik (seperti memukul, memukul, mendorong, mendorong, meninju, menampar, menendang, atau menggigit)</li>\r\n	<li>Menggunakan (atau mengancam akan menggunakan) senjata untuk melawan Anda</li>\r\n	<li>Mengancam untuk melukai dirinya sendiri ketika marah dengan Anda</li>\r\n	<li>Mengancam Anda jika Anda melaporkan kekerasan fisik yang telah dilakukannya.</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li value=\"5\"><strong>Memaksa Anda untuk berhubungan seks atau aktivitas intim lainnya</strong></li>\r\n</ol>\r\n\r\n<ul style=\"list-style-type:circle;\">\r\n	<li>Memaksa Anda untuk berhubungan seks ketika Anda tidak ingin, melalui kekuatan fisik atau ancaman</li>\r\n	<li>Mengasumsikan bahwa persetujuan untuk hubungan seks di masa lalu berarti Anda harus melakukan hal yang sama di masa depan</li>\r\n	<li>Mengasumsikan bahwa persetujuan untuk satu aktivitas berarti persetujuan untuk aktivitas di masa depan atau peningkatan tingkat keintiman (misalnya, dengan asumsi bahwa berciuman harus mengarah pada seks setiap saat)</li>\r\n</ul>\r\n\r\n<p>Jika Anda merasa seseorang melakukan kekerasan terhadap Anda, carilah bantuan. Kekerasan dapat memiliki efek fisik dan emosional yang serius. Anda dapat mencari bantuan pada Dinas yang mengurusi bidang Pemberdayaan Perempuan dan Perlindungan Anak di kota/kabupaten tempat Anda tinggal.</p>\r\n\r\n<p>Kadang-kadang di dalam hubungan romantis (contohnya pacaran, pernikahan) tidak ada kekerasan, tetapi mungkin hubungan tersebut tidak sehat. Jika Anda berpikir bahwa hubungan yang Anda jalani tidak sehat, berusahalah untuk mengkomunikasikannya pada pasangan Anda. Jika tampaknya sulit, Anda dapat berbicara pada sahabat, keluarga, konselor, atau psikolog.</p>\r\n\r\n<p>Anda mungkin berada dalam hubungan yang tidak sehat, jika Anda merasa:</p>\r\n\r\n<ul style=\"list-style-type:circle;\">\r\n	<li>Memfokuskan seluruh energi pada pasangan Anda</li>\r\n	<li>Meninggalkan teman, keluarga, atau aktivitas yang Anda sukai</li>\r\n	<li>Merasa ditekan atau dikontrol oleh pasangan</li>\r\n	<li>Merasa lebih banyak waktu yang buruk daripada waktu yang baik di dalam hubungan</li>\r\n	<li>Sering merasa sedih atau takut ketika bersama dengan pasangan</li>\r\n	<li>Tahu bahwa pasangan tidak mendukung Anda dan apa yang Anda ingin lakukan dalam hidup</li>\r\n	<li>Tidak merasa nyaman menjadi diri sendiri atau membuat keputusan sendiri</li>\r\n	<li>Tidak bisa berbicara jujur untuk menyelesaikan konflik di dalam hubungan</li>\r\n	<li>Tidak bisa mengatakan kebutuhan Anda atau perubahan penting dalam hidup Anda.</li>\r\n</ul>\r\n\r\n<p>Hubungan yang sehat didasarkan pada <strong>kesetaraan</strong>. Ketika masing-masing menyadari kesetaraannya, tidak ada yang berusaha untuk mendapatkan kekuasaan atau kontrol terhadap yang lain, hasilnya adalah hubungan yang sehat.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<center><img alt=\"\" src=\"https://i.postimg.cc/zfmGx0b8/setara.jpg\" /></center>\r\n\r\n<table cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<div>\r\n			<p align=\"center\"><strong><em>Ilustrasi </em></strong><em>Hubungan yang sehat didasarkan pada kesetaraan</em></p>\r\n			</div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Referensi:</p>\r\n\r\n<p>Moles, K. (2001). The Teen Relationship Workbook: for professional helping teens to develop healthy relationships and prevent domestic violence . U.S.A: Wellness Reproductions and Publishing.</p>\r\n\r\n<p>Office of Women&#39;s Health. (2018). Am I being abused? Retrieved October 20, 2021, from Office of Women&#39;s Health Web site: https:// https://www.womenshealth.gov/relationships-and-safety/signs-abuse</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<center><img alt=\"\" src=\"https://i.postimg.cc/9F5ctHGZ/3.jpg\" style=\"width: 400px; height: 400px;\" /></center>\r\n\r\n<p>&nbsp;</p>\r\n', 'Jumat', '2021-10-29', '09:00:00', '16kekerasan relasi dekat.jpg', 1, '');
INSERT INTO `berita` VALUES (180, 1, 'admin', 'Kehamilan Pra Nikah sebagai Sebab Tingginya Angka Perkawinan Usia Anak', 'kehamilan-pra-nikah-sebagai-sebab-tingginya-angka-perkawinan-usia-anak', '<p align=\"center\"><strong>Bullying dan Dampaknya : Pola Interaksi Sosial yang Tak Wajar</strong></p>\r\n\r\n<p align=\"center\">oleh Ajeng H. Puspitasari, M.Psi, Psikolog</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Perkawinan merupakan sebuah bentuk hubungan yang bersifat permanen antara laki &ndash; laki dan perempuan yang terikat peraturan perkawinan dan diakui keabsahannya oleh masyarakat maupun negara. Perkawinan sejatinya dilakukan oleh laki &ndash; laki dan perempuan dalam tujuan yang positif, yakni membangun keluarga, meneruskan keturunan, dan dilandasi dengan kematangan fisik, psikologis, serta sosial. Di Indonesia sendiri, perkawinan diatur dalam Undang &ndash; undang No 16 Tahun 2019 tentang perkawinan yang mana salah satu pasalnya mengatur tentang usia minimal seseorang diizinkan menikah. Menurut Pasal 7 ayat (1) UU No. 16 Tahun 2019 berbunyi bahwa perkawinan hanya diizinkan apabila pria dan wanita sudah mencapai umur 19 (sembilan belas) tahun. 19 tahun dianggap sebagai usia dimana manusia di kategorikan dalam tahap perkembangan dewasa, sedangkan rentang usia 0 &ndash; 18 tahun, seorang manusia masih tergolong dalam kategori rentang usia anak. &nbsp;</p>\r\n\r\n<p>Meskipun telah ada regulasi yang mengatur tentang usia minimal menikah, namun prakteknya masih banyak perkawinan yang dilakukan pada usia dibawah 19 tahun. Perkawinan yang terjadi sebelum usia minimal yang disyaratkan menurut undang &ndash; undang disebut sebagai perkawinan anak. Tingginya angka perkawinan anak di Indonesia menjadi sebuah fenomena yang patut mendapatkan sorotan dan penanganan khusus. Data yang dihimpun oleh Badan Pusat Statistik pada tahun 2019 menunjukkan bahwa 1 dari 9 perempuan berusia anak telah menikah. Sedangkan, perempuan berusia 20-24 tahun yang menikah sebelum berusia 18 tahun di tahun 2019 diperkirakan mencapai sekitar 1.220.900. &nbsp;Jumlah tersebut menempatkan Indonesia pada 10 besar negara dengan angka absolut perkawinan anak tertinggi di dunia. Jawa Barat, Jawa Timur, dan Jawa Tengah menjadi &nbsp;tiga provinsi dengan angka perkawinan anak tertinggi di Indonesia. Jumlah perkawinan anak khususnya di Jawa Timur pada tahun 2019, sebanyak 19.211 kasus, sedangkan pada tahun 2020 sebanyak 9453 kasus perkawinan anak.</p>\r\n\r\n<p>Perkawinan anak di dilatarbelakangi oleh multi faktor, baik faktor struktural maupun faktor yang berasal dari kapasitas individual, komunitas, maupun sosial-budaya. Berdasarkan data yang dihimpun oleh Susenas (Survey Sosial Ekonomi Nasional) &nbsp;pada tahun 2020 mengemukakan beberapa sebab utama terjadinya perkawinan anak diantaranya : bahwa anak perempuan memiliki prevalensi yang lebih tinggi untuk menjalani perkawinan di usia anak dibandingkan dengan anak laki &ndash; laki; anak yang berasal dari keluarga dengan ekonomi lemah; anak yang berasal pedesaan atau lingkungan kumuh; anak putus sekolah dan memiliki pendidikan rendah; serta &nbsp;anak yang terlibat pergaulan bebas dan kehamilan pra nikah menjadi faktor &ndash; faktor utama penyebab tren perkawinan anak.</p>\r\n\r\n<p>Pergaulan bebas dan kehamilan pra nikah memberikan sumbangsih sebagai faktor penyebab perkawinan usia anak. Meskipun bukan merupakan faktor penyebab dengan angka terbesar, namun jumlah perkawinan anak akibat kehamilan pra nikah semakin meningkat dari tahun ke tahun. &nbsp;Direktorat Jenderal Badan Peradilan Agama mengemukakan bahwa 97% permohonan dispensasi nikah yang dilakukan karena salah satu calon pengantin belum cukup umur, disebabkan karena kehamilan pra nikah. Tentunya kenyataan ini dapat berpotensi menjadi permasalahan yang lebih rumit di kemudian hari.</p>\r\n\r\n<p>Kehamilan pra nikah saat ini sudah menjadi hal yang umum terjadi di kalangan remaja bahkan anak &ndash; anak yang berusia lebih muda. Kehamilan pra nikah erat kaitannya dengan lunturnya nilai budaya dan moral yang merujuk pada perilaku seks bebas. Perilaku seks bebas dapat dilakukan karena berbagai latar belakang, baik atas dorongan secara fisik dan mental. Faktor fisik menjadi penyebab paling dominan, mengapa perilaku seks bebas banyak dilakukan oleh remaja bahkan anak, adanya perubahan fisik akibat pubertas yang terjadi pada tahap awal rentang usia remaja memulai ketertarikan secara seksual dan relasi dengan lawan jenis. Pubertas menandai perkembangan organ &ndash; organ seksual manusia mulai matang dan siap untuk bereproduksi, sekresi hormon saat pubertas mengenalkan remaja pada dorongan seksual untuk pertama kali.</p>\r\n\r\n<p><img align=\"left\" height=\"316\" hspace=\"12\" src=\"https://i.postimg.cc/6qw9XjLK/1.jpg\" width=\"221\" />Sebab lain mengapa remaja melakukan perilaku seks bebas karena remaja sedang berada dalam fase membentuk karakteristik diri menjadikannya identik dengan rasa ingin tahu yang tinggi untuk mengeksplorasi hal &ndash; hal yang baru. Usia remaja juga identik dengan keinginan untuk diterima secara sosial oleh lingkungan sekitarnya, dimana seseorang tersebut akan meniru perilaku sosial yang dianggap sebagai tren. Peran orangtua dalam pengasuhan turut menjadi faktor penting dalam pola perilaku seksual remaja. Fungsi orangtua sebagai kontrol atas gejolak emosi remaja, menanamkan nilai moral agama dan sosial memberikan pedoman pada remaja dalam berperilaku membangun kemampuan anak dalam menseleksi perilaku yang boleh dilakukan dan tidak boleh dilakukannya. Remaja wanita yang melakukan perilaku seks pra nikah cenderung memiliki ketergantungan secara emosi terhadap lawan jenisnya, sehingga lebih mudah untuk di manipulasi. Kelekatan emosi antara remaja perempuan dengan figur ayah dapat meminimalkan dependensi emosi.</p>\r\n\r\n<p>Kehamilan pra nikah memiliki dampak yang negatif, utamanya bagi remaja perempuan. Perasaan cemas, rendah diri, takut dan depresi akibat kehamilan tanpa kesiapan mental menjadi keluhan yang paling sering ditemukan. Adanya sanksi sosial dalam bentuk pengasingan sosial, putus sekolah bagi remaja perempuan, dan aborsi karena kehamilan yang tidak diinginkan merupakan resiko nyata yang di hadapi. Secara fisik, kehamilan di pra nikah di usia remaja dapat menyebabkan kecacatan janin, kerusakan sistem reproduksi, dan memperbesar resiko penyakit menular seksual. Menikahkan anak remaja yang terlanjur hamil bukan merupakan sebuah solusi yang efektif. Ketidaksiapan mental yang dialami pasangan menikah dapat memicu kekerasan dalam rumah tangga, disharmonisasi pasangan suami istri, kualitas hidup keluarga yang rendah, meningkatnya stunting dan lain lain sebagainya.</p>\r\n\r\n<p>Pencegahan kehamilan pra nikah perlu melibatkan berbagai peranan, baik orangtua, keluarga, sekolah/institusi pendidikan, maupun komunitas dan masyarakat. Penerapan pola asuh yang tepat dengan membangun kelekatan emosi yang positif antara orangtua dan anak menjadi upaya yang paling utama dalam menguatkan fungsi kontrol orangtua terhadap anak. Orangtua yang dapat memberikan pemenuhan afeksi dan atensi pada anak membuat anak menjadi lebih mudah untuk terbuka dalam membicarakan kesulitan &ndash; kesulitan yang dihadapinya sehingga anak akan lebih mudah untuk diarahkan pada perilaku yang sesuai dengan nilai dan norma masyarakat. Memberikan seks edukasi kepada anak sesuai dengan tahapan usianya diperlukan agar anak memahami dan memiliki integritas diri, mencegah anak dari perilaku seksual beresiko serta pelecehan seksual. Bimbingan dari guru dan sekolah menjadi salah satu upaya pencegahan perilaku seks bebas dan kehamilan pra nikah di institusi pendidikan. Sedangkan masyarakat memiliki peranan preventif dan represif melalui penertiban peraturan dan kontrol sosial.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<center><img alt=\"\" src=\"https://i.postimg.cc/9F5ctHGZ/3.jpg\" style=\"width: 400px; height: 400px;\" /></center>\r\n\r\n<p>&nbsp;</p>\r\n', 'Rabu', '2021-08-31', '14:00:00', '39Kehamilan Pra-Nikah..jpg', 1, '');
INSERT INTO `berita` VALUES (182, 1, 'admin', 'Membangun Karakter Anak Melalui Pengasuhan Positif', 'membangun-karakter-anak-melalui-pengasuhan-positif', '<p align=\"center\"><strong>Membangun Karakter Anak Melalui Pengasuhan Positif</strong></p>\r\n\r\n<p align=\"center\">oleh Ajeng H. Puspitasari, M.Psi., Psikolog</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Orangtua merupakan lingkungan yang pertama dan utama dari hidup seorang anak. Melalui orangtua, anak mendapatkan stimulasi dan berbagai pembelajaran yang dapat dipahaminya sebagai bekal dalam menghadapi berbagai tantangan dalam proses hidupnya mendewasa. Orangtua mengemban tugas pengasuhan yang penting dalam mempersiapkan anak untuk mampu beradaptasi, menyelesaikan permasalahan, memenuhi tugas &ndash; tugas perkembangan baik fisik, mental, maupun sosial. Pengasuhan yang tepat pada anak merupakan hal yang fundamental bagi tumbuh kembang anak dan kehidupan dewasa anak. Melalui pengasuhan orang tua yang tepat, anak belajar untuk beradaptasi dengan lingkungan dan mengembangkan kemampuan untuk menyelesaikan masalah secara adaptif.</p>\r\n\r\n<p>Pengasuhan sendiri dapat didefinisikan sebagai proses mengembangkan dan memanfaatkan pengetahuan dan keterampilan yang sesuai dalam rangka melahirkan, membesarkan dan memberikan perawatan anak. &nbsp;Definisi tersebut secara tidak langsung melibatkan orang tua tidak hanya sekedar melahirkan dan membesarkan anak tetapi juga memberikan perawatan kepada mereka. Bahkan tidak sekedar itu, orang tua harus mendidik, membimbing dan melindungi anak pada setiap tahapan perkembangannya. Tugas pengasuhan orangtua terhadap anak disebut sebagai tugas yang berlangsung seumur hidup. Namun, seperti diketahui tidak ada pendidikan yang khusus untuk mempersiapkan seseorang menjadi orangtua dan pengasuh yang ideal bagi anak &ndash; anaknya, sehingga tidak semua orangtua memiliki pengetahuan dan keterampilan yang baik untuk menciptakan suasana pengasuhan yang positif.</p>\r\n\r\n<p>Orang tua berkewajiban menciptakan suasana hangat dan tentram. Orang tua wajib menjadi panutan yang positif bagi anak. Dalam mendidik anak orang tua mengajarkan karakter yang baik. Anak &ndash; anak yang bertumbuh kembang dalam situasi pengasuhan yang positif memiliki kemungkinan yang lebih kecil untuk mengembangkan perilaku bermasalah selama masa remaja, memiliki kemampuan sosial yang lebih baik, mendorong kemampuan akademik yang lebih memadai, serta mampu menyelesaikan tugas &ndash; tugas perkembangan sesuai dengan tahapan usianya. Pengasuhan positif adalah konsep pengasuhan mengutamakan kasih sayang, saling menghargai, memenuhi hak anak, melindungi anak, dan &nbsp;membangun hubungan yang hangat, bersahabat dan ramah antara anak dan orang tua, serta menstimulasi tumbuh kembang anak, agar optimal.</p>\r\n\r\n<p>Anak &ndash; anak yang dibesarkan dalam pola pengasuhan yang positif lebih mampu mengembangkan kepercayaan diri yang memadai dalam berinteraksi sosial, pendisiplinan yang tepat dalam konsep pengasuhan positif dapat mendorong anak untuk mandiri dalam mengambil keputusan, bertanggung jawab terhadap pilihan yang telah ditetapkannya, dan mampu untuk memilah hal negatif &ndash; positif yang akan dilakukannya. Seorang dewasa yang dibesarkan dalam pola pengasuhan positif selama masa anak &ndash; anaknya memiliki karakteristik yang lebih mudah diterima secara sosial dan memiliki keberhasilan yang lebih tinggi dalam pendidikan maupun karir.</p>\r\n\r\n<p>Konsep penerapan pengasuhan positif melibatkan beberapa strategi, diantaranya :</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol style=\"list-style-type:lower-roman;\">\r\n	<li value=\"5\"><strong>Orangtua sebagai <em>role model </em>positif bagi anak</strong></li>\r\n</ol>\r\n\r\n<p>Orangtua merupakan pembelajaran pertama dan utama bagi anak, sehingga anakmeniru perilaku orangtua. Orangtua memberikan gambaran perilaku yang baik, melalui tutur kata yang lembut, sikap dan perangai yang menghargai orang lain, bertanggung jawab dalam setiap tindakan maupun tutur kata. Contoh perilaku yang ditampakkan orangtua didepan anak, dapat memberikan gambaran yang konkret bagi anak bagaimana sikap yang harus dilakukan dalam kesehariannya.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol style=\"list-style-type:lower-roman;\">\r\n	<li value=\"5\"><strong>Memberikan pendisiplinan yang positif dan membangun atas kesalahan anak</strong></li>\r\n</ol>\r\n\r\n<p>Anak &ndash; anak merupakan pribadi yang berkembang dan sepenuhnya membutuhkan bimbingan oleh kedua orangtuanya. Melakukan kesalahan merupakan hal yang tak terelakkan dan merupakan bagian dari tumbuh kembang karakteristik anak. Bersikap tegas namun tidak menyakiti saat mendisiplinkan anak perlu untuk di lakukan ketika anak menunjukkan perilaku yang salah. Poin penting dalam mendisiplinkan anak adalah anak memahami letak kesalahannya dan memahami mengapa perilaku tersebut tidak boleh dilakukan. Mendisiplinkan anak secara positif dapat mengedepankan diskusi dua arah antara anak dan orangtua, mendengarkan pendapat anak mengenai perilakunya, dan bersama &ndash; sama membuat komitmen untuk tidak mengulangi kesasalah dapat menjadi salah satu bentuk pendisiplinan positif untuk anak.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol style=\"list-style-type:lower-roman;\">\r\n	<li value=\"5\"><strong>Mendengarkan pendapat anak</strong></li>\r\n</ol>\r\n\r\n<p>Sama halnya seperti orang dewasa, anak &ndash; anak memiliki sudut pandang yang unik dalam mengamati suatu hal. Orangtua perlu untuk mendorong anak mengutarakan sudut pandangnya secara verbal. Berikan kesempatan anak untuk mengungkapkan pendapatnya, doronglah anak untuk berbicara lebih banyak tentang apa yang dipikirkan, dirasakan, dan dialaminya. Dengan mendengar pendapat anak, orangtua dapat membangun komunikasi dan kelekatan yang kuat, orangtua dapat lebih mudah memahami kebutuhan dan keinginan anak, orangtua dapat mengetahui kesulitan yang dihadapi oleh anak. Ketika anak mengutarakan pendapat, orangtua sebaiknya menghindari sikap menghakimi dan menyudutkan anak, namun membangun situasi yang nyaman melalui penerimaan dan kasih sayang. Selain mempelajari kemampuan asertif dalam berpendapat, anak akan lebih percaya diri dalam menetapkan keputusan di kemudian hari.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol style=\"list-style-type:lower-roman;\">\r\n	<li value=\"5\"><strong>Menciptakan lingkungan yang aman, nyaman, dan menyenangkan</strong></li>\r\n</ol>\r\n\r\n<p>Suasana rumah juga merupakan faktor yang krusial dalam membangun karakteristik anak yang ideal. Lingkungan yang aman, nyaman, dan menyenangkan dibutuhkan anak dalam proses tumbuh kembang anak. Memastikan lingkungan rumah bebas dari benda &ndash; benda yang membahayakan, menjaga anak agar tetap dalam pengawasan dan jangkauan orang dewasa yang dipercaya, memenuhi kebutuhan anak saat anak memerlukan bantuan orang dewasa, dan memberikan lingkungan yang supportif dan penuh kasih sayang. Pengasuhan positif juga mengedepankan pengasuhan anak tanpa kekerasan sebagai bagian dari menciptakan lingkungan yang aman.</p>\r\n\r\n<p>Tugas pengasuhan merupakan tanggung jawab yang berlangsung terus menerus sepanjang hidup orangtua. Anak tidak memerlukan orangtua yang sempurna, namun anak memerlukan orangtua yang senantiasa mau belajar dan memahami kebutuhan anak. Memahami pentingnya pengasuhan dalam tumbuh kembang anak, sebagai salah satu wujud perlindungan terhadap anak DP3AK Provinsi Jawa Timur membuka layanan konseling dan psikoterapi bagi masyarakat yang membutuhkan pendampingan psikologis maupun konsultasi terkait dengan tumbuh kembang anak. Untuk memanfaatkan program layanan ini dapat menghubungi hotline desk counseling di nomor&nbsp;<strong>0895348771070</strong>&nbsp;pada hari&nbsp;<strong>Senin - Jumat pukul 08.00 - 15.00</strong>.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<center><img alt=\"\" src=\"https://i.postimg.cc/9F5ctHGZ/3.jpg\" style=\"width: 400px; height: 400px;\" /></center>\r\n\r\n<p>&nbsp;</p>\r\n', 'Jumat', '2021-10-29', '10:00:00', '61keluarga bahagia.jpg', 1, '');
INSERT INTO `berita` VALUES (186, 2, 'admin', 'DP3AK Prov. Jatim Menyerahkan Bantuan Spesifik Perempuan dan Anak serta Melakukan Trauma  Healing kepada Korban Bencana Erupsi Gunung Semeru', 'dp3ak-prov-jatim-menyerahkan-bantuan-spesifik-perempuan-dan-anak', '<p>LUMAJANG &ndash; Kepala Dinas Pemberdayaan Perempuan Perlindungan Anak dan Kependudukan Provinsi Jawa Timur Dra. Restu Novi Widiani, MM beserta tim meninjau langsung kondisi pengungsian korban bencana erupsi Gunung Semeru di Kabupaten Lumajang, Senin (6/12).</p>\r\n\r\n<p>Dalam Tenda Pengungsian, Kadis Novi beserta tim berkesempatan bermain, bernyanyi bahkan berselfie bersama anak-anak untuk menghibur dari trauma. Selain mengibur anak anak Novi juga berdiskusi dengan para perempuan dan ibu. Pada kesempatan tersebut DP3AK Prov Jatim bekerjasama dengan mitra juga menyerahkan sejumlah bantuan spesifik kepada perempuan dan anak.</p>\r\n\r\n<p>Pemberian Bantuan Spesifik bagi perempuan dan anak serta melakukan trauma healing bagi korban bencana erupsi gunung semeru ini dilakukan di titik-titik pengungsian diantaranya Desa Candipuro, Desa Penanggal, Desa Jarit, Desa Sumbermujur, dan Desa Pasirian Kabupaten Lumajang.</p>\r\n\r\n<p>Melalui kunjungan ini Kadis Novi memastikan kebutuhan spesifik perempuan dan anak di tempat pengungsian terpenuhi dengan baik. Semoga dapat &nbsp;membantu dan sedikit meringankan beban para korban bencana erupsi gunung semeru di Kabupaten Lumajang.</p>\r\n', 'Minggu', '2021-12-07', '21:19:04', '7Lumajang - Thumbnail.jpg', 1, '');
INSERT INTO `berita` VALUES (183, 2, 'admin', 'Pentingnya Pengarusutamaan Gender dalam Data dan Informasi Kebencanaan', 'pentingnya-pengarusutamaan-gender-dalam-data-dan-informasi-kebencanaan', '<p>SURABAYA - Kepala Dinas Pemberdayaan Perempuan, Perlindungan Anak dan Kependudukan Provinsi Jawa Timur, Dra. Restu Novi Widiani, MM membuka dan memberikan pengarahan pada Kegiatan Lokakarya Penyusunan Katalog Data Kebencanaan dan Pengarusutamaan Gender dan Inklusi Sosial (GESI) dalam Data dan Informasi Provinsi Jawa Timur yang dilaksanakan di Hotel Santika Premier Gubeng Surabaya pada Hari Kamis(25/11).</p>\r\n\r\n<p>Kegiatan Lokakarya Penyusunan Katalog Data Kebencanaan dan Pengarusutamaan Gender dan Inklusi Sosial (GESI) dalam Data dan Informasi Provinsi Jawa Timur merupakan Program SIAP SIAGA (SS) melalui program lima tahun yang didanai oleh Pemerintah Australia bekerja sama dengan Pemerintah Indonesia untuk memperkuat management riskio bencana di Indonesia dan hubungan antara Australia dan Indonesia dalam penanggulangan bencana di tingkat regional.</p>\r\n\r\n<p>Melalui Kegiatan ini diharapkan &nbsp;Pengelolaan data dan informasi ini bertujuan untuk menyediakan data kebencanaan yang terintegrasi dan terkonsolidasi untuk komunikasi pengelolaan resiko bencana dan mendukung pengambilan keputusan dalam kesiapsiagaan, tanggap darurat, dan pemulihan dari tingkat provinsi hingga desa di Jawa Timur.</p>\r\n\r\n<p>Beliau menyampaikan bahwa siap siaga bencana merupakan program kegiatan yang tidak terpisahkan dalam pembangunan responsif gender maka dari itu ketersediaan data terpilah adalah penting dan wajib untuk dapat mengetahui permasalahan gender dan kaum inklusi (disabilitas, lansia, anak, kelompok rentan lainnya) perencanaan intervensi intervensi sesuai dengan &nbsp;isu-isu gender yang ada sesuai data terpilah tersebut.</p>\r\n\r\n<p>Penanganan kebencanaan adalah <em>crosscutting</em> isu yang harus ditangani bersama dengan perangkat daerah terkait. Sebab itu perlu sekali bagi&nbsp; pengambil kebijakan, pelaksanan penganggulang bencana&nbsp; dan&nbsp; kaum relawan&nbsp; memahami dan mempunyai perspektif gender.</p>\r\n', 'Minggu', '2021-11-25', '21:26:07', '7025 Nov - Thumb.jpg', 1, '');
INSERT INTO `berita` VALUES (184, 2, 'admin', 'Pemanfaatan Shelter/Rumah Aman Untuk Peningkatan Layanan pada Korban Kekerasan Perempuan', 'pemanfaatan-shelterrumah-aman-untuk-peningkatan-layanan-pada-korban-kekerasan-perempuan', '<p>BATU &ndash; &nbsp;Dalam rangka menyamakan persepsi antara Provinsi dan Kabupaten/Kota dalam pemanfaat shelter yang ada di UPT Dinsos Sebagai tanggung jawab Pemerintah hadir dalam permasalahan perempuan, maka dilaksanakan kegiatan Penguatan dan Pengembangan Lembaga Penyedia Layanan Perlindungan Perempuan Kewenangan Provinsi dengan tema &quot;Workshop dalam Rangka Pemanfaatan Shelter/Rumah Aman Untuk Peningkatan Layanan pada Korban Kekerasan Perempuan&quot;, di Hotel Royal Orchid, Kota Batu, Kamis (1/12).</p>\r\n\r\n<p>Dalam sambutannya Kepala DP3AK Provinsi Jawa Timur, Dra. Restu Novi Widiani, MM menyampaikan bahwa Permasalahan perempuan yang memerlukan perlindungan dari tindakan kekerasan, perlakuan tidak menyenangkan dan eksploitasi dari tahun ke tahun jumlah kasusnya semakin meningkat dan sangat memprihatinkan sehingga memerlukan penanganan. Pemerintah Provinsi Jawa Timur dalam upaya menjamin kesejahteraan dan perlindungan terhadap perempuan perlu memperluas layanan kesejahteraan sosial bagi perempuan, selain yang telah ada juga memperluas dan memperkuat peran Shelter Perlindungan Perempuan Korban Tindak Kekerasan.</p>\r\n\r\n<p>Kadis Novi berharap melalui kegiatan ini dapat terwujud komitmen bersama antara lembaga layanan, P2TP2A , Lembaga Jejaring dalam pemanfaat shelter/ rumah aman yang tersedia di UPT Dinas Sosial Provinsi Jawa Timur&nbsp; sebagai kolaborasi antara pemerintah dan lembaga layanan dalam penanganan kekerasan pada perempuan.</p>\r\n\r\n<p>Adapun Shelter/Rumah aman yang tersedia antara lain UPT PRSMP Surabaya ( Jl. Balongsari Dalam No.1&nbsp; Kota Surabaya); UPT PPSPA Batu ( Jl. Trunojoyo No.93 Batu); UPT PRSBKW Kediri ( Jl. Semeru No.76 Kota Kediri) UPT PPSAA Sumenep ( Jl Halim Perdana Kusuma No. 86 Sumenep).</p>\r\n\r\n<p>Kegiatan ini diikuti oleh 150 (seratus lima puluh) orang dari unsur pemerintah, lembaga jejaring layanan, organisasi perempuan, lembaga masyarakat dan perguruan tinggi. Sedangkan Narasumber terdiri dari Kepala Dinas P3AK Provinsi Jawa Timur, Kepala Dinas Sosial Provinsi Jawa Timur, Anggota Komisi E DPRD Provinsi Jawa Timur, dan AMAN Indonesia.</p>\r\n\r\n<p>Dalam Kesempatan ini juga di berikan apresiasi berupa piagam penghargaan kepada 6 Kabupaten/ Kota terbaik dalam mendukung pembangunan melalui entri data pada masa pandemi Covid-19 yakni diantaranya :</p>\r\n\r\n<ol>\r\n	<li>Terbaik I Kabupaten Sampang</li>\r\n	<li>Terbaik II Kabupaten Blitar</li>\r\n	<li>Terbaik III Kabupaten Lumajang</li>\r\n	<li>Terbaik IV Kabupaten Pasuruan</li>\r\n	<li>Terbaik V Kabupaten Bondowoso</li>\r\n	<li>Terbaik VI Kota Blitar</li>\r\n</ol>\r\n', 'Minggu', '2021-12-03', '21:54:11', '99Batu - Thumbnail.jpg', 1, '');
INSERT INTO `berita` VALUES (189, 2, 'admin', 'Perempuan Memiliki Peran Penting dalam Pembangunan', 'perempuan-memiliki-peran-penting-dalam-pembangunan', '<p>Banyak fakta yang menunjukan bahwa perempuan telah terbukti menjadi motor penggerak keberhasilan pembangunan dimasa kini maupun&nbsp; dimasa mendatang. Perempuan&nbsp; memiliki kontribusi yang besar di berbagai bidang pembangunan baik ekonomi, pendidikan, maupun&nbsp; kesehatan . &nbsp;</p>\r\n\r\n<p>Pada situasi yang serba sulit seperti saat ini tidak menghentikan langkah perempuan- perempuan Jawa Timur untuk hadir sebagai garda terdepan. Mereka turun dan menjadi penggerak sosial dengan membangun kesadaran masyarakat sebagai contoh banyaknya perempuan sebagai tenaga kesehatan yang memiliki peran penting dalam memerangi COVID-19, dan penjaga bagi keluarganya. Selain itu perempuan juga memegang peranan penting dalam pertumbuhsn ekonomi baik sebagai pengusaha industri makro maupun industri mikro.</p>\r\n\r\n<p>Hal ini disampaikan Kepala Dinas Pemberdayaan Perempuan Perlindungan Anak dan Kependudukan Provinsi Jawa Timur Dra Restu Novi Widiani, MM dalam kegiatan Talkshow Pencegahan Kekerasan pada Perempuan sebagai&nbsp; rangkaian Peringatan Hari Ibu (PHI) Ke -93 Tahun 2021 yang dihadiri oleh lembaga perempua, organisasi perempuan dan forum perempuan Jawa Timur di Hotel Aston Inn, Surabaya. (Rabu, 15 Desember 2021).</p>\r\n\r\n<p>Pada kesempatan ini Kadis DP3AK menyampaikan, &ldquo;meskipun kita tahu bahwa perjuangan perempuan Indonesia belum selesai hal ini dilihat dari pencapaian IPG dan IDG yang belum optimal karena masih banyaknya kekerasan yang terjadi pada perempuan, tingkat kesejahteraan perempuan yang juga masih rendah dan ketimpangan antara dibeberapa bidang pembangunan antara laki-laki dan perempuan.</p>\r\n\r\n<p>Melalui momentum Peringatan Hari Ibu ini, Kadis DP3AK berharap perempuan- perempuan Jawa Timur sadar betapa berharga dirinya serta mampu berperan, berkerja dan berkarya nyata yang menjadikan perempuan lebih berdaya.</p>\r\n\r\n<p>Pada Puncak Acara Rangkaian Kegiatan Peringatan Hari Ibu (PHI) Ke &ndash; 93 dan HUT Dharma Wanita Persatuan Ke- 22 Tahun 2021 yang akan dilaksanakan di Gedung Negara Grahadi pada tanggal 22 Desember 2021, DP3AK Provinsi Jawa Timur akan memberikan penghargaan kepada Kabupaten/ Kota yang telah membentuk UPT Perlindungan Perempuan dan Anak serta diberikan penghargaan kepada perempuan &ndash; perempuan hebat di Jawa Timur yang memiliki Kreatifitas dan Inovasi dalam kewirausahaan yang akan di serahkan oleh Gubernur Jawa Timur. (sa)</p>\r\n', 'Kamis', '2021-12-16', '16:21:55', '56WhatsApp Image 2021-12-16 at 09.51.31.jpeg', 1, '');
INSERT INTO `berita` VALUES (190, 2, 'admin', 'Cegah Depresi Pengungsi Semeru,  Pemprov Jatim Gelar Lomba Memasak', 'cegah-depresi-pengungsi-semeru--pemprov-jatim-gelar-lomba-memasak', '<p style=\"margin-top:0in;margin-right:0in;margin-bottom:19.5pt;margin-left:\r\n0in;text-align:justify\"><span lang=\"EN-US\" style=\"font-size:\r\n11.5pt;font-family:&quot;Verdana&quot;,sans-serif;color:#222222\">Lomba yang diselenggarakan dalam rangka Hari Ibu 22 Desember tersebut dilaksanakan oleh Dinas Pemberdayaan Perempuan, Perlindungan Anak dan Kependudukan Provinsi Jawa Timur di arean pengsian Pronojiwo Lumajang pada tanggal 27 dan 28 Desember 2021. Lomba tersebut diikuti lima puluhan pengungsi perempuan baik remaja putri maupun ibu-ibu. Semua peserta diminta menyajikan kreasi makanan berbahan dasar mi. Mengingat bantuan relawan cukup banyak tersedia bahan dasar mi. Tidak lupa peserta juga diwajibkan memberi nama hasil kreasi makanannya tersebut.<o:p></o:p></span></p>\r\n\r\n<p style=\"margin-top:0in;margin-right:0in;margin-bottom:19.5pt;margin-left:\r\n0in;text-align:justify\"><span lang=\"EN-US\" style=\"font-size:\r\n11.5pt;font-family:&quot;Verdana&quot;,sans-serif;color:#222222\">Gubernur Jawa Timur, Khofifah Indar Parawansa mengatakan lomba tersebut sengaja digelar Pemprov Jatim dalam hal ini Dinas Pemberdayaan Perempuan, Perlindungan Anak, dan Kependudukan (DP3AK) dan Dinas Sosial guna memotivasi para pengungsi untuk segera bangkit dari kesedihan akibat APG Gunung Semeru.<o:p></o:p></span></p>\r\n\r\n<p style=\"margin-top:0in;margin-right:0in;margin-bottom:19.5pt;margin-left:\r\n0in;text-align:justify\"><span lang=\"EN-US\" style=\"font-size:\r\n11.5pt;font-family:&quot;Verdana&quot;,sans-serif;color:#222222\">&ldquo;Selain sebagai hiburan dan arena menyalurkan bakat dan kreativitas kaum perempuan, kami ingin memotivasi para pengungsi untuk segera bangkit. Momen ini digelar sebagai bagian memperingati Hari Ibu juga,&rdquo; ungkap Khofifah di Gedung Negara Grahadi, Surabaya (29/12)2021).<o:p></o:p></span></p>\r\n\r\n<p style=\"margin-top:0in;margin-right:0in;margin-bottom:19.5pt;margin-left:\r\n0in;text-align:justify\"><span lang=\"EN-US\" style=\"font-size:\r\n11.5pt;font-family:&quot;Verdana&quot;,sans-serif;color:#222222\">Khofifah mengatakan, kegiatan ini juga sebagai bentuk trauma healing bagi para pengungsi. Terlebih kaum perempuan merupakan kelompok yang berpotensi mengalami kerentanan, trauma serta depresi di lokasi pengungsian.<o:p></o:p></span></p>\r\n\r\n<p style=\"margin-top:0in;margin-right:0in;margin-bottom:19.5pt;margin-left:\r\n0in;text-align:justify\"><span lang=\"EN-US\" style=\"font-size:\r\n11.5pt;font-family:&quot;Verdana&quot;,sans-serif;color:#222222\">&ldquo;Kondisi posko pengungsian yang minim fasilitas dan tidak ada hiburan cenderung membuat perempuan dan anak berada dalam keadaan depresi dan stress. Lewat ini diharapkan kondisi mereka bisa kembali pulih, selain tentunya dengan konseling,&rdquo; tuturnya.<o:p></o:p></span></p>\r\n\r\n<p style=\"margin-top:0in;margin-right:0in;margin-bottom:19.5pt;margin-left:\r\n0in;text-align:justify\"><span lang=\"EN-US\" style=\"font-size:\r\n11.5pt;font-family:&quot;Verdana&quot;,sans-serif;color:#222222\">Selain perlombaan, kata dia, juga turut digelar hypnotherapy agar para pengungsi siap untuk memasuki fase baru yaitu tinggal di Hunian Sementara (Huntara) yang saat ini proses disiapkan oleh pemerintah.<o:p></o:p></span></p>\r\n\r\n<p style=\"margin-top:0in;margin-right:0in;margin-bottom:19.5pt;margin-left:\r\n0in;text-align:justify\"><span lang=\"EN-US\" style=\"font-size:\r\n11.5pt;font-family:&quot;Verdana&quot;,sans-serif;color:#222222\">Sementara itu, dalam acara lomba memasak tersebut para peserta menyajikan berbagai kreasi makanan lengkap dengan nama yang bersinggungan dengan erupsi Gunung Semeru. Diantaranya, Spaghetti Semeru, Mie Nyemek Semeru, Mie Ayam Semeru, Mie Erupsi Semeru, Mie Setan Semeru, dan Mie Mawut Semeru.<o:p></o:p></span></p>\r\n\r\n<p style=\"margin-top:0in;margin-right:0in;margin-bottom:19.5pt;margin-left:\r\n0in;text-align:justify\"><span lang=\"EN-US\" style=\"font-size:\r\n11.5pt;font-family:&quot;Verdana&quot;,sans-serif;color:#222222\">Dalam Kegiatan tersebut para peserta tiap kelompok setiap orangnya berhak mendapatkan uang senilai Rp. 500 ribu, pakaian berupa daster dan pakaian dalam, tumbler, minyak goreng, dan makanan ringan.<o:p></o:p></span></p>\r\n', 'Senin', '2021-12-23', '21:33:52', '14WhatsApp Image 2022-01-03 at 16.10.31.jpeg', 1, '');
INSERT INTO `berita` VALUES (193, 2, 'admin', 'Pelantikan Kepala Perwakilan BKKBN Provinsi Jawa Timur', 'pelantikan-kepala-perwakilan-bkkbn-provinsi-jawa-timur', '<p>Gubernur Jatim, Khofifah Indar Parawansa melantik Kepala Perwakilan Badan Kependudukan dan Keluarga Berencana Nasional (BKKBN) Provinsi Jatim Dra Maria Ernawati MM di Gedung Negara Grahadi Surabaya, Senin (10/1/2021).</p>\r\n\r\n<p>Pelantikan ini berdasarkan SK Kepala BKKBN nomor 39/KP.05.01/PEG/2021 tanggal 20 Desember 2021. Maria Ernawati sebelumnya menjabat sebagai Kepala Perwakilan BKKBN Provinsi Sulawesi Tengah.</p>\r\n\r\n<p>Dalam sambutannya, Gubernur Khofifah meminta Kepala BKKBN Jatim yang baru dilantik untuk mewujudkan keluarga berkualitas melalui intervensi pada permasalahan stunting, Angka Kematian Ibu (AKI) dan Angka Kematian Bayi (AKB). Hal ini karena tiga hal tersebut menjadi salah satu ujung tombak dalam pembangunan SDM yang berkualitas dan berdaya saing.</p>\r\n\r\n<p>&ldquo;Bersama dengan Tim Penggerak PKK Provinsi Jatim, saya harap BKKBN dapat memberikan kontribusi lebih signifikan lagi dalam mempercepat peningkatan IPM di Jatim, menurunkan angka kematian ibu, angka kematian bayi, perkawinan anak di Jatim dan pencapaian target penurunan stunting sesuai target nasional ke angka 14 persen di tahun 2024,&rdquo; kata orang nomor satu di Jatim ini.</p>\r\n\r\n<p>Menurut dia, peran BKKBN dalam percepatan penurunan stunting melalui pembentukan tim pendamping keluarga sangat fundamental. BKKBN Jatim bisa memberikan dukungan pada layanan intervensi spesifik maupun sebagai penanggung jawab dalam layanan intervensi sensitif.</p>\r\n\r\n<p>&ldquo;Kami harap BKKBN Jatim dapat melakukan pendekatan multi sektoral yang terintegrasi untuk penanganan penurunan stunting baik bersama dengan TP PKK, tenaga kesehatan dan instansi terkait lainnya. BKKBN bisa bersinergi dalam mengidentifikasi dan mendampingi keluarga-keluarga berisiko stunting agar mendapatkan penanganan yang tepat,&rdquo; pintanya.</p>\r\n\r\n<p>Berdasarkan data BKKBN, Kementerian Kesehatan baru saja mengumumkan Hasil Studi Satus Gizi Balita Indonesia (SSGI) 2021. Berdasarkan Hasil SSGI 2021, angka stunting secara nasional menunjukkan perbaikan dengan turunnya tren sebesar 3,3 persen dari 27,7 persen tahun 2019 menjadi 24,4 persen tahun 2021.</p>\r\n\r\n<p>Sama halnya dengan Provinsi Jawa Timur turut mengalami tren yang sama dengan penurunan sebesar 3,35 persen dari 26,86 persen pada tahun 2019 menjadi 23,5 persen di tahun 2021.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&ldquo;Namun meskipun mengalami penurunan, kita tidak boleh berpuas diri permasalahan stunting masih jadi PR kita bersama,&rdquo; jelas Khofifah.</p>\r\n\r\n<p>Selain permasalahan stunting, lanjut gubernur perempuan pertama di Jatim itu, permasalahan Angka Kematian Ibu (AKI) dan Angka Kematian Bayi (AKB) turut menjadi perhatian. Berdasarkan data Dinas Kesehatan Provinsi Jawa Timur, semenjak pandemi Covid 19 bahwa Angka Kematian Ibu di Jawa Timur terjadi peningkatan, pada tahun 2020 tercatat 565 kasus, meningkat jika dibandingkan tahun 2019 sebanyak 529 kasus. Hal ini antara lain meninggal karena Covid-19.</p>\r\n\r\n<p>Sedangkan Angka Kematian Bayi menunjukkan trend menurun tahun 2018 sebanyak 4028 kasus, tahun 2019 sebanyak 3864, dan tahun 2020 sebanyak 3611 kasus.</p>\r\n\r\n<p>&ldquo;Saat ini kita dihadapkan pada dua tantangan baru, yakni masih berlangsungnya pandemi Covid-19 dengan varian terbaru omicron, dan upaya nasional penurunan angka stunting sampai dengan 14 persen di tahun 2024. Untuk itu peran BKKBN sangat strategis dalam sinergi bersama Pemprov Jatim untuk mengendalikan laju penularan Covid-19 melalui pendekatan keluarga,&rdquo; jelasnya.</p>\r\n\r\n<p>Sementara itu, Deputi ADPIN BKKBN Sukaryo Teguh Santoso, mengatakan bahwa upaya percepatan penurunan stunting tentunya harus berjalan beriringan dengan Program Pembangunan Keluarga, Kependudukan dan Keluarga Berencana (Bangga Kencana).</p>\r\n\r\n<p>&ldquo;Salah satu modal utama yang dapat kita gunakan dalam melaksanakan Program Bangga Kencana adalah ketersediaan data mikro keluarga yang diperoleh dari Hasil Pendataan Keluarga Tahun 2021 (PK21),&rdquo; tandas Khofifah.</p>\r\n\r\n<p>Menurutnya, data mikro ini dapat dimanfaatkan semaksimal mungkin untuk kepentingan program yang lebih menyentuh bagi kepentingan seluruh masyarakat. Selain itu pula dapat dioptimalkannya peran Tim Pendamping Keluarga (TPK) dalam rangka percepatan penurunan stunting yang telah terbentuk di Tahun 2021.</p>\r\n\r\n<p>&ldquo;Terus kawal dan lakukan monitoring agar dapat memastikan TPK di Provinsi Jawa Timur melaksanakan tugas dan fungsinya dengan baik dan benar,&rdquo; katanya.</p>\r\n\r\n<p>&ldquo;Saya harap Kepala Perwakilan BKKBN Provinsi Jawa Timur bisa meningkatkan performanya, tetap semangat, percaya dan yakin bahwa kita bisa mengatasi permasalahan dalam penanganan stunting. Dan, pencapaian target Program Bangga Kencana dengan tetap memperhatikan protokol kesehatan,&rdquo; pungkasnya.</p>\r\n\r\n<p>Turut hadir Deputi Bidang Advokasi, Penggerakan dan Informasi (ADPIN) BKKBN Sukaryo Teguh Santoso, Ketua TP PKK Provinsi Jatim Arumi Bachsin Emil Dardak, Wakapolda Jatim Brigjen Pol Slamet Hadi Supraptoyo, Kasdam V/Brawijaya Brigjen TNI Agus Setiawan, Asintel Kejati Jatim Zulbahri, jajaran Forkopimda Jatim, serta beberapa Kepala OPD di lingkungan Pemprov Jatim.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Disadur dari: <strong>beritajatim.com</strong></p>\r\n', 'Selasa', '2022-01-11', '08:41:30', '97IMG-20220110-WA0121.jpg', 1, '');
INSERT INTO `berita` VALUES (192, 2, 'admin', 'Serah Terima Jabatan di Lingkungan DP3AK', 'serah-terima-jabatan-di-lingkungan-dp3ak', '<p>Kegiatan acara serah terima jabatan Pejabat Administrator (eselon III) dan Pejabat Pengawas (eselon IV) di lingkungan Dinas Pemberdayaan Perempuan, Perlindungan Anak dan Kependudukan Provinsi Jawa Timur pada tgl 06 Januari 2022 oleh Kepala Dinas P3AK dan dihadiri seluruh pejabat administrator dan pengawas.</p>\r\n', 'Selasa', '2022-01-06', '12:39:58', '49WhatsApp Image 2022-01-11 at 12.16.41.jpeg', 1, '');
