INSERT INTO `halamanstatis` VALUES (9, 'Sambutan Kepala dinas', 'sambutan-kepala-dinas', '<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: center;\">Puji syukur kami ucapkan kepada Allah SWT atas perkenan-Nya Dinas Pemberdayaan Perempuan dan Perlindungan Anak Provinsi Jawa Timur&nbsp; telah mempunyai website resmi yang menampilkan informasi mengenai Pemberdayaan Perempuan dan Perlindungan Anak di <span style=\"font-family: Roboto, sans-serif; font-size: 14px; text-align: center;\">Provinsi Jawa Timur</span>.&nbsp;</p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: center;\">Tidak lupa kami ucapkan selamat datang di Website kami. Website ini merupakan salah satu bentuk upaya konkrit dari kami untuk menyetarakan dengan lembaga-lembaga lain di Indonesia yang telah terlebih dahulu memasuki dunia informasi global.&nbsp;</p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 14px; line-height: 26px; font-family: Roboto, sans-serif; text-align: center;\">Selain itu diharapkan bahwa website ini dapat menjadi penyedia informasi bagi semua pihak yang memerlukan informasi seputar Pemberdayaan Perempuan dan Perlindungan Anak di lingkungan Pemerintah <span style=\"font-family: Roboto, sans-serif; font-size: 14px; text-align: center;\">Provinsi Jawa Timur</span>.</p>\r\n', '2020-04-28', '31DSCF3929.jpg');
INSERT INTO `halamanstatis` VALUES (6, 'Visi dan Misi', 'visi-dan-misi', '<h1 class=\"sc_title sc_title_regular text-left\" style=\"border: 0px; font-family: Rufina, serif; font-size: 48px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(15, 111, 169); margin: 0px; line-height: 60px; padding: 0px 0px 0.6em;\">VISI &amp; MISI</h1>\r\n\r\n<h3 class=\"sc_title sc_title_regular theme_accent2 text-left\" style=\"border: 0px; font-family: Rufina, serif; font-size: 24px; font-weight: 700; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(227, 60, 28); margin: 0px; line-height: 28px; padding: 0px 0px 0.6em;\">Visi</h3>\r\n\r\n<div class=\"sc_section font-size_1_15em\" style=\"border: 0px; font-family: arial; font-size: 1.15em; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); overflow: hidden;\">\r\n<div style=\"color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, Arial; font-size: 12.5px; text-align: justify;\">&ldquo;TERWUJUDNYA MASYARAKAT JAWA TIMUR YANG ADIL, SEJAHTERA, UNGGUL DAN BERAKHLAK DENGAN TATA KELOLA</div>\r\n\r\n<div style=\"color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, Arial; font-size: 12.5px; text-align: justify;\">PEMERINTAHAN YANG PARTISIPATORIS INKLUSIF MELALUI KERJA BERSAMA DAN SEMANGAT GOTONG ROYONG&rdquo;</div>\r\n\r\n<div style=\"color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, Arial; font-size: 12.5px; text-align: justify;\">&nbsp;</div>\r\n\r\n<h3 class=\"sc_title sc_title_regular theme_accent2 text-left\" style=\"border: 0px; font-family: Rufina, serif; font-size: 24px; font-style: inherit; font-weight: 700; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(227, 60, 28); margin: 0px; line-height: 28px; padding: 0px 0px 0.6em;\">Misi</h3>\r\n\r\n<ul class=\"sc_list sc_list_style_iconed margin_bottom_2em\" style=\"border: 0px; font-size: 16.1px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; margin: 0px 0px 30px; padding-right: 0px; padding-left: 0px;\">\r\n	<li class=\"sc_list_item icon-check odd first\" style=\"border: 0px; font-size: 16.1px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; padding: 0px 0px 0px 20px; list-style: none; line-height: 28px;\">\r\n	<div style=\"color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, Arial; font-size: 12.5px; text-align: justify;\">1. Mewujudkan Keseimbangan Pembangunan Ekonomi, Baik antar Kelompok, antar Sektor dan Keterhubungan Wilayah.</div>\r\n\r\n	<div style=\"color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, Arial; font-size: 12.5px; text-align: justify;\">2. Terciptanya Kesejahteraan yang Berkeadilan Sosial, Pemenuhan Kebutuhan Dasar Terutama Kesehatan dan Pendidikan, Penyediaan Lapangan Kerja dengan Memperhatikan Kelompok Rentan.</div>\r\n\r\n	<div style=\"color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, Arial; font-size: 12.5px; text-align: justify;\">3. Tata Kelola Pemerintahan yang Bersih, Inovatif, Terbuka, Partisipatoris Memperkuat Demokrasi Kewargaan untuk Menghadirkan Ruang Sosial yang menghargai prinsip Kebhinekaan.</div>\r\n\r\n	<div style=\"color: rgb(68, 68, 68); font-family: &quot;Trebuchet MS&quot;, Arial; font-size: 12.5px; text-align: justify;\">4. Melaksanakan Pembangunan Berdasarkan Semangat Gotong Royong, Berwawasan Lingkungan untuk Menjamin Keselarasan Ruang Ekologi, Ruang Sosial, Ruang Ekonomi dan Ruang Budaya.</div>\r\n	</li>\r\n</ul>\r\n</div>\r\n', '2017-11-17', '11jatim.jpg');
