epeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border-radius: 0px 0px 3px 3px; float: none; width: 825px; clear: both; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif;\">\r\n<ul style=\"box-sizing: border-box; padding-right: 0px; padding-left: 0px; margin: 0px 0px 0px 20px; border: 0px; vertical-align: baseline; background: transparent; list-style: inherit;\">\r\n	<li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; background: transparent; line-height: 30px;\">Sekretariat</li>\r\n	<li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; background: transparent; line-height: 30px;\">Bidang Kesetaraan Gender</li>\r\n	<li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; background: transparent; line-height: 30px;\">Bidang Perlindungan dan Tumbuh Kembang Anak</li>\r\n	<li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; background: transparent; line-height: 30px;\">Bidang Pemberdayaan dan Perlindungan Perempuan</li>\r\n	<li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; background: transparent; line-height: 30px;\">Bidang Pengendalian Penduduk, Keluarga Berencana, dan Ketahanan Keluarga</li>\r\n	<li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; background: transparent; line-height: 30px;\">Bidang Kependudukan dan Pencatatan Sipil</li>\r\n</ul>\r\n</div>\r\n', '2020-04-28', '83Pergub-No.-37-Tahun-2019-tentang-SO-Dinas-Pemberdayaan-Perempuan-lamp_page-0001-1024x670.jpg');
INSERT INTO `halamanstatis` VALUES (11, 'Kedudukan Organisasi', 'kedudukan-organisasi', '<div class=\"post_title_con\" style=\"box-sizing: border-box; margin: 0px 0px 30px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; position: relative; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif;\">\r\n<h6 class=\"title\" style=\"box-sizing: border-box; font-family: Oswald, &quot;Open Sans&quot;, sans-serif; margin: 0px 0px 15px; padding: 0px; border: 0px; font-size: 22px; vertical-align: baseline; background: transparent; color: rgb(50, 69, 69); text-transform: uppercase;\">KEDUDUKAN ORGANISASI</h6>\r\n</div>\r\n\r\n<div class=\"feature_inner\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-size: 14px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif;\">\r\n<div class=\"feature_inner_corners\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; background: transparent;\">&nbsp;</div>\r\n</div>\r\n\r\n<div class=\"blog_grid_con\" style=\"box-sizing: border-box; margin: 0px; padding: 25px 0px; border: none; font-size: 14px; vertical-align: baseline; background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border-radius: 0px 0px 3px 3px; float: none; width: 825px; clear: both; color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, Helvetica, Arial, sans-serif;\">\r\n<ul style=\"box-sizing: border-box; padding-right: 0px; padding-left: 0px; margin: 0px 0px 0px 20px; border: 0px; vertical-align: baseline; background: transparent; list-style: inherit;\">\r\n	<li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; background: transparent; line-height: 30px;\">Dinas merupakan unsur pelaksana urusan pemerintahan di bidang pemberdayaan perempuan dan perlindungan anak, pengendalian penduduk dan keluarga berencana, serta administrasi kependudukan dan pencatatan sipil.</li>\r\n	<li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; background: transparent; line-height: 30px;\">Dinas dipimpin oleh Kepala Dinas yang berkedudukan di bawah dan bertanggung jawab kepada Gubernur melalui Sekretaris Daerah Provinsi.</li>\r\n</ul>\r\n</div>\r\n', '2020-04-28', '');
