INSERT INTO `halamanstatis` VALUES (13, 'Kedudukan', 'kedudukan', '<p><span style=\"border: 0px; font-family: arial; font-size: 16px; font-weight: 700; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); text-align: center;\">Kedudukan atau Domisili beserta Alamat Lengkap</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px; text-align: justify;\"><span style=\"border: 0px; font-size: 16px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word;\"><span style=\"border: 0px; font-family: verdana, geneva, sans-serif; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word;\"><tt style=\"border: 0px; font-family: &quot;Courier New&quot;, monospace; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word;\"><span style=\"border: 0px; font-family: arial; font-style: inherit; font-weight: 700; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word;\">Sejarah</span></tt></span></span></p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px; text-align: justify;\"><span style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word;\"><span style=\"border: 0px; font-family: verdana, geneva, sans-serif; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word;\"><tt style=\"border: 0px; font-family: &quot;Courier New&quot;, monospace; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word;\">Bermula dari Bagian Pemberdayaan Perempuan yang berada pada Sekretariat Daerah Provinsi Jawa Timur dan Bidang pada Badan Pemberdayaan Masyarakat Provinsi Jawa Timur, maka sesuai tuntutan keadaan, berubah menjadi Biro Pemberdayaan Perempuan Sekretariat Daerah Provinsi Jawa </tt></span></span><span style=\"color: rgb(0, 0, 0); font-family: &quot;Courier New&quot;, monospace; font-size: 14px; text-align: justify;\">Timur</span><span style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word;\"><span style=\"border: 0px; font-family: verdana, geneva, sans-serif; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word;\"><tt style=\"border: 0px; font-family: &quot;Courier New&quot;, monospace; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word;\">, sedangkan pelaksana keluarga berencana dikoordinasikan oleh Biro Pemerintahan, yang merupakan unsur staf dan dibentuk dengan Peraturan Daerah Nomor 1 Tahun 2006. Kemudian, PP Nomor 41 Tahun 2007 tentang Organisasi Perangkat Daerah mengamatkan agar Urusan Wajib Pemberdayaan Perempuan dan Keluarga Berencana dilaksanakan oleh Lembaga Teknis Daerah, maka selanjutnya dibentuk Badan Pemberdayaan Perempuan, Perlindungan Anak dan Keluarga Berencana (BP3AKB) Provinsi Jawa </tt></span></span><span style=\"color: rgb(0, 0, 0); font-family: &quot;Courier New&quot;, monospace; font-size: 14px; text-align: justify;\">Timur</span><span style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word;\"><span style=\"border: 0px; font-family: verdana, geneva, sans-serif; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word;\"><tt style=\"border: 0px; font-family: &quot;Courier New&quot;, monospace; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word;\"> dengan Peraturan Daerah Nomor 7 Tahun 2008 Tanggal 6 Juni 2008 tentang Organisasi dan Tata Kerja Badan Perencanaan Pembangunan Daerah, Inspektorat dan Lembaga Teknis Daerah Provinsi Jawa Tengah. Selanjutnya berdasarkan Peraturan Daerah Nomor 9 Tahun 2016 tentang Pembentukan dan Susunan Perangkat Daerah Provinsi Jawa Tengah terbentuklah Dinas Pemberdayaan Perempuan, Perlindungan Anak, Pengendalian Penduduk dan Keluarga Berencana Provinsi Jawa Tengah.</tt></span></span></p>\r\n', '2020-04-28', '61jatim.jpg');
INSERT INTO `halamanstatis` VALUES (14, 'Unit Kerja', 'unit-kerja', '<div class=\"blog_grid_con\">\r\n<ul>\r\n	<li>Sekretariat</li>\r\n	<li>Bidang Kesetaraan Gender</li>\r\n	<li>Bidang Perlindungan dan Tumbuh Kembang Anak</li>\r\n	<li>Bidang Pemberdayaan dan Perlindungan Perempuan</li>\r\n	<li>Bidang Pengendalian Penduduk, Keluarga Berencana, dan Ketahanan Keluarga</li>\r\n	<li>Bidang Kependudukan dan Pencatatan Sipil</li>\r\n</ul>\r\n</div>\r\n', '2020-04-28', '8jatim.jpg');
INSERT INTO `halamanstatis` VALUES (15, 'Sekretariat Dinas', 'sekretariat-dinas', '<p><span style=\"border: 0px; font-family: arial; font-size: 14px; font-weight: 700; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0);\">SEKRETARIAT DINAS</span><br style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 14px;\" />\r\n<br style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 14px;\" />\r\n<span style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 14px;\">Tugas :</span><br style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 14px;\" />\r\n<span style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 14px;\">Melaksanakan penyiapan koordinasi pelaksanaan tugas, pembinaan, dan pemberian dukungan administrasi kepada seluruh unit organisasi di lingkungan dinas.</span><br style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 14px;\" />\r\n<br style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 14px;\" />\r\n<span style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 14px;\">Fungsi:</span><br style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 14px;\" />\r\n<span style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 14px;\">1. Penyiapan bahan koordinasi kegiatan di lingkungan dinas</span><br style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 14px;\" />\r\n<span style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 14px;\">2. Penyiapan bahan koordinasi dan penyusunan rencana program dan kegiatan di lingkungan dinas</span><br style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 14px;\" />\r\n<span style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 14px;\">3. Penyiapan bahan pembinaan dan pemberian dukungan administrasi yang meliputi ketatausahaan, kepegawaian, hukum, keuangan, kerumahtanggaan, kerjasama, hubungan masyarakat, arsip dan dokumentasi di lingkungan dinas</span><br style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 14px;\" />\r\n<span style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 14px;\">4. Penyiapan bahan koordinasi, pembinaan dan penataan organisasi dan tata laksana di lingkungan dinas</span><br style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 14px;\" />\r\n<span style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 14px;\">5. Penyiapan bahan koordinasi pelaksanaan sistem pengendalian intern pemerintah dan pengelolaan informasi dan dokumentasi</span><br style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 14px;\" />\r\n<span style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 14px;\">6. Penyiapan bahan pengelolaan barang milik/kekayaan daerah dan pelayanan pengadaan barang/jasa di lingkungan dinas</span><br style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 14px;\" />\r\n<span style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 14px;\">7. Penyiapan bahan evaluasi dan pelaporan sesuai dengan lingkup tugasnya</span><br style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 14px;\" />\r\n<span style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 14px;\">8. Pelaksanaan tugas lain yang diberikan oleh Kepala Dinas&nbsp;sesuai dengan tugas dan fungsinya.</span><br style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 14px;\" />\r\n<br style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 14px;\" />\r\n<span style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 14px;\">Sekretariat Dinas PPPA DALDUK KB Provinsi Jawa Timur, membawahkan</span><br style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 14px;\" />\r\n<span style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 14px;\">1. Sub Bagian Umum dan Kepegawaian</span><br style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 14px;\" />\r\n<span style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 14px;\">2. Sub Bagian Keuangan</span><br style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 14px;\" />\r\n<span style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 14px;\">3. Sub Bagian Program</span></p>\r\n', '2020-04-28', '');
INSERT INTO `halamanstatis` VALUES (16, 'Bidang Kualitas Hidup dan Perlindungan Perempuan', 'bidang-kualitas-hidup-dan-perlindungan-perempuan', '<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">BIDANG KUALITAS HIDUP DAN PERLINDUNGAN&nbsp;PEREMPUAN</p>\r\n\r\n<hr style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 14px;\" />\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">Tugas:</p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">Melaksanakan penyiapan perumusan kebijakan, koordinasi dan pelaksanaan kebijakan, evaluasi dan pelaporan di bidang kualitas hidup dan perlindungan perempuan. Dalam melaksanakan tugasnya Bidang Kualitas Hidup dan Perlindungan Perempuan mempunyai fungsi:</p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">1. Penyiapan bahan perumusan kebijakan, koordinasi dan pelaksanaan kebijakan, evaluasi dan pelaporan di bidang kualitas hidup perempuan;</p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">2. Penyiapan bahan perumusan kebijakan, koordinasi dan&nbsp;pelaksanaan kebijakan, evaluasi dan pelaporan di bidang perlindungan perempuan;</p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">3. Pelaksanaan tugas kedinasan lain yang diberikan oleh Kepala Dinas sesuai dengan tugas dan fungsinya.</p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">&nbsp;</p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">Bidang Kualitas Hidup dan Perlindungan Perempuan, membawahkan :</p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">1. Seksi Kualitas Hidup Perempuan</p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">2. Seksi Perlindungan Perempuan</p>\r\n', '2020-04-28', '83jatim.jpg');
INSERT INTO `halamanstatis` VALUES (17, 'Bidang Pemenuhan Hak dan Perlindungan Anak', 'bidang-pemenuhan-hak-dan-perlindungan-anak', '<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">BIDANG PEMENUHAN HAK DAN PERLINDUNGAN ANAK</p>\r\n\r\n<hr style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 14px;\" />\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">&nbsp;Tugas:</p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">Melaksanakan penyiapan perumusan kebijakan, koordinasi dan pelaksanaan kebijakan, evaluasi dan pelaporan di bidang pemenuhan hak dan perlindungan anak. Dalam melaksanakan tugasnya Bidang Pemenuhan Hak dan Perlindungan Anak mempunyai fungsi:</p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">1. Penyiapan bahan perumusan kebijakan, koordinasi dan pelaksanaan kebijakan, evaluasi dan pelaporan di bidang pemenuhan hak anak;</p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">2. Penyiapan bahan perumusan kebijakan, koordinasi dan pelaksanaan kebijakan, evaluasi dan pelaporan di bidang perlindungan anak;</p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">3. Pelaksanaan tugas kedinasan lain yang diberikan oleh Kepala Dinas sesuai dengan tugas dan fungsinya.</p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">&nbsp;</p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">Bidang Pemenuhan Hak dan Perlindungan Anak, membawahkan :</p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">1. Seksi Pemenuhan Hak Anak</p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">2. Seksi Perlindungan Anak</p>\r\n', '2020-04-28', '14jatim.jpg');
INSERT INTO `halamanstatis` VALUES (18, 'Bidang Pengendalian Penduduk dan Keluarga Sehat', 'bidang-pengendalian-penduduk-dan-keluarga-sehat', '<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">BIDANG PENGENDALIAN PENDUDUK DAN KELUARGA SEJAHTERA</p>\r\n\r\n<hr style=\"color: rgb(0, 0, 0); font-family: arial; font-size: 14px;\" />\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">&nbsp;Tugas:</p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">Melaksanakan penyiapan&nbsp;perumusan kebijakan, koordinasi&nbsp;dan pelaksanaan kebijakan, evaluasi dan pelaporan di bidang pengendalian penduduk dan keluarga sejahtera. Dalam melaksanakan tugasnya Bidang Pengendalian Penduduk dan Keluarga Sejahtera&nbsp;mempunyai fungsi:</p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">1. Penyiapan bahan perumusan kebijakan, koordinasi dan pelaksanaan kebijakan, evaluasi dan pelaporan di bidang pengendalian penduduk;</p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">2. Penyiapan bahan perumusan kebijakan, koordinasi dan pelaksanaan kebijakan, evaluasi dan pelaporan di bidang keluarga sejahtera;</p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">3. Pelaksanaan tugas kedinasan lain yang diberikan oleh Kepala Dinas sesuai dengan tugas dan fungsinya.</p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">&nbsp;</p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">Bidang Pengendalian Penduduk dan Keluarga Sejahtera, membawahkan :</p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">1. Seksi Pengendalian Penduduk</p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">2. Seksi Keluarga Sejahtera</p>\r\n', '2020-04-28', '1jatim.jpg');
INSERT INTO `halamanstatis` VALUES (19, 'Bidang Keluarga Berencana dan Advokasi KIE', 'bidang-keluarga-berencana-dan-advokasi-kie', '<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">BIDANG KELUARGA BERENCANA, ADVOKASI DAN KOMUNIKASI, INFORMASI DAN EDUKASI</p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">Tugas:</p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">Melaksanakan penyiapan perumusan kebijakan, koordinasi dan pelaksanaan kebijakan, evaluasi dan pelaporan di bidang keluarga berencana, dan advokasi dan komunikasi, informasi dan edukasi. Dalam melaksanakan tugasnya Bidang Keluarga Berencana, Advokasi dan Komunikasi, Informasi dan Edukasi menyelenggarakan&nbsp;fungsi:</p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">1. Penyiapan bahan perumusan kebijakan, koordinasi dan pelaksanaan kebijakan, evaluasi dan pelaporan di bidang keluarga berencana;</p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">2. Penyiapan bahan perumusan kebijakan, koordinasi dan&nbsp;pelaksanaan kebijakan, evaluasi dan pelaporan di bidang advokasi dan komunikasi, informasi dan edukasi;</p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">3. Pelaksanaan tugas kedinasan lain yang diberikan oleh Kepala Dinas sesuai dengan tugas dan fungsinya.</p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">&nbsp;</p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">Bidang Keluarga Berencana dan Advokasi KIE, membawahkan :</p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">1. Seksi Keluarga Berencana</p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">2. Seksi Advokasi dan&nbsp;Komunikasi, Informasi dan Edukasi</p>\r\n', '2020-04-28', '21jatim.jpg');
INSERT INTO `halamanstatis` VALUES (20, 'Sekretariat', 'sekretariat', '<p><strong>Sekretariat</strong></p>\r\n\r\n<p>Tugas Pokok Sekretariat adalah merencanakan, melaksanakan, mengoordinasikan dan mengendalikan kegiatan administrasi umum, kepegawaian, perlengkapan, penyusunan program, keuangan, hubungan masyarakat dan protokol.</p>\r\n\r\n<p>Sedangkan Fungsi Sekretariat adalah :</p>\r\n\r\n<p>1) Pengelolaan pelayanan administrasi umum dan perizinan;</p>\r\n\r\n<p>2) Pengelolaan administrasi kepegawaian;</p>\r\n\r\n<p>3) Pengelolaan administrasi keuangan;</p>\r\n\r\n<p>4) Pengelolaan administrasi perlengkapan;</p>\r\n\r\n<p>5) Pengelolaan aset dan barang milik negara;</p>\r\n\r\n<p>6) Pengelolaan urusan rumah tangga, hubungan masyarakat dan protokol;</p>\r\n\r\n<p>7) Pelaksanaan koordinasi penyusunan program, anggaran dan perundangundangan;</p>\r\n\r\n<p>8) Pelaksanaan koordinasi penyelesaian masalah hukum (non yustisia) di bidang kepegawaian;</p>\r\n\r\n<p>9) Pelaksanaan koordinasi penyelenggaraan tugas-tugas bidang;</p>\r\n\r\n<p>10) Pengelolaan kearsipan dan perpustakaan;</p>\r\n\r\n<p>11) Pelaksanaan monitoring serta evaluasi organisasi Dan tatalaksana; Dan</p>\r\n\r\n<p>12) Pelaksanaan tugas-tugas lain yang diberikan oleh Kepala Dinas Susunan organisasi di Sekretariat terdiri atas :</p>\r\n\r\n<p><strong>1. Sub Bagian Tata Usaha, yang mempunyai tugas :</strong></p>\r\n\r\n<p>a. Menyiapkan bahan pelaksanaan penerimaan, pendistribusian dan pengiriman surat-surat, penggandaan naskah-naskah dinas, kearsipan dan perpustakaan;</p>\r\n\r\n<p>b. Menyiapkan bahan pelaksanaan urusan rumah tangga dan keprotokolan;</p>\r\n\r\n<p>c. Menyiapkan bahan pelaksanaan tugas di bidang hubungan masyarakat;</p>\r\n\r\n<p>d. Menyiapkan bahan pelaksanaan penyusunan perencanaan kebutuhan kepegawaian mulai penempatan formasi, pengusulan dalam jabatan, usulan pensiun, peninjauan masa kerja, pemberian penghargaan, kenaikan pangkat, Sasaran Kerja Pegawai, Daftar Urutan Kepangkatan, Sumpah/Janji Aparatur Sipil Negara, Gaji Berkala, kesejahteraan, mutasi dan pemberhentian pegawai, diklat, ujian dinas, izin belajar, pembinaan kepegawaian dan disiplin pegawai, Menyusun standar kompetensi pegawai, tenaga teknis dan fungsional danmenyelenggarakan pengelolaan administrasi aparatur sipil negara lainnya;</p>\r\n\r\n<p><strong>2. Sub Bagian Penyusunan Program dan Anggaran, yang mempunyai tugas :</strong></p>\r\n\r\n<p>a. menyiapkan bahan pelaksanaan penghimpunan data dan menyiapkan bahan koordinasi penyusunan program;</p>\r\n\r\n<p>b. menyiapkan bahan pelaksanaan pengolahan data;</p>\r\n\r\n<p>c. menyiapkan bahan pelaksanaan perencanaan program;</p>\r\n\r\n<p>d. menyiapkan bahan pelaksanaan penataan kelembagaan, ketatalaksanaan dan perundang-undangan;</p>\r\n\r\n<p>e. menyiapkan bahan pelaksanaan penghimpunan data, perencanaan dan penyusunan anggaran serta kebijakan;</p>\r\n\r\n<p>f. menyiapkan bahan monitoring serta evaluasi organisasi dan pelaporan;</p>\r\n\r\n<p>g. melaksanakan tugas-tugas lain yang diberikan oleh Sekretaris.</p>\r\n\r\n<p><strong>3. Sub Bagian Keuangan, yang mempunyai tugas :</strong></p>\r\n\r\n<p>a. menyiapkan bahan pelaksanaan pengelolaan keuangan termasuk pembayaran gaji pegawai;</p>\r\n\r\n<p>b. menyiapkan bahan pelaksanaan koordinasi pelaksanaan kegiatan termasuk penyelesaian rekomendasi hasil pengawasan;</p>\r\n\r\n<p>c. menyiapkan bahan pelaksanaan pengelolaan akuntansi keuangan;</p>\r\n\r\n<p>d. menyiapkan bahan pelaksanaan pengadministrasian dan penatausahaan keuangan</p>\r\n\r\n<p>e. menyiapkan bahan pelaksanaan penyusunan laporan pertanggungjawaban atas pelaksanaan pengelolaan keuangan;</p>\r\n\r\n<p>f. menyiapkan bahan pelaksanaan pengadministrasian aset dan menyusun laporan pertanggungjawaban atas barang-barang inventaris;</p>\r\n\r\n<p>g. menyiapkan bahan pelaksanaan koordinasi pemanfaatan dan penghapusan serta penatausahaan barang milik negara/daerah; dan</p>\r\n\r\n<p>h. melaksanakan tugas-tugas lain yang diberikan oleh Sekretaris.</p>\r\n', '2020-04-28', '97jatim.jpg');
