INSERT INTO `halamanstatis` VALUES (27, 'Data Pegawai', 'data-pegawai', '<p><iframe height=\"1350\" src=\"https://docs.google.com/spreadsheets/d/e/2PACX-1vQvs3iCSYE6wmKuDpv6XSEsgy_xp1bKQppIL1WrG_S06Amp6FQ42O_z1TaWOW7HAmqQNAI7kMh9dN5U/pubhtml?widget=true&amp;headers=false\" width=\"750\"></iframe></p>\r\n', '2020-05-10', '');
INSERT INTO `halamanstatis` VALUES (21, 'Penanganan Korban Kekerasan Berbasis Gender dan Anak', 'penanganan-korban-kekerasan-berbasis-gender-dan-anak', '<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">Pelayanan terpadu perlindungan korban kekerasan berbasis gender dan anak berbentuk jaringan yang merupakan gabungan dari beberapa institusi pemerintah, penegak hukum, lembaga dan organisasi yang memiliki kepedulian terhadap persoalan perempuan dan anak. Pelayanan terpadu Provinsi Jawa Tengah merupakan pelayanan rujukan korban kekerasan antar kabupaten / kota dalam Provinsi Jawa Tengah dan antar Provinsi apabila kabupaten / kota tidak mampu menangani sendiri.</p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">Lima kerangka Kerja Pelayanan Terpadu</p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">1. Layanan Pengaduan</p>\r\n\r\n<ol style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); margin: 0px 0px 30px 20px; padding-right: 0px; padding-left: 0px;\">\r\n	<li style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; line-height: 28px;\">Menerima Pengaduan , mengidentifikasi kebutuhan korban dan melakukan investigasi</li>\r\n	<li style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; line-height: 28px;\">Menyediakan sarana dan prasarana untuk pelayanan pengaduan</li>\r\n	<li style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; line-height: 28px;\">Melakukan rujukan dan mengkoordinasikan kebutuhan korban dengan lembaga layanan lain yang dibutuhkan</li>\r\n	<li style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; line-height: 28px;\">Melakukan pencatatan dan pelaporan kasus</li>\r\n</ol>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">2. Layanan Kesehatan</p>\r\n\r\n<ol style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); margin: 0px 0px 30px 20px; padding-right: 0px; padding-left: 0px;\">\r\n	<li style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; line-height: 28px;\">Memberikan layanan medis untuk pemulihan fisik dan psikis dan memberikan layanan medicolegal (visum et repertum dan visum et psikiatrikum)</li>\r\n	<li style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; line-height: 28px;\">Memfasilitasi pengambilan sampel DNA dan mengirimkan sampel DNA kepada lembaga molekuler eijkman, serta menyediakan petugas tenaga kesehatan terlatih dalam pelayanan kesehatan bagi korban kekerasan</li>\r\n	<li style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; line-height: 28px;\">Menyediakan sarana dan prasarana untuk pelayanan kesehatan dan melakukan rujukan kepada lembaga layanan lain, sesuai kebutuhan korban</li>\r\n	<li style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; line-height: 28px;\">Melakukan monitoring dan evaluasi penyelenggaraan layanan kesehatan bagi korban kekerasan</li>\r\n	<li style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; line-height: 28px;\">Melakukan pencatatan dan pelaporan kasus</li>\r\n</ol>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">3. Layanan Rehabilitas Sosial</p>\r\n\r\n<ol style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); margin: 0px 0px 30px 20px; padding-right: 0px; padding-left: 0px;\">\r\n	<li style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; line-height: 28px;\">Memberikan layanan rehabilitasi sosial (psikososial, konseling, dan bimbingan rohani) korban, serta menyediakan petugas rehabilitasi sosial terlatih</li>\r\n	<li style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; line-height: 28px;\">Menyediakan rumah aman bagi korban kekerasan serta sarana dan prasarana untuk layanan rehabilitasi sosial</li>\r\n	<li style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; line-height: 28px;\">Melakukan monitoring dan evaluasi terhadap penyelenggaraan layanan rehabilitasi sosial</li>\r\n	<li style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; line-height: 28px;\">Melakukan pencatatan dan pelaporan kasus</li>\r\n</ol>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">4. Layanan Bantuan dan Penegakan Hukum</p>\r\n\r\n<ol style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); margin: 0px 0px 30px 20px; padding-right: 0px; padding-left: 0px;\">\r\n	<li style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; line-height: 28px;\">Memberikan bantuan hukum bagi korban baik litigasi maupun non litigasi, serta menyediakan tenaga bantuan hukum dan aparat penegak hukum terlatih</li>\r\n	<li style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; line-height: 28px;\">Menyediakan sarana dan prasarana bagi layanan bantuan dan penegak hukum, serta melakukan monitoring dan evaluasi terhadap penyelenggaraan layanan bantuan dan penegak hukum</li>\r\n	<li style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; line-height: 28px;\">Melakukan pencatatan dan pelaporan kasus</li>\r\n</ol>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">5. Layanan Pemulangan dan Reintegrasi Sosial</p>\r\n\r\n<ol style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); margin: 0px 0px 30px 20px; padding-right: 0px; padding-left: 0px;\">\r\n	<li style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; line-height: 28px;\">Mengkoordinasikan serta memfasilitasi proses pemulangan dan reintegrasi sosial</li>\r\n	<li style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; line-height: 28px;\">Menydiakan tenaga pemulangan dan reintegrasi terlatih serta menyediakan sarana dan prasarana</li>\r\n	<li style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; line-height: 28px;\">Melakukan mediasi dalam proses reintegrasi sosial</li>\r\n	<li style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; line-height: 28px;\">Melakukan pencatatan dan pelaporan kasus</li>\r\n</ol>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">&nbsp;</p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">Alur Pengaduan Korban Tindak Kekerasan Berbasis Gender dan Anak</p>\r\n\r\n<ol style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); margin: 0px 0px 30px 20px; padding-right: 0px; padding-left: 0px;\">\r\n	<li style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; line-height: 28px;\">Korban datang ke Pelayanan Terpadu dan didaftar oleh petugas</li>\r\n	<li style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; line-height: 28px;\">Korban mengisi form pengaduan atas tindak kekerasan yang dialaminya</li>\r\n	<li style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; line-height: 28px;\">Konseling untuk mengidentifikasi kebutuhan dan investigasi kasus</li>\r\n	<li style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; line-height: 28px;\">Shelter, layanan rehabilitas sosial dan rumah aman bagi korban tindak kekerasan</li>\r\n	<li style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; line-height: 28px;\">Koordinasi dengan lembaga lain sebagai langkah penegakan hukum.</li>\r\n</ol>\r\n', '2020-04-28', '9Belakang_leaflet_RGB_(2).jpg');
INSERT INTO `halamanstatis` VALUES (22, 'Call Center Tesa 129', 'call-center-tesa-129', '<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">APA ITU TELEPON SAHABAT ANAK (TESA) 129?</p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">Suatu bentuk layanan perlindungan anak berupa akses telepon bebas pulsa lokal (telepon rumah/kantor) untuk anak yang membutuhkan perlindungan atau berada dalam situasi emergensi/kegawat daruratan maupun anak yang membutuhkan layanan konseling.</p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">TESA bertujuan untuk melindungi hak-hak anak dan memastikan adanya akses untuk mendapatkan pelayanan berkualitas yang dapat mendukung tumbuh kembang anak secara wajar.</p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">Layanan yang diberikan oleh TESA antara lain Pengaduan, Konseling/Konsultasi, dan informasi kepada masyarakat untuk upaya preventif.</p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">Permasalahan yang ditindaklanjuti TESA antara lain:</p>\r\n\r\n<ol style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); margin: 0px 0px 30px 20px; padding-right: 0px; padding-left: 0px;\">\r\n	<li style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; line-height: 28px;\">Anak yang dihambat dalam pemenuhan hak-haknya (hak hidup, hak tumbuh kembang, hak perlindungan dan hak berpartisipasi)</li>\r\n	<li style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; line-height: 28px;\">Anak yang mengalami perlakuan salah</li>\r\n	<li style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; line-height: 28px;\">Anak yang menjadi korban perdagangan manusia</li>\r\n	<li style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; line-height: 28px;\">Anak dengan kemampuan khusus</li>\r\n	<li style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; line-height: 28px;\">Anak yang menjadi pecandu Napza</li>\r\n	<li style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; line-height: 28px;\">Anak yang tinggal dalam suatu institusi</li>\r\n	<li style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; line-height: 28px;\">Anak yang berkonflik dengan hukum</li>\r\n	<li style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; line-height: 28px;\">Anak yang mengalami gangguan jiwa</li>\r\n	<li style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; line-height: 28px;\">Anak yang tertular HIV/AIDS&nbsp;</li>\r\n	<li style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; line-height: 28px;\">Anak yang terkena dampak konflik dan bencana alam</li>\r\n	<li style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; line-height: 28px;\">Anak yang menjadi pengungsi politik</li>\r\n	<li style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; line-height: 28px;\">Anak yang keluarganya berada dalam situasi krisis</li>\r\n	<li style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; line-height: 28px;\">Anak yang membutuhkan perawatan dan perlindungan</li>\r\n</ol>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">Azas Layanan TESA 129</p>\r\n\r\n<ol style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); margin: 0px 0px 30px 20px; padding-right: 0px; padding-left: 0px;\">\r\n	<li style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; line-height: 28px;\">Nondiskriminasi, tanpadibedakan jenis kelamin, agama, suku, kebangsaan,dan status sosial</li>\r\n	<li style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; line-height: 28px;\">Mengupayakan kepentingan terbaik bagi anak</li>\r\n	<li style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; line-height: 28px;\">Menghormati pandangan anak, dengan memperhatikan usia dan kematangan anak serta dengan mendorong, memberikan kesempatan dan melibatkan anak dalam berpartisipasi disetiap proses kegiatan layanan serta menumbuhkan tanggungjawab anak dalam memecahkan masalah</li>\r\n	<li style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; line-height: 28px;\">Mengutamakan hak anak akan kelangsungan hidup dan tumbuh kembang</li>\r\n	<li style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; line-height: 28px;\">Kerahasiaan, semua informasi anak merupakan dokumen rahasia yang tidak boleh disebarluaskan pada orang lain yang tidak berkompeten</li>\r\n</ol>\r\n', '2020-04-28', '15call-center-ip-pbx-barantum-1132x670.jpg');
INSERT INTO `halamanstatis` VALUES (23, 'Kumpulan Peraturan ', 'kumpulan-peraturan-', '<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">UNDANG-UNDANG REPUBLIK INDONESIA NOMOR 7 TAHUN 1984 TENTANG PENGESAHAN KONVENSI MENGENAI PENGHAPUSAN SEGALA BENTUK DISKRIMINASI TERHADAP WANITA (CONVENTION ON THE ELIMINATION OF ALL FORMS OF DISCRIMINATION AGAINST WOMEN)&nbsp;<a href=\"https://dp3akb.jatengprov.go.id/assets/upload/files/peraturan/84uu007.pdf\" style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(136, 136, 136); text-decoration-line: none;\">download</a></p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">UNDANG-UNDANG REPUBLIK INDONESIA NOMOR 23&nbsp;TAHUN 2004 TENTANG PENGHAPUSAN KEKERASAN DALAM RUMAH TANGGA&nbsp;<a href=\"https://dp3akb.jatengprov.go.id/assets/upload/files/peraturan/UU_NO_23_2004.PDF\" style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(136, 136, 136); text-decoration-line: none;\">download</a></p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">UNDANG-UNDANG REPUBLIK INDONESIA NOMOR 39&nbsp;TAHUN 1999 TENTANG HAK ASASI MANUSIA&nbsp;&nbsp;<a href=\"https://dp3akb.jatengprov.go.id/assets/upload/files/peraturan/UU_NO_39_1999.PDF\" style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(136, 136, 136); text-decoration-line: none;\">download</a></p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">UNDANG-UNDANG REPUBLIK INDONESIA NOMOR 7&nbsp;TAHUN 2012 TENTANG PENANGANAN KONFLIK SOSIAL&nbsp;&nbsp;<a href=\"https://dp3akb.jatengprov.go.id/assets/upload/files/peraturan/UU-7-2012.pdf\" style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(136, 136, 136); text-decoration-line: none;\">download</a></p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">UNDANG-UNDANG REPUBLIK INDONESIA NOMOR 35&nbsp;TAHUN 2014&nbsp; TENTANG PERUBAHAN ATAS UNDANG-UNDANG NOMOR 23 TAHUN 2002 TENTANG PERLINDUNGAN ANAK&nbsp;&nbsp;<a href=\"https://dp3akb.jatengprov.go.id/assets/upload/files/peraturan/uu-nomor-35-tahun-2014-tentang-perubahan-uu-pa.pdf\" style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(136, 136, 136); text-decoration-line: none;\">download</a></p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">PERATURAN PRESIDEN REPUBLIK INDONESIA NOMOR 18 TAHUN 2014 TENTANG PERLINDUNGAN DAN PEMBERDAYAAN PEREMPUAN DAN ANAK DALAM KONFLIK SOSIAL&nbsp;<a href=\"https://dp3akb.jatengprov.go.id/assets/upload/files/peraturan/Perpres%20Nomor%2018%20Tahun%202014.pdf\" style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(136, 136, 136); text-decoration-line: none;\">download</a></p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">PERATURAN PRESIDEN REPUBLIK INDONESIA NOMOR 2 TAHUN 2015 TENTANG PERATURAN PELAKSANAAN UNDANG-UNDANG NOMOR 7 TAHUN 2012 TENTANG PENANGANAN KONFLIK SOSIAL&nbsp;<a href=\"https://dp3akb.jatengprov.go.id/assets/upload/files/peraturan/PP_NO_2_2015.pdf\" style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(136, 136, 136); text-decoration-line: none;\">download</a></p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">PERATURAN MENTERI KOORDINATOR BIDANG KESEJAHTERAAN RAKYAT REPUBLIK INDONESIA NOMOR 7 TAHUN 2014 TENTANG RENCANA AKSI NASIONAL PERLINDUNGAN DAN PEMBERDAYAAN PEREMPUAN DAN ANAK DALAM KONFLIK SOSIAL TAHUN 2014 - 2019&nbsp;<a href=\"https://dp3akb.jatengprov.go.id/assets/upload/files/peraturan/PERMENKO%20KESRA%20RI%20NOMOR%2007%20TAHUN%202014.pdf\" style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(136, 136, 136); text-decoration-line: none;\">download</a></p>\r\n\r\n<p style=\"border: 0px; font-family: arial; font-size: 14px; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(0, 0, 0); padding: 0px 0px 30px; margin: 0px;\">PERATURAN MENTERI KOORDINATOR&nbsp;BIDANG KESEJAHTERAAN RAKYAT REPUBLIK INDONESIA&nbsp;NOMOR 8 TAHUN 2014 KELOMPOK KERJA PERLINDUNGAN DAN PEMBERDAYAAN PEREMPUAN DAN ANAK DALAM KONFLIK SOSIAL&nbsp;<a href=\"https://dp3akb.jatengprov.go.id/assets/upload/files/peraturan/2014-10-22%20%282%29.pdf\" style=\"border: 0px; font-style: inherit; font-weight: inherit; outline: 0px; -webkit-font-smoothing: antialiased; overflow-wrap: break-word; color: rgb(136, 136, 136); text-decoration-line: none;\">download</a></p>\r\n', '2020-04-28', '89jatim.jpg');
INSERT INTO `halamanstatis` VALUES (24, 'Draft ', 'draft-', '<p><span style=\"color: rgb(0, 0, 0); font-family: arial;\">DRAFT PERATURAN GUBERNUR JAWA TIMUR NOMOR</span></p>\r\n', '2020-04-28', '51jatim.jpg');
INSERT INTO `halamanstatis` VALUES (25, 'FORM', 'form', '<h3 class=\"text-center title\" id=\"portfolio\" style=\"text-align: center;\"><strong>PERMOHONAN INFORMASI</strong></h3>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><strong>PERSEORANGAN</strong></p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://kominfo.jatimprov.go.id/ppid/images/personal.jpg\" /></p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><span>Pemohon informasi perseorangan adalah Warga Negara Indonesia (WNI) yang mengajukan permohona Informasi Publik sebagaimana diatur dalam undang-undang Nomor 14 Tahun 2008 tentang keterbukaan Informasi Publik dengan persyaratan melampirkan fotokopi Kartu Tanda Penduduk (KTP).</span></p>\r\n\r\n<p style=\"text-align: center;\"><a href=\"http://dp3ak.msnsolutindo.com/hubungi-kami.html\"><input class=\"btn btn-primary btn-lg btn-block\" id=\"submit\" name=\"kirim\" type=\"submit\" value=\"Entry Form\" /></a></p>\r\n\r\n<table border=\"0\" cellspacing=\"0\" style=\"margin-left: auto; margin-right: auto;\" width=\"128\">\r\n	<tbody>\r\n		<tr>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><b>KELOMPOK / ORGANISASI</b></p>\r\n\r\n<p style=\"text-align: center;\"><a href=\"http://kominfo.jatimprov.go.id/ppid/form_personal.php\"><img alt=\"\" src=\"http://kominfo.jatimprov.go.id/ppid/images/publik.jpg\" /></a></p>\r\n\r\n<p style=\"text-align: center;\"><span>Pemohon informasi kelompok atau organisasi adalah badan hukum atau badan publik sebagaimana dimaksud dalam undang-undang nomor 14 tahun 2008 tentang Keterbukaan Informasi Publik dengan persyaratan melampirkan akta pendirian yang telah terdaftar di Kementerian Hukum dan Hak Azasi Manusia / Pengadilan Negeri.</span><br />\r\n&nbsp;</p>\r\n\r\n<p style=\"text-align: center;\"><a href=\"http://dp3ak.msnsolutindo.com/hubungi-kami.html\"><input class=\"btn btn-primary btn-lg btn-block\" id=\"submit\" name=\"kirim\" type=\"submit\" value=\"Entry Form\" /></a></p>\r\n', '2020-04-29', '');
INSERT INTO `halamanstatis` VALUES (28, 'Selamat Idul Fitri 1441H ', 'selamat-idul-fitri-1441h-', '<p><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"360\" src=\"//www.youtube.com/embed/ho01zcy3FDs?rel=0\" width=\"640\"></iframe></p>\r\n', '2020-05-24', '');
INSERT INTO `halamanstatis` VALUES (29, 'Bidang Kesetaraan Gender', 'bidang-kesetaraan-gender', '<p><strong>Bidang Kesetaraan Gender</strong></p>\r\n\r\n<p>Tugas Pokok Bidang Kesetaraan Gender adalah merencanakan, melaksanakan dan mengkoordinasikan program kegiatan di bidang Kesetaraan Gender. Sedangkan fungsi Bidang Kesetaraan Gender adalah :</p>\r\n\r\n<p>1) Perumusan kebijakan teknis di bidang Kesetaraan Gender;</p>\r\n\r\n<p>2) Perumusan pedoman teknis dan program Kesetaraan Gender;</p>\r\n\r\n<p>3) Pelaksanaan Norma, Standar, Prosedur dan Kriteria terkait Pengarusutamaan Gender;</p>\r\n\r\n<p>4) penyusunan Sistem Informasi Data Gender;</p>\r\n\r\n<p>5) pelaksanaan koordinasi, sinkronisasi, fasilitasi di bidang Kesetaraan Gender;</p>\r\n\r\n<p>6) pelaksanaan monitoring, evaluasi dan pelaporan bidang Kesetaraan Gender;</p>\r\n\r\n<p>7) pelaksanaan tugas-tugas lain yang diberikan oleh Kepala Dinas.</p>\r\n\r\n<p>Susunan organisasi di Bidang Kesetaraan Gender terdiri atas :</p>\r\n\r\n<p><strong>1. Seksi Penguatan Kelembagaan Gender</strong>, yang mempunyai tugas :</p>\r\n\r\n<p>a. menyiapkan bahan perumusan kebijakan teknis terkait Penguatan Kelembagaan Gender;</p>\r\n\r\n<p>b. menyiapkan bahan penyusunan pedoman teknis dan program terkait penguatan kelembagaan gender;</p>\r\n\r\n<p>c. melaksanakan kebijakan teknis di bidang penguatan kelembagaan gender;</p>\r\n\r\n<p>d. menyiapkan bahan koordinasi, sinkronisasi dan fasilitasi terkait penguatan kelembagaan gender;</p>\r\n\r\n<p>e. menyiapkan bahan pelaksanaan kebijakan untuk meningkatkan sumber daya manusia yang responsive gender;</p>\r\n\r\n<p>f. menyiapkan bahan pelaksanaan pengembangan, komunikasi, informasi dan edukasi penguatan kelembagaan gender;</p>\r\n\r\n<p>g. menyiapkan bahan pelaksanaan monitoring, evaluasi dan pelaporan penguatan kelembagaan gender;</p>\r\n\r\n<p>h. melaksanakan tugas-tugas lain yang diberikan oleh Kepala Bidang.</p>\r\n\r\n<p><strong>2. Seksi Kesetaraan Gender dalam Pembangunan</strong>, yang mempunyai tugas :</p>\r\n\r\n<p>a. menyiapkan bahan perumusan kebijakan teknis terkait kesetaraan gender dalam pembangunan;</p>\r\n\r\n<p>b. melaksanakan kebijakan teknis di bidang kesetaraan gender dalam pembangunan;</p>\r\n\r\n<p>c. Menyiapkan bahan perumusan pedoman kesetaraan gender dalam pembangunan;</p>\r\n\r\n<p>d. Menyiapkan bahan pelaksanaan kebijakan peningkatan sarana prasarana yang responsif gender;</p>\r\n\r\n<p>e. Menyiapkan bahan koordinasi, sinkronisasi dan fasilitasi terkait kesetaraan gender dalam pembangunan;</p>\r\n\r\n<p>f. Menyiapkan bahan pelaksanaan pengembangan, komunikasi, informasi dan edukasi kesetaraan gender dalam pembangunan;</p>\r\n\r\n<p>g. Menyiapkan bahan pelaksanaan monitoring, evaluasi dan pelaporan Kesetaraan gender dalam pembangunan ;</p>\r\n\r\n<p>h. melaksanakan tugas-tugas lain yang diberikan oleh Kepala Bidang.</p>\r\n\r\n<p><strong>3. Seksi Sistem Data dan Informasi Gender</strong>, yang mempunyai tugas :</p>\r\n\r\n<p>a. menyiapkan bahan perumusan kebijakan teknis terkait data dan informasi gender;</p>\r\n\r\n<p>b. menyiapkan bahan penyusunan pedoman teknis dan program terkait data dan informasi gender;</p>\r\n\r\n<p>c. melaksanakan pengolahan,analisis dan penyajian data Gender;</p>\r\n\r\n<p>d. menyiapkan bahan komunikasi, informasi dan edukasi terkait data gender;</p>\r\n\r\n<p>e. menyiapkan bahan pelaksanaan monitoring, evaluasi dan pelaporan data Gender;</p>\r\n\r\n<p>f. Melaksanakan tugas-tugas lain yang diberikan kepala Bidang.</p>\r\n', '2021-06-15', '6jatim.jpg');
INSERT INTO `halamanstatis` VALUES (30, 'Bidang Perlindungan dan Tumbuh Kembang Anak', 'bidang-perlindungan-dan-tumbuh-kembang-anak', '<p><strong>Bidang Perlindungan dan Tumbuh Kembang Anak</strong></p>\r\n\r\n<p>Tugas Pokok Bidang Perlindungan dan Tumbuh Kembang Anak adalah merencanakan, melaksanakan dan mengkoordinasikan program dan kegiatan bidang perlindungan dan tumbuh kembang anak. Sedangkan fungsi Bidang Perlindungan dan Tumbuh Kembang Anak adalah :</p>\r\n\r\n<p>1) Perumusan kebijakan teknis di bidang perlindungan dan tumbuh kembang anak;</p>\r\n\r\n<p>2) Perumusan pedoman teknis dan program perlindungan dan tumbuh kembang anak;</p>\r\n\r\n<p>3) Pelaksanaan norma, standar, prosedur dan kriteria terkait perlindungan anak;</p>\r\n\r\n<p>4) Pelaksanaan sistem informasi data perlindungan dan tumbuh kembang anak;</p>\r\n\r\n<p>5) Pelaksanaan koordinasi, sinkronisasi, fasilitasi di bidang perlindungan dan tumbuh kembang anak;</p>\r\n\r\n<p>6) Pelaksanaan monitoring, evaluasi dan pelaporan di bidang perlindungan dan tumbuh kembang anak;</p>\r\n\r\n<p>7) Pelaksanaan tugas-tugas lain yang diberikan oleh Kepala Dinas.</p>\r\n\r\n<p>Susunan organisasi di Bidang Perlindungan Perempuan dan Anak terdiri atas :</p>\r\n\r\n<p><strong>1. Seksi Perlindungan Anak</strong>, yang mempunyai tugas :</p>\r\n\r\n<p>a. menyiapkan bahan perumusan kebijakan teknis terkait perlindungan anak;</p>\r\n\r\n<p>b. menyiapkan bahan penyusunan pedoman teknis dan program terkait perlindungan anak;</p>\r\n\r\n<p>c. melaksanakan kebijakan teknis terkait perlindungan anak;</p>\r\n\r\n<p>d. menyiapkan bahan koordinasi, sinkronisasi dan fasilitasi terkait perlindungan anak;</p>\r\n\r\n<p>e. menyiapkan bahan pelaksanaan pengembangan, komunikasi, informasi dan edukasi perlindungan anak;</p>\r\n\r\n<p>f. menyiapkan bahan pelaksanaan monitoring, evaluasi dan pelaporan terkait perlindungan anak;</p>\r\n\r\n<p>g. melaksanakan tugas-tugas lain yang diberikan oleh Kepala Bidang</p>\r\n\r\n<p><strong>2.</strong> <strong>Seksi Tumbuh Kembang Anak</strong>, yang mempunyai tugas :</p>\r\n\r\n<p>a. Menyiapkan bahan perumusan kebijakan teknis terkait tumbuh kembang anak;</p>\r\n\r\n<p>b. Menyiapkan bahan penyusunan pedoman teknis dan program terkait tumbuh kembang anak;</p>\r\n\r\n<p>c. Melaksanakan kebijakan teknis terkait tumbuh kembang anak;</p>\r\n\r\n<p>d. Menyiapkan bahan koordinasi, sinkronisasi dan fasilitasi terkait tumbuh kembang anak;</p>\r\n\r\n<p>e. Menyiapkan bahan pelaksanaan pengembangan, komunikasi, informasi dan edukasi tumbuh kembang anak;</p>\r\n\r\n<p>f. Menyiapkan bahan pelaksanaan monitoring, evaluasi dan pelaporan terkait tumbuh kembang anak;</p>\r\n\r\n<p>g. Melaksanakan tugas-tugas lain yang diberikan oleh Kepala Bidang</p>\r\n\r\n<p><strong>3</strong>. <strong>Seksi Penguatan Kelembagaan Hak Anak</strong>, yang mempunyai tugas :</p>\r\n\r\n<p>a. Menyiapkan bahan perumusan kebijakan teknis terkait penguatan kelembagaan hak anak;</p>\r\n\r\n<p>b. Menyiapkan bahan penyusunan pedoman teknis dan program terkait penguatan kelembagaan hak anak;</p>\r\n\r\n<p>c. Melaksanakan kebijakan teknis terkait penguatan kelembagaan hak anak;</p>\r\n\r\n<p>d. Menyiapkan bahan koordinasi, sinkronisasi dan fasilitasi terkait penguatan kelembagaan hak anak;</p>\r\n\r\n<p>e. Menyiapkan bahan pengolahan data kelembagaan hak anak;</p>\r\n\r\n<p>f. Menyiapkan bahan pelaksanaan pengembangan, komunikasi, informasi dan edukasi penguatan kelembagaan hak anak;</p>\r\n\r\n<p>g. menyiapkan bahan pelaksanaan monitoring, evaluasi dan pelaporan terkait penguatan kelembagaan hak anak;</p>\r\n\r\n<p>h. Melaksanakan tugas-tugas lain yang diberikan oleh Kepala Bidang</p>\r\n', '2021-06-15', '17jatim.jpg');
INSERT INTO `halamanstatis` VALUES (31, 'Bidang Pemberdayaan dan Perlindungan Perempuan', 'bidang-pemberdayaan-dan-perlindungan-perempuan', '<p><strong>Bidang Pemberdayaan dan Perlindungan Perempuan</strong></p>\r\n\r\n<p>Tugas Pokok Bidang Pemberdayaan dan Perlindungan Perempuan adalah merencanakan, melaksanakan dan mengkoordinasikan program kegiatan di bidang pemberdayaan dan perlindungan perempuan. Sedangkan fungsi Bidang Pemberdayaan dan Perlindungan Perempuan adalah :</p>\r\n\r\n<p>a. Perumusan kebijakan teknis di bidang Pemberdayaan dan Perlindungan Perempuan;</p>\r\n\r\n<p>b. Perumusan pedoman teknis dan program Pemberdayaan dan Perlindungan Perempuan;</p>\r\n\r\n<p>c. Pelaksanaan pengolahan data Pemberdayaan dan Perlindungan Perempuan;</p>\r\n\r\n<p>d. Pelaksanaan koordinasi, sinkronisasi, fasilitasi di bidang Pemberdayaan dan Perlindungan Perempuan;</p>\r\n\r\n<p>e. Pelaksanaan monitoring, evaluasi dan pelaporan di bidang Pemberdayaan dan Perlindungan Perempuan;</p>\r\n\r\n<p>f. Pelaksanaan tugas-tugas lain yang diberikan oleh Kepala Dinas.</p>\r\n\r\n<p>Susunan organisasi di Bidang Pemberdayaan dan Perlindungan Perempuan terdiri atas :</p>\r\n\r\n<p><strong>1. Seksi Pemberdayaan Perempuan Bidang Ekonomi dan Lingkungan</strong>, yang mempunyai tugas :</p>\r\n\r\n<p>a. Menyiapkan bahan perumusan kebijakan teknis terkait Pemberdayaan Perempuan Bidang Ekonomi dan Lingkungan;</p>\r\n\r\n<p>b. Menyiapkan bahan penyusunan pedoman teknis dan program terkait Pemberdayaan Perempuan Bidang Ekonomi dan Lingkungan;</p>\r\n\r\n<p>c. Melaksanakan kebijakan teknis terkait Pemberdayaan Perempuan Bidang Ekonomi dan Lingkungan;</p>\r\n\r\n<p>d. menyiapkan bahan koordinasi, sinkronisasi dan fasilitasi terkait Pemberdayaan Perempuan Bidang Ekonomi dan Lingkungan;</p>\r\n\r\n<p>e. menyiapkan bahan pengolahan data Pemberdayaan Perempuan Bidang Ekonomi dan Lingkungan;</p>\r\n\r\n<p>f. menyiapkan bahan pelaksanaan pengembangan, komunikasi, informasi dan edukasi Pemberdayaan Perempuan Bidang Ekonomi dan Lingkungan;</p>\r\n\r\n<p>g. menyiapkan bahan pelaksanaan monitoring, evaluasi dan pelaporan terkait Pemberdayaan Perempuan Bidang Ekonomi dan Lingkungan;</p>\r\n\r\n<p>h. melaksanakan tugas-tugas lain yang diberikan oleh Kepala Bidang</p>\r\n\r\n<p><strong>2. Seksi Pemberdayaan Perempuan Bidang Politik dan Sosial Budaya</strong>, yang mempunyai tugas :</p>\r\n\r\n<p>a. Menyiapkan bahan perumusan kebijakan teknis terkait Pemberdayaan Perempuan Bidang Politik dan Sosial Budaya;</p>\r\n\r\n<p>b. Menyiapkan bahan penyusunan pedoman teknis dan program terkait Pemberdayaan Perempuan Bidang Politik dan Sosial Budaya;</p>\r\n\r\n<p>c. Melaksanakan kebijakan teknis terkait Pemberdayaan Perempuan Bidang Politik dan Sosial Budaya;</p>\r\n\r\n<p>d. Menyiapkan bahan koordinasi, sinkronisasi dan fasilitasi terkait Pemberdayaan Perempuan Bidang Politik dan Sosial Budaya;</p>\r\n\r\n<p>e. Menyiapkan bahan pengolahan data Pemberdayaan Perempuan Bidang Politik dan Sosial Budaya;</p>\r\n\r\n<p>f. Menyiapkan bahan pelaksanaan pengembangan, komunikasi, informasi dan edukasi Pemberdayaan Perempuan Bidang Politik dan Sosial Budaya;</p>\r\n\r\n<p>g. Menyiapkan bahan pelaksanaan monitoring, evaluasi dan pelaporan terkait Pemberdayaan Perempuan Bidang Politik dan Sosial Budaya;</p>\r\n\r\n<p>h. Melaksanakan tugas-tugas lain yang diberikan oleh Kepala Bidang</p>\r\n\r\n<p><strong>3. Seksi Perlindungan Perempuan</strong>, yang mempunyai tugas :</p>\r\n\r\n<p>a. Menyiapkan bahan perumusan kebijakan teknis terkait Perlindungan Perempuan;</p>\r\n\r\n<p>b. Menyiapkan bahan penyusunan pedoman teknis dan program terkait Perlindungan Perempuan;</p>\r\n\r\n<p>c. Melaksanakan kebijakan teknis terkait Perlindungan Perempuan;</p>\r\n\r\n<p>d. Menyiapkan bahan koordinasi, sinkronisasi dan fasilitasi terkait Perlindungan Perempuan;</p>\r\n\r\n<p>e. Menyiapkan bahan pengolahan data Perlindungan Perempuan;</p>\r\n\r\n<p>f. Menyiapkan bahan analisis dalam upaya pencegahan kekerasan terhadap perempuan;</p>\r\n\r\n<p>g. Menyiapkan bahan pelaksanaan pengembangan, komunikasi, informasi dan edukasi Perlindungan Perempuan;</p>\r\n\r\n<p>h. Menyiapkan bahan pelaksanaan monitoring, evaluasi dan pelaporan terkait Perlindungan Perempuan;</p>\r\n\r\n<p>i. Melaksanakan tugas-tugas lain yang diberikan oleh Kepala Bidang.</p>\r\n', '2021-06-15', '92jatim.jpg');
INSERT INTO `halamanstatis` VALUES (32, 'Bidang Pengendalian Penduduk, Keluarga Berencana, dan Ketahanan Keluarga', 'bidang-pengendalian-penduduk-keluarga-berencana-dan-ketahanan-keluarga', '<p><strong>Bidang Pengendalian Penduduk, Keluarga Berencana dan Ketahanan Keluarga</strong></p>\r\n\r\n<p>Tugas Pokok Bidang Pengendalian Penduduk, Keluarga Berencana dan Ketahanan Keluarga adalah merencanakan, melaksanakan dan mengkoordinasikan tugas pemerintahan di bidang Pengendalian Penduduk, Keluarga Berencana dan Ketahanan Keluarga. Sedangkan fungsi Bidang Pengendalian Penduduk, Keluarga Berencana dan Ketahanan Keluarga adalah :</p>\r\n\r\n<p>a. Perumusan kebijakan teknis di bidang Pengendalian Penduduk, Keluarga Berencana dan Ketahanan Keluarga;</p>\r\n\r\n<p>b. Perumusan pedoman teknis dan program Pengendalian Penduduk, Keluarga Berencana dan Ketahanan Keluarga;</p>\r\n\r\n<p>c. Pelaksanaan pengolahan data Pengendalian Penduduk, Keluarga Berencana dan Ketahanan Keluarga;</p>\r\n\r\n<p>d. Pelaksanaan koordinasi, sinkronisasi, fasilitasi di bidang Pengendalian Penduduk, Keluarga Berencana dan Ketahanan Keluarga;</p>\r\n\r\n<p>e. Pelaksanaan Penguatan kelembagaan bidang Pengendalian Penduduk,Keluarga Berencana dan Ketahanan Keluarga;</p>\r\n\r\n<p>f. Pelaksanaan monitoring, evaluasi dan pelaporan di bidang Pengendalian Penduduk, Keluarga Berencana dan Ketahanan Keluarga;</p>\r\n\r\n<p>g. Pelaksanaan tugas-tugas lain yang diberikan oleh Kepala Dinas.</p>\r\n\r\n<p>Susunan organisasi di Bidang Pengendalian Penduduk, Keluarga Berencana</p>\r\n\r\n<p>dan Ketahanan Keluarga terdiri atas :</p>\r\n\r\n<p><strong>1. Seksi Pengendalian Penduduk</strong>, yang mempunyai tugas :</p>\r\n\r\n<p>a. Menyiapkan bahan perumusan kebijakan teknis terkait pengendalian penduduk;</p>\r\n\r\n<p>b. Menyiapkan bahan penyusunan pedoman teknis dan program terkait pengendalian penduduk;</p>\r\n\r\n<p>c. Melaksanakan kebijakan teknis terkait pengendalian penduduk;</p>\r\n\r\n<p>d. Menyiapkan bahan koordinasi, sinkronisasi dan fasilitasi terkait pengendalian penduduk;</p>\r\n\r\n<p>e. Menyiapkan bahan pengolahan data pengendalian penduduk;</p>\r\n\r\n<p>f. Menyiapkan bahan pelaksanaan pengembangan komunikasi, informasi dan edukasi pengendalian penduduk;</p>\r\n\r\n<p>g. Menyiapkan bahan pelaksanaan monitoring, evaluasi dan pelaporan terkait pengendalian penduduk; dan</p>\r\n\r\n<p>h. Melaksanakan tugas-tugas lain yang diberikan oleh Kepala Bidang</p>\r\n\r\n<p><strong>2. Seksi Keluarga Berencana dan Kesehatan Reproduksi</strong>, yang mempunyai tugas :</p>\r\n\r\n<p>a. Menyiapkan bahan perumusan kebijakan teknis keluarga berencana dan kesehatan reproduksi;</p>\r\n\r\n<p>b. Menyiapkan bahan penyusunan pedoman teknis dan program keluarga berencana dan kesehatan reproduksi;</p>\r\n\r\n<p>c. Menyiapkan bahan pelaksanaan pengembangan, komunikasi, informasi dan edukasi dalam bidang keluarga berencana dan kesehatan reproduksi;</p>\r\n\r\n<p>d. Menyiapkan bahan pelaksanaan koordinasi, sinkronisasi, dalam</p>\r\n\r\n<p>pelaksanaan program bidang keluarga berencana dan kesehatan reproduksi;</p>\r\n\r\n<p>e. Menyiapkan bahan peningkatan peran serta organisasi kemasyarakatan dalam kesertaan keluarga berencana dan kesehatan reproduksi;</p>\r\n\r\n<p>f. Menyiapkan bahan pelaksanaan monitoring, evaluasi dan pelaporan pelaksanaan program keluarga berencana dan kesehatan reproduksi;</p>\r\n\r\n<p>g. Melaksanakan tugas-tugas lain yang diberikan oleh Kepala Bidang.</p>\r\n\r\n<p><strong>3. Seksi Ketahanan Keluarga</strong>, yang mempunyai tugas :</p>\r\n\r\n<p>a. Menyiapkan bahan perumusan kebijakan teknis ketahanan keluarga;</p>\r\n\r\n<p>b. Menyiapkan bahan penyusunan pedoman teknis dan program ketahanan keluarga;</p>\r\n\r\n<p>c. Menyiapkan bahan pelaksanaan pengembangan, komunikasi, informasi dan edukasi dalam pembangunan keluarga, pembinaan ketahanan keluarga;</p>\r\n\r\n<p>d. Menyiapkan bahan pelaksanaan koordinasi, sinkronisasi, dalam pelaksanaan program bidang ketahanan keluarga;</p>\r\n\r\n<p>e. Menyiapkan bahan pelaksanaan peningkatan peran serta organisasi kemasyarakatan dalam ketahanan keluarga;</p>\r\n\r\n<p>f. Menyiapkan bahan pelaksanaan monitoring, evaluasi dan pelaporan pelaksanaan program pembangunan keluarga, pembinaan ketahanan keluarga;</p>\r\n\r\n<p>g. Melaksanakan tugas-tugas lain yang diberikan oleh Kepala Bidang.</p>\r\n', '2021-06-15', '29jatim.jpg');
INSERT INTO `halamanstatis` VALUES (33, 'Bidang Kependudukan dan Pencatatan Sipil', 'bidang-kependudukan-dan-pencatatan-sipil', '<article class=\"news margin-bottom-15\" style=\"box-sizing: border-box; margin-bottom: 70px;\">\r\n<div style=\"box-sizing: border-box; text-align: justify;\">\r\n<div class=\"blog_grid_con\" open=\"\" style=\"box-sizing: border-box; margin: 0px; padding: 25px 0px; border: none; font-size: 14px; vertical-align: baseline; background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border-radius: 0px 0px 3px 3px; float: none; width: 825px; clear: both; color: rgb(102, 102, 102); font-family: \">\r\n<p><strong>Bidang Kependudukan dan Pencatatan Sipil</strong></p>\r\n\r\n<p>Tugas Pokok Bidang Kependudukan dan Pencatatan Sipil adalah menghimpun, mengolah dan menyajikan data penduduk hasil pelayanan kependudukan dan pencatatan sipil, serta melakukan pembinaan di bidang kependudukan dan pencatatan sipil. Sedangkan fungsi Bidang Pengendalian Penduduk dan Keluarga Berencana adalah :</p>\r\n\r\n<p>a. Perumusan kebijakan teknis kependudukan dan pencatatan sipil;</p>\r\n\r\n<p>b. Pelaksanaan penetapan kebijakan di bidang pendaftaran penduduk dan pencatatan sipil;</p>\r\n\r\n<p>c. Pelaksanaan fasilitasi, sosialisasi, bimbingan teknis, advokasi, supervise dan konsultasi pendaftaran penduduk dan pencatatan sipil;</p>\r\n\r\n<p>d. Pelaksanaan koordinasi penyelenggaraan pendaftaran penduduk dan pencatatan sipil;</p>\r\n\r\n<p>e. Pelaksanaan penyusunan database hasil pendaftaran penduduk dan pencatatan sipil;</p>\r\n\r\n<p>f. Pelaksanaan pembinaan dan pengembangan sumber daya manusia pengelola Sistem Administrasi Kependudukan, pendaftaran penduduk dan pencatatan sipil;</p>\r\n\r\n<p>g. Penyajian, pemanfaatan dan pengelolaan informasi data kependudukan;</p>\r\n\r\n<p>h. Penyusunan profil kependudukan;</p>\r\n\r\n<p>i. Pelaksanaan monitoring, evaluasi dan pelaporan kependudukan dan pencatatan sipil;</p>\r\n\r\n<p>j. Pelaksanaan tugas-tugas lain yang diberikan oleh Kepala Dinas. Susunan organisasi di Bidang Kependudukan dan Pencatatan Sipil terdiri atas :</p>\r\n\r\n<p><strong>1. Seksi Pendaftaran Penduduk dan Pencatatan Sipil</strong>, yang mempunyai tugas :</p>\r\n\r\n<p>a. Menyiapkan bahan pengumpulan, penghimpunan, pengolahan, penyajian dan pengolahan data hasil registrasi pendaftaran penduduk dan pencatatan sipil;</p>\r\n\r\n<p>b. Menyiapkan bahan perumusan kebijakan pelaksanaan pendaftaran penduduk dan pencatatan sipil;</p>\r\n\r\n<p>c. Menyiapkan bahan perumusan fasilitasi, bimbingan teknis, advokasi, supervisi dan konsultasi pelaksanaan pendaftaran penduduk dan pencatatan sipil;</p>\r\n\r\n<p>d. Menyiapkan bahan pembinaan dan pengembangan sumber daya manusia pengelola pendaftaran penduduk dan pencatatan sipil;</p>\r\n\r\n<p>e. Menyiapkan bahan penyusunan data hasil registrasi pendaftaran penduduk dan pencatatan sipil;</p>\r\n\r\n<p>f. Menyiapkan bahan monitoring, evaluasi dan pelaporan pendaftaran penduduk dan pencatatan sipil; dan</p>\r\n\r\n<p>g. Melaksanakan tugas-tugas lain yang diberikan oleh Kepala Bidang.</p>\r\n\r\n<p><strong>2. Seksi Pengelolaan Informasi Penduduk</strong>, yang mempunyai tugas :</p>\r\n\r\n<p>a. Menyiapkan bahan penyajian dan pengelolaan informasi data kependudukan;</p>\r\n\r\n<p>b. Menyiapkan bahan penyusunan pedoman teknis dan kebijakan pengembangan informasi kependudukan;</p>\r\n\r\n<p>c. Menyiapkan bahan penyelenggaraan sistem informasi administrasi kependudukan;</p>\r\n\r\n<p>d. Menyiapkan bahan fasilitasi kerja sama pemanfaatan data kependudukan, dokumen kependudukan dan Nomor Induk Kependudukan;</p>\r\n\r\n<p>e. Menyiapkan bahan penyusunan publikasi dan sosialisasi kebijakan kependudukan;</p>\r\n\r\n<p>f. Menyiapkan bahan pelaksanaan koordinasi dengan media informasi;</p>\r\n\r\n<p>g. Menyiapkan bahan informasi data kependudukan;</p>\r\n\r\n<p>h. Menyiapkan bahan monitoring, evaluasi dan pelaporan pengelolaan informasi data kependudukan;</p>\r\n\r\n<p>i. Melaksanakan tugas-tugas lain yang diberikan oleh kepala Bidang.</p>\r\n\r\n<p><strong>3. Seksi Perkembangan Penduduk</strong>, yang mempunyai tugas :</p>\r\n\r\n<p>a. Menyiapkan bahan penyusunan data perkembangan penduduk;</p>\r\n\r\n<p>b. Menyiapkan bahan data Sistem Administrasi Kependudukan dalam rangka pengendalian kuantitas, kualitas dan mobilitas penduduk</p>\r\n\r\n<p>c. Menyiapkan bahan dan pelaksanaan penyusunan profil kependudukan;</p>\r\n\r\n<p>d. Menyiapkan bahan pelaksanaan kebijakan penyelenggaraan pengendalian kuantitas, pengembangan kualitas, pengarahan mobilitas dan persebaran penduduk serta perlindungan penduduk;</p>\r\n\r\n<p>e. Menyiapkan bahan fasilitasi, koordinasi, monitoring, evaluasi dan pelaporan perkembangan penduduk;</p>\r\n\r\n<p>f. Melaksanakan tugas-tugas lain yang diberikan oleh Kepala Bidang.</p>\r\n</div>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 15px;\">&nbsp;</p>\r\n</div>\r\n\r\n<div class=\"clearfix\" style=\"box-sizing: border-box;\">&nbsp;</div>\r\n</article>\r\n\r\n<ul class=\"rrssb-buttons margin-bottom-15 rrssb-1\" font-size:=\"\" height:=\"\" helvetica=\"\" padding-left:=\"\" padding-right:=\"\" style=\"box-sizing: border-box; margin: 0px; font-family: \" width:=\"\">\r\n	<li class=\"rrssb-facebook\" data-initwidth=\"20\" data-size=\"69\" style=\"box-sizing: border-box; float: left; height: 36px; line-height: 13px; list-style: none; margin: 0px; padding: 0px 2px; width: 149px;\"><a class=\"popup\" href=\"https://www.facebook.com/sharer/sharer.php?u=http://dp3ak.jatimprov.go.id/statis-10-struktur-organisasi.html\" style=\"box-sizing: border-box; background-color: rgb(48, 97, 153); color: rgb(31, 57, 131); text-decoration-line: none; border-radius: 2px; display: block; -webkit-font-smoothing: antialiased; font-weight: 700; height: 36px; padding: 11px 7px 12px 27px; position: relative; text-align: center; text-transform: uppercase; transition: background-color 0.2s ease-in-out 0s; width: 145px;\"><span class=\"rrssb-icon\" style=\"box-sizing: border-box; display: block; left: 10px; padding-top: 9px; position: absolute; top: 0px; width: 14.5px;\"><svg viewbox=\"0 0 29 29\" xmlns=\"http://www.w3.org/2000/svg\"><path d=\"M26.4 0H2.6C1.714 0 0 1.715 0 2.6v23.8c0 .884 1.715 2.6 2.6 2.6h12.393V17.988h-3.996v-3.98h3.997v-3.062c0-3.746 2.835-5.97 6.177-5.97 1.6 0 2.444.173 2.845.226v3.792H21.18c-1.817 0-2.156.9-2.156 2.168v2.847h5.045l-.66 3.978h-4.386V29H26.4c.884 0 2.6-1.716 2.6-2.6V2.6c0-.885-1.716-2.6-2.6-2.6z\"></path></svg></span></a></li>\r\n</ul>\r\n', '2021-06-15', '13jatim.jpg');
